create table public.namespace
(
    id                        bigint                not null primary key,
    created                   timestamp             not null,
    deprecated                boolean               not null,
    deprecation_date          timestamp,
    description               varchar(2000)         not null,
    mir_id                    varchar(255)          not null unique,
    modified                  timestamp,
    name                      varchar(255)          not null,
    namespace_embedded_in_lui boolean               not null,
    pattern                   varchar(255)          not null,
    prefix                    varchar(255)          not null unique,
    sample_id                 varchar(255)          not null,
    contact_person_id         bigint references public.person,
    deprecation_offline_date  timestamp,
    render_deprecated_landing boolean default false not null,
    deprecation_statement     varchar(255),
    info_on_postmortem_access varchar(255),
    successor_id              bigint references public.namespace
);

alter table public.namespace
    owner to devusername;

create index idx_name
    on public.namespace (name);


insert into public.namespace (id, created, deprecated, deprecation_date, description, mir_id, modified, name, namespace_embedded_in_lui, pattern, prefix, sample_id, contact_person_id, deprecation_offline_date, render_deprecated_landing, deprecation_statement, info_on_postmortem_access, successor_id)
