        (989, '2019-06-11 14:16:57.671000', false, null, 'The GenPept database is a collection of sequences based on translations from annotated coding regions in GenBank.', 'MIR:00000345', '2019-06-11 14:16:57.671000', 'GenPept', false, '^\w{3}\d{5}(\.\d+)?$', 'genpept', 'CAA71118.1', null, null, false, null, null, null),
