        (3429, '2023-02-03 09:47:17.713000', false, null, 'Nonlinear Force-Free Field Three-Dimensional Magnetic Fields Data of Solar Active Regions Database', 'MIR:00000988', '2023-02-03 09:47:17.713000', 'NLFFF Database', false, '^[0-9]+$', 'nlfff', '345201101230312003', null, null, false, null, null, null),
        (341, '2019-06-11 14:16:00.951000', true, '2023-01-05 20:09:01.370000', 'GeneDB is a genome database for prokaryotic and eukaryotic organisms and provides a portal through which data generated by the "Pathogen Genomics" group at the Wellcome Trust Sanger Institute and other collaborating sequencing centres can be accessed.', 'MIR:00000106', '2023-09-12 10:55:57.622000', 'GeneDB', false, '^[\w\d\.-]*$', 'genedb', 'LinJ.20.0070', null, null, false, 'The Wellcome Sanger Institute no longer curates any of the genomes listed. All genomes on GeneDB can now be found on: PlasmoDB, FungiDB, TriTrypDB, and Wormbase Parasite.', null, null),
        (3719, '2023-10-30 09:39:26.272000', false, null, 'The genome assembly database contains detailed information about genome assemblies for eukaryota, bacteria and archaea. The scope of the genome collections database RefSeq accessions does not extend to viroids and bacteriophage.', 'MIR:00001030', '2023-10-30 10:34:56.198000', 'Genome assembly database - RefSeq accessions', false, '^GCF_[0-9]{9}(\.[0-9]+)?$', 'refseq.gcf', 'GCF_000001405', null, null, false, null, null, null),
        (1211, '2019-06-11 14:17:16.333000', true, '2023-07-04 10:26:40.148000', 'Bgee is a database of gene expression patterns within particular anatomical structures within a species, and between different animal species. This collection refers to developmental stages.', 'MIR:00000419', '2023-09-13 08:52:47.196000', 'Bgee stage', false, '^(FBvd|XtroDO|HsapDO|MmusDO)\:\d+$', 'bgee.stage', 'HsapDO:0000004', null, null, true, 'These entries are not available any more in the last versions of the Bgee database.', null, null),
        (3723, '2023-10-30 09:40:47.492000', false, null, 'An ontology to represent medically relevant actions, procedures, therapies, interventions, and recommendations.', 'MIR:00001032', '2023-10-30 09:40:47.492000', 'Medical Action Ontology', false, '\d{7}', 'maxo', '0001073', null, null, false, null, null, null),
        (169, '2019-06-11 14:15:44.579000', false, null, 'The Signaling Gateway provides  information on  mammalian proteins involved in cellular signaling.', 'MIR:00000045', '2019-06-11 14:15:44.579000', 'Signaling Gateway', false, 'A\d{6}$', 'signaling-gateway', 'A001094', null, null, false, null, null, null),
        (1213, '2019-06-11 14:17:16.514000', true, '2023-07-04 10:26:56.707000', 'Bgee is a database of gene expression patterns within particular anatomical structures within a species, and between different animal species. This collection refers to anatomical structures.', 'MIR:00000420', '2023-09-13 08:53:52.558000', 'Bgee organ', false, '^(XAO|ZFA|EHDAA|EMAPA|EV|MA)\:\d+$', 'bgee.organ', 'EHDAA:2185', null, null, true, 'These entries are not available any more in the last versions of the Bgee database.', null, null),
        (41, '2019-06-11 14:15:31.442000', true, '2020-06-04 11:17:21.453000', 'MIRIAM Registry is an online resource created to catalogue collections (Gene Ontology, Taxonomy or PubMed are some examples) and the corresponding resources (physical locations) providing access to those data collections. The Registry provides unique and perennial URIs for each entity of those data collections.', 'MIR:00000008', '2023-09-13 08:57:20.977000', 'MIRIAM Registry collection', false, '^MIR:000\d{5}$', 'miriam.collection', 'MIR:00000008', null, null, false, 'The MIRIAM collection has been replaced by the identifiers.org registry', null, null),
        (3730, '2023-10-31 16:13:48.191000', false, null, 'This is the namespace for the archive of sequence and other files provided by NCBI e.g. in SRA and dbGaP. These files are related to objects in the sequencing data model managed under the insdc.sra namespace. ', 'MIR:00001034', '2023-10-31 16:13:48.191000', 'NCBI Data Repository Service', false, '^[0-9a-fA-F]{32}$', 'ncbidrs', '72ff6ff882ec447f12df018e6183de59', null, null, false, null, null, null),
        (197, '2019-06-11 14:15:47.447000', false, null, 'Evidence codes can be used to specify the type of supporting evidence for a piece of knowledge. This allows inference of a ''level of support'' between an entity and an annotation made to an entity.', 'MIR:00000055', '2019-06-11 14:15:47.447000', 'Evidence Code Ontology', true, 'ECO:\d{7}$', 'eco', '0000006', null, null, false, null, null, null),
        (3756, '2023-11-27 09:57:23.517000', false, null, 'Tri©DB is a newly developed integrated platform functioning as a knowledge base and reporting system for cancer precision medicine. This platform harmonizes and mines cancer-related data from various aspects, presenting them on a centralized platform with enhanced accessibility, rich annotations, and robust analysis capabilities. The development of Tri©DB is aimed at meeting the needs of a broad range of researchers, thereby propelling both foundational and translational research in cancer precision medicine.', 'MIR:00001036', '2023-11-27 09:57:23.517000', 'tricdb', false, '^[0-9a-f]{8}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{12}$', 'tricdb', '1eec8393-e598-41ed-9d8b-6d5b0db94470', null, null, false, null, null, null),
        (261, '2019-06-11 14:15:53.388000', false, null, 'MACiE (Mechanism, Annotation and Classification in Enzymes) is a database of enzyme reaction mechanisms. Each entry in MACiE consists of an overall reaction describing the chemical compounds involved, as well as the species name in which the reaction occurs. The individual reaction stages for each overall reaction are listed with mechanisms, alternative mechanisms, and amino acids involved.', 'MIR:00000077', '2019-06-11 14:15:53.388000', 'MACiE', false, '^M\d{4}$', 'macie', 'M0001', null, null, false, null, null, null),
        (3759, '2023-11-27 10:19:40.971000', false, null, 'Sharing descriptive Metadata is the first essential step towards Open Scientific Data. With this in mind, Maggot was specifically designed to annotate datasets by creating a metadata file to attach to the storage space. Indeed, it allows users to easily add descriptive metadata to datasets produced within a collective of people (research unit, platform, multi-partner project, etc.). This approach fits perfectly into a data management plan as it addresses the issues of data organization and documentation, data storage and frictionless metadata sharing within this same collective and beyond.', 'MIR:00001038', '2023-11-27 10:19:40.971000', 'Maggot', false, '^[A-Za-z0-9]+$', 'maggot', 'frim1', null, null, false, null, null, null),
        (312, '2019-06-11 14:15:58.342000', false, null, 'NeuroMorpho.Org is a centrally curated inventory of  digitally reconstructed neurons.', 'MIR:00000095', '2019-06-11 14:15:58.342000', 'NeuroMorpho', false, '^\w+$', 'neuromorpho', 'Rosa2', null, null, false, null, null, null),
        (363, '2019-06-11 14:16:03.253000', false, null, 'GlycomeDB is the result of a systematic data integration effort, and provides an overview of all carbohydrate structures available in public databases, as well as cross-links.', 'MIR:00000114', '2019-06-11 14:16:03.253000', 'GlycomeDB', false, '^\w+$', 'glycomedb', 'G77500AY', null, null, false, null, null, null),
        (873, '2019-06-11 14:16:47.981000', false, null, 'DragonDB is a genetic and genomic database for Antirrhinum majus (Snapdragon). This collection refers to allele information.', 'MIR:00000300', '2019-06-11 14:16:47.981000', 'DragonDB Allele', false, '^\w+$', 'dragondb.allele', 'cho', null, null, false, null, null, null),
        (923, '2019-06-11 14:16:52.167000', false, null, 'The database VBASE2 provides germ-line sequences of human and mouse immunoglobulin variable (V) genes.', 'MIR:00000320', '2019-06-11 14:16:52.167000', 'Vbase2', false, '^\w+$', 'vbase2', 'humIGHV025', null, null, false, null, null, null),
        (935, '2019-06-11 14:16:53.082000', false, null, 'The MMRRC database is a repository of available mouse stocks and embryonic stem cell line collections.', 'MIR:00000324', '2019-06-11 14:16:53.082000', 'MMRRC', false, '^\d+$', 'mmrrc', '70', null, null, false, null, null, null),
        (1074, '2019-06-11 14:17:04.735000', false, null, 'The PANTHER (Protein ANalysis THrough Evolutionary Relationships) Classification System is a resource that classifies genes by their functions, using published scientific experimental evidence and evolutionary relationships to predict function even in the absence of direct experimental evidence. PANTHER tree is a key element of the PANTHER System to represent ‘all’ of the evolutionary events in the gene family. PANTHER nodes represent the evolutionary events, either speciation or duplication, within the tree. PANTHER is maintaining stable identifier for these nodes.', 'MIR:00000374', '2019-06-11 14:17:04.735000', 'PANTHER Node', false, '^PTN\d{9}$', 'panther.node', 'PTN000000026', null, null, false, null, null, null),
        (1132, '2019-06-11 14:17:09.753000', false, null, 'The Experimental Factor Ontology (EFO) provides a systematic description of many experimental variables available in EBI databases. It combines parts of several biological ontologies, such as anatomy, disease and chemical compounds. The scope of EFO is to support the annotation, analysis and visualization of data handled by the EBI Functional Genomics Team.', 'MIR:00000391', '2019-06-11 14:17:09.753000', 'Experimental Factor Ontology', false, '^\d{7}$', 'efo', '0004859', null, null, false, null, null, null),
        (1189, '2019-06-11 14:17:14.533000', false, null, 'DNA barcoding is the use of short standardised segments of the genome for identification of species in all the Kingdoms of Life. The goal of the Fungal Barcoding site is to promote the DNA barcoding of fungi and other fungus-like organisms.', 'MIR:00000410', '2019-06-11 14:17:14.533000', 'Fungal Barcode', false, '^\d+$', 'fbol', '2224', null, null, false, null, null, null),
        (1270, '2019-06-11 14:17:21.507000', false, null, 'Genome properties is an annotation system whereby functional attributes can be assigned to a genome, based on the presence of a defined set of protein signatures within that genome.', 'MIR:00000443', '2019-06-11 14:17:21.507000', 'Genome Properties', false, '^GenProp\d+$', 'genprop', 'GenProp0699', null, null, false, null, null, null),
        (1275, '2019-06-11 14:17:21.919000', false, null, 'A structured controlled vocabulary of the adult anatomy of the mouse (Mus)', 'MIR:00000445', '2019-06-11 14:17:21.919000', 'Mouse Adult Gross Anatomy', true, '^MA:\d+$', 'ma', '0002502', null, null, false, null, null, null),
        (1395, '2019-06-11 14:17:32.366000', false, null, 'Animal Diversity Web (ADW) is an online database of animal natural history, distribution, classification, and conservation biology.', 'MIR:00000492', '2019-06-11 14:17:32.366000', 'Animal Diversity Web', false, '^[A-Z_a-z]+$', 'adw', 'Lycalopex_vetulus', null, null, false, null, null, null),
        (1507, '2019-06-11 14:17:43.371000', false, null, 'Google Patents covers the entire collection of granted patents and published patent applications from the USPTO, EPO, and WIPO. US patent documents date back to 1790, EPO and WIPO to 1978. Google Patents can be searched using patent number, inventor, classification, and filing date.', 'MIR:00000537', '2019-06-11 14:17:43.371000', 'Google Patents', false, '^[A-Z]{2}\d+([A-Z])?$', 'google.patent', 'US4145692', null, null, false, null, null, null),
        (1528, '2019-06-11 14:17:45.145000', false, null, 'The HMS LINCS Database currently contains information on experimental reagents (small molecule perturbagens, cells, and proteins). It aims to collect and disseminate information relating to the fundamental principles of cellular response in humans to perturbation. This collection references proteins.', 'MIR:00000545', '2019-06-11 14:17:45.145000', 'LINCS Protein', false, '^\d+$', 'lincs.protein', '200282', null, null, false, null, null, null),
        (1593, '2019-06-11 14:17:51.650000', false, null, 'Small Angle Scattering Biological Data Bank (SASBDB) is a curated repository for small angle X-ray scattering (SAXS) and neutron scattering (SANS) data and derived models. Small angle scattering (SAS) of X-ray and neutrons provides structural information on biological macromolecules in solution at a resolution of 1-2 nm. SASBDB provides freely accessible and downloadable experimental data, which are deposited together with the relevant experimental conditions, sample details, derived models and their fits to the data.', 'MIR:00000572', '2019-06-11 14:17:51.650000', 'SASBDB', false, '^[Ss][Aa][Ss][A-Za-z0-9]{3}[0-9]$', 'sasbdb', 'SASDAX8', null, null, false, null, null, null),
        (1752, '2019-06-11 14:18:06.853000', false, null, 'MicroScope is an integrative resource that supports systematic and efficient revision of microbial genome annotation, data management and comparative analysis.', 'MIR:00000631', '2019-06-11 14:18:06.853000', 'MicroScope', false, '^\d+$', 'microscope', '5601141', null, null, false, null, null, null),
        (1798, '2019-06-11 14:18:10.861000', false, null, 'A public place to process, interpret and share GC/MS metabolomics datasets.', 'MIR:00000648', '2019-06-11 14:18:10.861000', 'Metabolome Express', false, '^\d+$', 'mex', '36', null, null, false, null, null, null),
        (1942, '2019-06-19 15:38:51.382000', false, null, 'The European Registry of Materials is a simple registry with the sole purpose to mint material identifiers to be used by research projects throughout the life cycle of their project.', 'MIR:00000763', '2019-06-19 15:38:51.382000', 'European Registry of Materials', false, '^ERM[0-9]{8}$', 'erm', 'ERM00000044', null, null, false, null, null, null),
        (358, '2019-06-11 14:16:02.730000', false, null, 'PATO is an ontology of phenotypic qualities, intended for use in a number of applications, primarily defining composite phenotypes and phenotype  annotation.', 'MIR:00000112', '2019-06-11 14:16:02.730000', 'PATO', true, '^PATO:\d{7}$', 'pato', '0001998', null, null, false, null, null, null),
        (2524, '2021-02-17 18:06:52.762000', false, null, 'The Protein Ensemble Database is an open access database for the deposition of structural ensembles, including intrinsically disordered proteins.', 'MIR:00000795', '2021-02-17 18:06:52.762000', 'Protein Ensemble Database ensemble', false, '^PED\d{5}e\d{3}$', 'ped.ensemble', 'PED00017e001', null, null, false, null, null, null),
        (2702, '2021-06-24 15:54:23.109000', false, null, 'The Cell Version Control Repository is the single worldwide version control repository for engineered and natural cell lines', 'MIR:00000829', '2021-06-24 15:54:23.109000', 'Cell Version Control Repository', false, '^[0-9]+$', 'cellrepo', '82', null, null, false, null, null, null),
