        (2995, '2022-01-09 18:57:18.476000', false, null, 'Models developed with the Virtual Cell (VCell) software prorgam.', 'MIR:00000893', '2022-01-09 18:57:18.476000', 'VCell Published Models', false, '^\d{5,}$', 'vcell', '201022999', null, null, false, null, null, null),
        (3292, '2022-11-03 14:17:05.019000', false, null, 'ChecklistBank is an index and repository for taxonomic and nomenclatural datasets', 'MIR:00000964', '2022-11-03 14:17:05.019000', 'ChecklistBank', false, '^[0-9]+(LR)?$', 'clb', '1010', null, null, false, null, null, null),
        (220, '2019-06-11 14:15:49.786000', true, '2023-01-10 13:18:19.506000', 'ACLAME is a database dedicated to the collection and classification of mobile genetic elements (MGEs) from various sources, comprising all known phage genomes, plasmids and transposons.', 'MIR:00000063', '2023-09-12 09:47:26.445000', 'Aclame', true, '^mge:\d+$', 'mge', '2', null, null, true, null, null, null),
        (3355, '2022-11-29 12:03:56.649000', false, null, 'Sciflection is a public repository for experiments and associated spectra, usually uploaded from Electronic Lab Notebooks, shared under FAIR conditions', 'MIR:00000973', '2022-11-29 12:03:56.649000', 'Sciflection', false, '^[0-9a-f]{8}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{12}$', 'sciflection', '5ede4273-b26c-4ea4-adb7-3ce294ab3397', null, null, false, null, null, null),
        (1, '2019-06-11 14:15:26.925000', false, null, 'Chemical Entities of Biological Interest (ChEBI) is a freely available dictionary of molecular entities focused on ''small'' chemical compounds.', 'MIR:00000002', '2019-06-11 14:15:26.925000', 'ChEBI', true, '^CHEBI:\d+$', 'chebi', '36927', null, null, false, null, null, null),
        (13, '2019-06-11 14:15:28.483000', false, null, 'The Enzyme Classification contains the recommendations of the Nomenclature Committee of the International Union of Biochemistry and Molecular Biology on the nomenclature and classification of enzyme-catalysed reactions.', 'MIR:00000004', '2019-06-11 14:15:28.483000', 'Enzyme Nomenclature', false, '^\d+\.-\.-\.-|\d+\.\d+\.-\.-|\d+\.\d+\.\d+\.-|\d+\.\d+\.\d+\.(n)?\d+$', 'ec-code', '1.1.1.1', null, null, false, null, null, null),
        (23, '2019-06-11 14:15:29.457000', false, null, 'The UniProt Knowledgebase (UniProtKB) is a comprehensive resource for protein sequence and functional information with extensive cross-references to more than 120 external databases. Besides amino acid sequence and a description, it also provides taxonomic data and citation information.', 'MIR:00000005', '2019-06-11 14:15:29.457000', 'UniProt Knowledgebase', false, '^([A-N,R-Z][0-9]([A-Z][A-Z, 0-9][A-Z, 0-9][0-9]){1,2})|([O,P,Q][0-9][A-Z, 0-9][A-Z, 0-9][A-Z, 0-9][0-9])(\.\d+)?$', 'uniprot', 'P0DP23', null, null, false, null, null, null),
        (28, '2019-06-11 14:15:29.882000', false, null, 'The taxonomy contains the relationships between all living forms for which nucleic acid or protein sequence have been determined.', 'MIR:00000006', '2019-06-11 14:15:29.882000', 'Taxonomy', false, '^\d+$', 'taxonomy', '9606', null, null, false, null, null, null),
        (36, '2019-06-11 14:15:30.877000', false, null, 'BioModels Database is a data resource that allows biologists to store, search and retrieve published mathematical models of biological interests.', 'MIR:00000007', '2019-06-11 14:15:30.877000', 'BioModels Database', false, '^((BIOMD|MODEL)\d{10})|(BMID\d{12})$', 'biomodels.db', 'BIOMD0000000048', null, null, false, null, null, null),
        (43, '2019-06-11 14:15:31.658000', false, null, 'The International Classification of Diseases is the international standard diagnostic classification for all general epidemiological and many health management purposes.', 'MIR:00000009', '2019-06-11 14:15:31.658000', 'ICD', false, '^[A-Z]\d+(\.[-\d+])?$', 'icd', 'C34', null, null, false, null, null, null),
        (46, '2019-06-11 14:15:31.920000', false, null, 'IntAct provides a freely available, open source database system and analysis tools for protein interaction data.', 'MIR:00000010', '2019-06-11 14:15:31.920000', 'IntAct', false, '^EBI\-[0-9]+$', 'intact', 'EBI-2307691', null, null, false, null, null, null),
        (48, '2019-06-11 14:15:32.153000', false, null, 'InterPro is a database of protein families, domains and functional sites in which identifiable features found in known proteins can be applied to unknown protein sequences.', 'MIR:00000011', '2019-06-11 14:15:32.153000', 'InterPro', false, '^IPR\d{6}$', 'interpro', 'IPR000100', null, null, false, null, null, null),
        (51, '2019-06-11 14:15:32.480000', false, null, 'KEGG PATHWAY is a collection of manually drawn pathway maps representing our knowledge on the molecular interaction and reaction networks.', 'MIR:00000012', '2019-06-11 14:15:32.480000', 'KEGG Pathway', false, '^\w{2,4}\d{5}$', 'kegg.pathway', 'hsa00620', null, null, false, null, null, null),
        (53, '2019-06-11 14:15:32.730000', false, null, 'KEGG compound contains our knowledge on the universe of chemical substances that are relevant to life.', 'MIR:00000013', '2019-06-11 14:15:32.730000', 'KEGG Compound', false, '^C\d+$', 'kegg.compound', 'C12345', null, null, false, null, null, null),
        (55, '2019-06-11 14:15:32.930000', false, null, 'KEGG reaction contains our knowledge on the universe of reactions that are relevant to life.', 'MIR:00000014', '2019-06-11 14:15:32.930000', 'KEGG Reaction', false, '^R\d+$', 'kegg.reaction', 'R00100', null, null, false, null, null, null),
        (57, '2019-06-11 14:15:33.142000', false, null, 'PubMed is a service of the U.S. National Library of Medicine that includes citations from MEDLINE and other life science journals for biomedical articles back to the 1950s.', 'MIR:00000015', '2019-06-11 14:15:33.142000', 'PubMed', false, '^\d+$', 'pubmed', '16333295', null, null, false, null, null, null),
        (65, '2019-06-11 14:15:33.878000', false, null, 'Online Mendelian Inheritance in Man is a catalog of human genes and genetic disorders.', 'MIR:00000016', '2019-06-11 14:15:33.878000', 'OMIM', false, '^[*#+%^]?\d{6}$', 'mim', '603903', null, null, false, null, null, null),
        (69, '2019-06-11 14:15:34.294000', false, null, 'The PIR SuperFamily concept is being used as a guiding principle to provide comprehensive and non-overlapping clustering of UniProtKB sequences into a hierarchical order to reflect their evolutionary relationships.', 'MIR:00000017', '2019-06-11 14:15:34.294000', 'PIRSF', false, '^PIRSF\d{6}$', 'pirsf', 'PIRSF000100', null, null, false, null, null, null),
