        (87, '2019-06-11 14:15:35.970000', false, null, 'The Gene Ontology project provides a controlled vocabulary to describe gene and gene product attributes in any organism.', 'MIR:00000022', '2019-06-11 14:15:35.970000', 'Gene Ontology', true, '^GO:\d{7}$', 'go', '0006915', null, null, false, null, null, null),
        (97, '2019-06-11 14:15:37.056000', false, null, 'The Saccharomyces Genome Database (SGD) project collects information and maintains a database of the molecular biology of the yeast Saccharomyces cerevisiae.', 'MIR:00000023', '2019-06-11 14:15:37.056000', 'SGD', false, '^((S\d+$)|(Y[A-Z]{2}\d{3}[a-zA-Z](\-[A-Z])?))$', 'sgd', 'S000003909', null, null, false, null, null, null),
        (105, '2019-06-11 14:15:37.756000', false, null, 'The goal of the Systems Biology Ontology is to develop controlled vocabularies and ontologies tailored specifically for the kinds of problems being faced in Systems Biology, especially in the context of computational modeling. SBO is a project of the BioModels.net effort.', 'MIR:00000024', '2019-06-11 14:15:37.756000', 'Systems Biology Ontology', true, '^SBO:\d{7}$', 'sbo', '0000262', null, null, false, null, null, null),
        (109, '2019-06-11 14:15:38.268000', false, null, 'KEGG DRUG contains chemical structures of drugs and additional information such as therapeutic categories and target molecules.', 'MIR:00000025', '2019-06-11 14:15:38.268000', 'KEGG Drug', false, '^D\d+$', 'kegg.drug', 'D00123', null, null, false, null, null, null),
        (111, '2019-06-11 14:15:38.579000', false, null, 'KEGG GLYCAN, a part of the KEGG LIGAND database, is a collection of experimentally determined glycan structures. It contains all unique structures taken from CarbBank, structures entered from recent publications, and structures present in KEGG pathways.', 'MIR:00000026', '2019-06-11 14:15:38.579000', 'KEGG Glycan', false, '^G\d+$', 'kegg.glycan', 'G00123', null, null, false, null, null, null),
        (113, '2019-06-11 14:15:38.790000', false, null, 'WormBase is an online bioinformatics database of the biology and genome of the model organism Caenorhabditis elegans and other nematodes. It is used by the C. elegans research community both as an information resource and as a mode to publish and distribute their results. This collection references WormBase-accessioned entities.', 'MIR:00000027', '2019-06-11 14:15:38.790000', 'WormBase', false, '^WB[A-Z][a-z]+\d+$', 'wb', 'WBGene00000001', null, null, false, null, null, null),
        (75, '2019-06-11 14:15:34.841000', false, null, 'The Digital Object Identifier System is for identifying content objects in the digital environment.', 'MIR:00000019', '2023-01-05 18:09:18.209000', 'DOI', false, '^(doi\:)?10\.\d+/.*$', 'doi', '10.1038/nbt1156', null, null, false, null, null, null),
        (7, '2019-06-11 14:15:27.869000', false, null, 'Ensembl is a joint project between EMBL - EBI and the Sanger Institute  to develop a software system which produces and maintains automatic annotation on selected eukaryotic genomes. This collections also references outgroup organisms.', 'MIR:00000003', '2023-01-09 13:51:48.046000', 'Ensembl', false, '^((ENS[FPTG]\d{11}(\.\d+)?)|(FB\w{2}\d{7})|(Y[A-Z]{2}\d{3}[a-zA-Z](\-[A-Z])?)|([A-Z_a-z0-9]+(\.)?(t)?(\d+)?([a-z])?))$', 'ensembl', 'ENSG00000139618', null, null, false, null, null, null),
        (117, '2019-06-11 14:15:39.270000', false, null, 'The Pfam database contains information about protein domains and families. For each entry a protein sequence alignment and a Hidden Markov Model is stored.', 'MIR:00000028', '2019-06-11 14:15:39.270000', 'Pfam', false, '^PF\d{5}$', 'pfam', 'PF01234', null, null, false, null, null, null),
        (125, '2019-06-11 14:15:40.188000', false, null, 'FlyBase is the database of the Drosophila Genome Projects and of associated literature.', 'MIR:00000030', '2019-06-11 14:15:40.188000', 'FlyBase', false, '^FB\w{2}\d{7}$', 'fb', 'FBgn0011293', null, null, false, null, null, null),
        (130, '2019-06-11 14:15:40.709000', false, null, 'Wormpep contains the predicted proteins from the Caenorhabditis elegans genome sequencing project.', 'MIR:00000031', '2019-06-11 14:15:40.709000', 'Wormpep', false, '^CE\d{5}$', 'wormpep', 'CE28239', null, null, false, null, null, null),
        (133, '2019-06-11 14:15:40.983000', false, null, 'PROSITE consists of documentation entries describing protein domains, families and functional sites as well as associated patterns and profiles to identify them.', 'MIR:00000032', '2019-06-11 14:15:40.983000', 'PROSITE', false, '^PS\d{5}$', 'prosite', 'PS00001', null, null, false, null, null, null),
        (136, '2019-06-11 14:15:41.269000', false, null, 'PubChem provides information on the biological activities of small molecules. It is a component of NIH''s Molecular Libraries Roadmap Initiative. PubChem Substance archives chemical substance records.', 'MIR:00000033', '2019-06-11 14:15:41.269000', 'PubChem-substance', false, '^\d+$', 'pubchem.substance', '100101', null, null, false, null, null, null),
        (138, '2019-06-11 14:15:41.493000', false, null, 'PubChem provides information on the biological activities of small molecules. It is a component of NIH''s Molecular Libraries Roadmap Initiative. PubChem Compound archives chemical structures and records.', 'MIR:00000034', '2019-06-11 14:15:41.493000', 'PubChem-compound', false, '^\d+$', 'pubchem.compound', '100101', null, null, false, null, null, null),
        (140, '2019-06-11 14:15:41.707000', false, null, 'arXiv is an e-print service in the fields of physics, mathematics, non-linear science, computer science, and quantitative biology.', 'MIR:00000035', '2019-06-11 14:15:41.707000', 'arXiv', false, '^(\w+(\-\w+)?(\.\w+)?)?\d{4,7}(\.\d+(v\d+)?)?$', 'arxiv', '0807.4956v1', null, null, false, null, null, null),
        (143, '2019-06-11 14:15:41.970000', false, null, 'ArrayExpress is a public repository for microarray data, which is aimed at storing MIAME-compliant data in accordance with Microarray Gene Expression Data (MGED) recommendations.', 'MIR:00000036', '2019-06-11 14:15:41.970000', 'ArrayExpress', false, '^[AEP]-\w{4}-\d+$', 'arrayexpress', 'E-MEXP-1712', null, null, false, null, null, null),
        (146, '2019-06-11 14:15:42.331000', false, null, 'The Mouse Genome Database (MGD) project includes data on gene characterization, nomenclature, mapping, gene homologies among mammals, sequence links, phenotypes, allelic variants and mutants, and strain data.', 'MIR:00000037', '2019-06-11 14:15:42.331000', 'Mouse Genome Database', true, '^MGI:\d+$', 'mgi', '2442292', null, null, false, null, null, null),
        (150, '2019-06-11 14:15:42.838000', false, null, 'SABIO-RK is a relational database system that contains information about biochemical reactions, their kinetic equations with their parameters, and the experimental conditions under which these parameters were measured. The reaction data set provides information regarding the organism in which a reaction is observed, pathways in which it participates, and links to further information.', 'MIR:00000038', '2019-06-11 14:15:42.838000', 'SABIO-RK Reaction', false, '^\d+$', 'sabiork.reaction', '75', null, null, false, null, null, null),
        (156, '2019-06-11 14:15:43.342000', false, null, 'The database details a comprehensive  IUBMB approved classification system for membrane transport proteins known as the Transporter Classification (TC) system. The TC system is analogous to the Enzyme Commission (EC) system for classification of enzymes, but incorporates phylogenetic information additionally.', 'MIR:00000040', '2019-06-11 14:15:43.342000', 'Transport Classification Database', false, '^\d+(\.[A-Z])?(\.\d+)?(\.\d+)?(\.\d+)?$', 'tcdb', '5.A.1.1.1', null, null, false, null, null, null),
        (159, '2019-06-11 14:15:43.590000', false, null, 'The UniProt Archive (UniParc) is a  database containing non-redundant protein sequence information from many sources. Each unique sequence is given a stable and unique identifier (UPI) making it possible to identify the same protein from different source databases.', 'MIR:00000041', '2019-06-11 14:15:43.590000', 'UniParc', false, '^UPI[A-F0-9]{10}$', 'uniparc', 'UPI000000000A', null, null, false, null, null, null),
        (162, '2019-06-11 14:15:43.925000', false, null, 'The Molecular INTeraction database (MINT) stores, in a structured format, information about molecular interactions by extracting experimental details from work published in peer-reviewed journals.', 'MIR:00000042', '2019-06-11 14:15:43.925000', 'MINT', false, '^MINT\-\d{1,7}$', 'mint', 'MINT-10000', null, null, false, null, null, null),
        (166, '2019-06-11 14:15:44.329000', false, null, 'The database of interacting protein (DIP) database stores experimentally determined interactions between proteins. It combines information from a variety of sources to create a single, consistent set of protein-protein interactions', 'MIR:00000044', '2019-06-11 14:15:44.329000', 'Database of Interacting Proteins', false, '^DIP(\:)?\-\d{1,}[ENXS]$', 'dip', 'DIP-743N', null, null, false, null, null, null),
        (172, '2019-06-11 14:15:44.821000', false, null, 'The RESID Database of Protein Modifications is a comprehensive collection of annotations and structures for protein modifications including amino-terminal, carboxyl-terminal and peptide chain cross-link post-translational modifications.', 'MIR:00000046', '2019-06-11 14:15:44.821000', 'RESID', false, '^AA\d{4}$', 'resid', 'AA0001', null, null, false, null, null, null),
        (175, '2019-06-11 14:15:45.062000', false, null, 'Rat Genome Database seeks to collect, consolidate, and integrate rat genomic and genetic data with curated functional and physiological data and make these data widely available to the scientific community. This collection references genes.', 'MIR:00000047', '2019-06-11 14:15:45.062000', 'Rat Genome Database', false, '^\d{4,}$', 'rgd', '2018', null, null, false, null, null, null),
        (179, '2019-06-11 14:15:45.813000', false, null, 'The Arabidopsis Information Resource (TAIR) maintains a database of genetic and molecular biology data for the model higher plant Arabidopsis thaliana. This provides protein information for a given gene model and provides links to other sources such as UniProtKB and GenPept', 'MIR:00000048', '2019-06-11 14:15:45.813000', 'TAIR Protein', false, '^AASequence:\d{10}$', 'tair.protein', 'AASequence:1009107926', null, null, false, null, null, null),
        (182, '2019-06-11 14:15:46.061000', false, null, 'The Arabidopsis Information Resource (TAIR) maintains a database of genetic and molecular biology data for the model higher plant Arabidopsis thaliana. This is the reference gene model for a given locus.', 'MIR:00000049', '2019-06-11 14:15:46.061000', 'TAIR Gene', false, '^Gene:\d{7}$', 'tair.gene', 'Gene:2200934', null, null, false, null, null, null),
        (184, '2019-06-11 14:15:46.274000', false, null, 'The Arabidopsis Information Resource (TAIR) maintains a database of genetic and molecular biology data for the model higher plant Arabidopsis thaliana. The name of a Locus is unique and used by TAIR, TIGR, and MIPS.', 'MIR:00000050', '2019-06-11 14:15:46.274000', 'TAIR Locus', false, '^\d{7}$', 'tair.locus', '2200950', null, null, false, null, null, null),
        (186, '2019-06-11 14:15:46.469000', false, null, 'The Human Metabolome Database (HMDB) is a database containing detailed information about small molecule metabolites found in the human body.It contains or links 1) chemical 2) clinical and 3) molecular biology/biochemistry data.', 'MIR:00000051', '2019-06-11 14:15:46.469000', 'HMDB', false, '^HMDB\d+$', 'hmdb', 'HMDB00001', null, null, false, null, null, null),
        (119, '2019-06-11 14:15:39.496000', false, null, 'The International Nucleotide Sequence Database Collaboration (INSDC) consists of a joint effort to collect and disseminate databases containing DNA and RNA sequences.', 'MIR:00000029', '2023-03-06 09:23:15.163000', 'Nucleotide Sequence Database', false, '^([A-Z]\d{5}|[A-Z]{2}\d{6}|[A-Z]{4,6}\d{8,10}|[A-J][A-Z]{2}\d{5})(\.\d+)?$', 'insdc', 'X58356', null, null, false, null, null, null),
        (252, '2019-06-11 14:15:52.667000', false, null, 'HOVERGEN is a database of homologous vertebrate genes that allows one to select sets of homologous genes among vertebrate species, and to visualize multiple alignments and phylogenetic trees.', 'MIR:00000074', '2019-06-11 14:15:52.667000', 'HOVERGEN', false, '^HBG\d+$', 'hovergen', 'HBG004341', null, null, false, null, null, null),
        (189, '2019-06-11 14:15:46.708000', false, null, 'The LIPID MAPS Lipid Classification System is comprised of eight lipid categories, each with its own subclassification hierarchy. All lipids in the LIPID MAPS Structure Database (LMSD) have been classified using this system and have been assigned LIPID MAPS ID''s which reflects their position in the classification hierarchy.', 'MIR:00000052', '2019-06-11 14:15:46.708000', 'LIPID MAPS', false, '^LM(FA|GL|GP|SP|ST|PR|SL|PK)[0-9]{4}([0-9a-zA-Z]{4,6})?$', 'lipidmaps', 'LMPR0102010012', null, null, false, null, null, null),
        (192, '2019-06-11 14:15:46.969000', false, null, 'The PeptideAtlas Project provides a publicly accessible database of peptides identified in tandem mass spectrometry proteomics studies and software tools.', 'MIR:00000053', '2019-06-11 14:15:46.969000', 'PeptideAtlas', false, '^PAp[0-9]{8}$', 'peptideatlas', 'PAp00000009', null, null, false, null, null, null),
        (195, '2019-06-11 14:15:47.245000', false, null, 'The Gene Expression Omnibus (GEO) is a gene expression repository providing a curated, online resource for gene expression data browsing, query and retrieval.', 'MIR:00000054', '2019-06-11 14:15:47.245000', 'GEO', false, '^G(PL|SM|SE|DS)\d+$', 'geo', 'GDS1234', null, null, false, null, null, null),
        (200, '2019-06-11 14:15:47.775000', false, null, 'The Proteomics Standards Initiative modification ontology (PSI-MOD)  aims to define a concensus nomenclature and ontology reconciling, in a hierarchical representation, the complementary descriptions of residue modifications.', 'MIR:00000056', '2019-06-11 14:15:47.775000', 'Protein Modification Ontology', true, '^MOD:\d{5}', 'mod', '00001', null, null, false, null, null, null),
        (203, '2019-06-11 14:15:48.132000', false, null, 'Curated biochemical pathways for Saccharomyces cerevisiae at Saccharomyces genome database (SGD).', 'MIR:00000057', '2019-06-11 14:15:48.132000', 'Saccharomyces genome database pathways', false, '^PWY\w{2}\-\d{3}$', 'sgd.pathways', 'PWY3O-214', null, null, false, null, null, null),
        (206, '2019-06-11 14:15:48.429000', false, null, 'BioGRID is a database of physical and genetic interactions in Saccharomyces cerevisiae, Caenorhabditis elegans, Drosophila melanogaster, Homo sapiens, and Schizosaccharomyces pombe.', 'MIR:00000058', '2019-06-11 14:15:48.429000', 'BioGRID', false, '^\d+$', 'biogrid', '31623', null, null, false, null, null, null),
        (209, '2019-06-11 14:15:48.677000', false, null, 'The MEROPS database is an information resource for peptidases (also termed proteases, proteinases and proteolytic enzymes) and the proteins that inhibit them.', 'MIR:00000059', '2019-06-11 14:15:48.677000', 'MEROPS', false, '^[SCTAGMNU]\d{2}\.([AB]\d{2}|\d{3})$', 'merops', 'S01.001', null, null, false, null, null, null),
        (212, '2019-06-11 14:15:48.923000', false, null, 'The PANTHER (Protein ANalysis THrough Evolutionary Relationships) Classification System is a resource that classifies genes by their functions, using published scientific experimental evidence and evolutionary relationships to predict function even in the absence of direct experimental evidence. This collection references groups of genes that have been organised as families.', 'MIR:00000060', '2019-06-11 14:15:48.923000', 'PANTHER Family', false, '^PTHR\d{5}(\:SF\d{1,3})?$', 'panther.family', 'PTHR12345', null, null, false, null, null, null),
        (459, '2019-06-11 14:16:12.204000', false, null, 'AntWeb is a website documenting the known species of ants, with records for each species linked to their geographical distribution, life history, and includes pictures.', 'MIR:00000146', '2019-06-11 14:16:12.204000', 'AntWeb', false, '^casent\d+(\-D\d+)?$', 'antweb', 'casent0106247', null, null, false, null, null, null),
        (214, '2019-06-11 14:15:49.123000', false, null, 'PRINTS is a compendium of protein fingerprints. A fingerprint is a group of conserved motifs used to characterise a protein family; its diagnostic power is refined by iterative scanning of a SWISS-PROT/TrEMBL composite. Usually the motifs do not overlap, but are separated along a sequence, though they may be contiguous in 3D-space. Fingerprints can encode protein folds and functionalities more flexibly and powerfully than can single motifs, full diagnostic potency deriving from the mutual context provided by motif neighbours.', 'MIR:00000061', '2019-06-11 14:15:49.123000', 'PRINTS', false, '^PR\d{5}$', 'prints', 'PR00001', null, null, false, null, null, null),
        (217, '2019-06-11 14:15:49.385000', false, null, 'Ligand Expo is a data resource for finding information about small molecules bound to proteins and nucleic acids.', 'MIR:00000062', '2019-06-11 14:15:49.385000', 'Ligand Expo', false, '^(\w){3}$', 'ligandexpo', 'ABC', null, null, false, null, null, null),
        (223, '2019-06-11 14:15:50.037000', false, null, 'The International Standard Book Number (ISBN) is for identifying printed books.', 'MIR:00000064', '2019-06-11 14:15:50.037000', 'ISBN', false, '^(ISBN)?(-13|-10)?[:]?[ ]?(\d{2,3}[ -]?)?\d{1,5}[ -]?\d{1,7}[ -]?\d{1,6}[ -]?(\d|X)$', 'isbn', '9781584885658', null, null, false, null, null, null),
        (228, '2019-06-11 14:15:50.454000', false, null, 'The PRIDE PRoteomics IDEntifications database is a centralized, standards compliant, public data repository that provides protein and peptide identifications together with supporting evidence. This collection references experiments and assays.', 'MIR:00000065', '2019-06-11 14:15:50.454000', 'PRIDE', false, '^\d+$', 'pride', '1', null, null, false, null, null, null),
        (230, '2019-06-11 14:15:50.652000', false, null, '3DMET is a database collecting three-dimensional structures of natural metabolites.', 'MIR:00000066', '2019-06-11 14:15:50.652000', '3DMET', false, '^B\d{5}$', '3dmet', 'B00162', null, null, false, null, null, null),
        (233, '2019-06-11 14:15:50.895000', false, null, 'The Foundational Model of Anatomy Ontology (FMA) is a biomedical informatics ontology. It is concerned with the representation of classes or types and relationships necessary for the symbolic representation of the phenotypic structure of the human body.  Specifically, the FMA is a domain ontology that represents a coherent body of explicit declarative knowledge about human anatomy.', 'MIR:00000067', '2019-06-11 14:15:50.895000', 'FMA', true, '^FMA:\d+$', 'fma', '67112', null, null, false, null, null, null),
        (236, '2019-06-11 14:15:51.252000', false, null, 'MatrixDB stores experimentally determined interactions involving at least one extracellular biomolecule. It includes mostly protein-protein and protein-glycosaminoglycan interactions, as well as interactions with lipids and cations.', 'MIR:00000068', '2019-06-11 14:15:51.252000', 'MatrixDB', false, '^([A-N,R-Z][0-9][A-Z][A-Z, 0-9][A-Z, 0-9][0-9])_.*|([O,P,Q][0-9][A-Z, 0-9][A-Z, 0-9][A-Z, 0-9][0-9]_.*)|(GAG_.*)|(MULT_.*)|(PFRAG_.*)|(LIP_.*)|(CAT_.*)$', 'matrixdb.association', 'P00747__P07355', null, null, false, null, null, null),
        (239, '2019-06-11 14:15:51.483000', false, null, 'Entrez Gene is the NCBI''s database for gene-specific information, focusing on completely sequenced genomes, those with an active research community to contribute gene-specific information, or those that are scheduled for intense sequence analysis.', 'MIR:00000069', '2019-06-11 14:15:51.483000', 'NCBI Gene', false, '^\d+$', 'ncbigene', '100010', null, null, false, null, null, null),
        (242, '2019-06-11 14:15:51.781000', false, null, 'KEGG GENES is a collection of gene catalogs for all complete genomes and some partial genomes, generated from publicly available resources.', 'MIR:00000070', '2019-06-11 14:15:51.781000', 'KEGG Genes', false, '^\w+:[\w\d\.-]*$', 'kegg.genes', 'syn:ssr3451', null, null, false, null, null, null),
        (244, '2019-06-11 14:15:51.985000', false, null, 'BRENDA is a collection of enzyme functional data available to the scientific community. Data on enzyme function are extracted directly from the primary literature The database covers information on classification and nomenclature, reaction and specificity, functional parameters, occurrence, enzyme structure and stability, mutants and enzyme engineering, preparation and isolation, the application of enzymes, and ligand-related data.', 'MIR:00000071', '2019-06-11 14:15:51.985000', 'BRENDA', false, '^((\d+\.-\.-\.-)|(\d+\.\d+\.-\.-)|(\d+\.\d+\.\d+\.-)|(\d+\.\d+\.\d+\.\d+))$', 'brenda', '1.1.1.1', null, null, false, null, null, null),
        (247, '2019-06-11 14:15:52.227000', false, null, 'PubChem provides information on the biological activities of small molecules. It is a component of NIH''s Molecular Libraries Roadmap Initiative. PubChem bioassay archives active compounds and bioassay results.', 'MIR:00000072', '2019-06-11 14:15:52.227000', 'PubChem-bioassay', false, '^\d+$', 'pubchem.bioassay', '1018', null, null, false, null, null, null),
        (1659, '2019-06-11 14:17:58.671000', false, null, 'The BioAssay Ontology (BAO) describes chemical biology screening assays and their results including high-throughput screening (HTS) data for the purpose of categorizing assays and data analysis.', 'MIR:00000597', '2019-06-11 14:17:58.671000', 'BioAssay Ontology', false, '^\d{7}$', 'bao', '0002989', null, null, false, null, null, null),
        (249, '2019-06-11 14:15:52.436000', false, null, 'Pathway Commons is a convenient point of access to biological pathway information collected from public pathway databases, which you can browse or search. It is a collection of publicly available pathways from multiple organisms that provides researchers with convenient access to a comprehensive collection of pathways from multiple sources represented in a common language.', 'MIR:00000073', '2019-06-11 14:15:52.436000', 'Pathway Commons', false, '^\d+$', 'pathwaycommons', '485991', null, null, false, null, null, null),
        (255, '2019-06-11 14:15:52.916000', false, null, 'A collection of molecular interaction maps and pathways involved in cancer development and progression with a focus on melanoma.', 'MIR:00000075', '2019-06-11 14:15:52.916000', 'Melanoma Molecular Map Project Biomaps', false, '^\d+$', 'mmmp:biomaps', '37', null, null, false, null, null, null),
        (263, '2019-06-11 14:15:53.607000', false, null, 'The miRBase Sequence Database is a searchable database of published miRNA sequences and annotation. The data were previously provided by the miRNA Registry. Each entry in the miRBase Sequence database represents a predicted hairpin portion of a miRNA transcript (termed mir in the database), with information on the location and sequence of the mature miRNA sequence (termed miR).', 'MIR:00000078', '2019-06-11 14:15:53.607000', 'miRBase Sequence', false, 'MI\d{7}', 'mirbase', 'MI0000001', null, null, false, null, null, null),
        (266, '2019-06-11 14:15:53.859000', false, null, 'ZFIN serves as the zebrafish model organism database. This collection references all zebrafish biological entities in ZFIN.', 'MIR:00000079', '2019-06-11 14:15:53.859000', 'ZFIN Bioentity', false, '^ZDB\-\w+\-\d+\-\d+$', 'zfin', 'ZDB-GENE-041118-11', null, null, false, null, null, null),
        (271, '2019-06-11 14:15:54.375000', false, null, 'The HGNC (HUGO Gene Nomenclature Committee) provides an approved gene name and symbol (short-form abbreviation) for each known human gene.  All approved symbols are stored in the HGNC database, and each symbol is unique. HGNC identifiers refer to records in the HGNC symbol database.', 'MIR:00000080', '2019-06-11 14:15:54.375000', 'HGNC', false, '^((HGNC|hgnc):)?\d{1,5}$', 'hgnc', '2674', null, null, false, null, null, null),
        (273, '2019-06-11 14:15:54.604000', false, null, 'The Sequence Ontology (SO) is a structured controlled vocabulary for the parts of a genomic annotation. It provides a common set of terms and definitions to facilitate the exchange, analysis and management of genomic data.', 'MIR:00000081', '2019-06-11 14:15:54.604000', 'Sequence Ontology', true, '^SO:\d{7}$', 'so', '0000704', null, null, false, null, null, null),
        (281, '2019-06-11 14:15:55.368000', false, null, 'ChEMBL is a database of bioactive compounds, their quantitative properties and bioactivities (binding constants, pharmacology and ADMET, etc). The data is abstracted and curated from the primary scientific literature.', 'MIR:00000084', '2019-06-11 14:15:55.368000', 'ChEMBL compound', false, '^CHEMBL\d+$', 'chembl.compound', 'CHEMBL308052', null, null, false, null, null, null),
        (286, '2019-06-11 14:15:55.880000', false, null, 'ChEMBL is a database of bioactive compounds, their quantitative properties and bioactivities (binding constants, pharmacology and ADMET, etc). The data is abstracted and curated from the primary scientific literature.', 'MIR:00000085', '2019-06-11 14:15:55.880000', 'ChEMBL target', false, '^CHEMBL\d+$', 'chembl.target', 'CHEMBL3467', null, null, false, null, null, null),
        (396, '2019-06-11 14:16:06.208000', false, null, 'PhosphoSite is a mammalian protein database that provides information about in vivo phosphorylation sites. This datatype refers to residue-level information, providing a information about a single modification position in a specific protein sequence.', 'MIR:00000125', '2019-06-11 14:16:06.208000', 'PhosphoSite Residue', false, '^\d+$', 'phosphosite.residue', '2842', null, null, false, null, null, null),
        (290, '2019-06-11 14:15:56.334000', false, null, 'SABIO-RK is a relational database system that contains information about biochemical reactions, their kinetic equations with their parameters, and the experimental conditions under which these parameters were measured. The kinetic record data set provides information regarding the kinetic law, measurement conditions, parameter details and other reference information.', 'MIR:00000086', '2019-06-11 14:15:56.334000', 'SABIO-RK Kinetic Record', false, '^\d+$', 'sabiork.kineticrecord', '5046', null, null, false, null, null, null),
        (292, '2019-06-11 14:15:56.548000', false, null, 'The Ligand-Gated Ion Channel database provides nucleic and proteic sequences of the subunits of ligand-gated ion channels. These transmembrane proteins can exist under different conformations, at least one of which forms a pore through the membrane connecting two neighbouring compartments. The database can be used to generate multiple sequence alignments from selected subunits, and gives the atomic coordinates of subunits, or portion of subunits, where available.', 'MIR:00000087', '2019-06-11 14:15:56.548000', 'Ligand-Gated Ion Channel database', false, '^\w+$', 'lgic', '5HT3Arano', null, null, false, null, null, null),
        (294, '2019-06-11 14:15:56.747000', false, null, 'The Anatomical Therapeutic Chemical (ATC) classification system, divides active substances into different groups according to the organ or system on which they act and their therapeutic, pharmacological and chemical properties. Drugs are classified in groups at five different levels;  Drugs are divided into fourteen main groups (1st level), with pharmacological/therapeutic subgroups (2nd level).  The 3rd and 4th levels are chemical/pharmacological/therapeutic subgroups and the 5th level is the chemical substance. The Anatomical Therapeutic Chemical (ATC) classification system and the Defined Daily Dose (DDD) is a tool for exchanging and comparing data on drug use at international, national or local levels.', 'MIR:00000088', '2019-06-11 14:15:56.747000', 'Anatomical Therapeutic Chemical', false, '^[A-Z](\d+([A-Z]{1,2}(\d+)?)?)?$', 'atc', 'A10BA02', null, null, false, null, null, null),
        (297, '2019-06-11 14:15:57.006000', false, null, 'The PharmGKB database is a central repository for genetic, genomic, molecular and cellular phenotype data and clinical information about people who have participated in pharmacogenomics research studies. The data includes, but is not limited to, clinical and basic pharmacokinetic and pharmacogenomic research in the cardiovascular, pulmonary, cancer, pathways, metabolic and transporter domains. 
PharmGKB Pathways are drug centric, gene based, interactive pathways which focus on candidate genes and gene groups and associated genotype and phenotype data of relevance for pharmacogenetic and pharmacogenomic studies.', 'MIR:00000089', '2019-06-11 14:15:57.006000', 'PharmGKB Pathways', false, '^PA\d+$', 'pharmgkb.pathways', 'PA146123006', null, null, false, null, null, null),
        (300, '2019-06-11 14:15:57.258000', false, null, 'The PharmGKB database is a central repository for genetic, genomic, molecular and cellular phenotype data and clinical information about people who have participated in pharmacogenomics research studies. The data includes, but is not limited to, clinical and basic pharmacokinetic and pharmacogenomic research in the cardiovascular, pulmonary, cancer, pathways, metabolic and transporter domains.', 'MIR:00000090', '2019-06-11 14:15:57.258000', 'PharmGKB Disease', false, '^PA\d+$', 'pharmgkb.disease', 'PA447218', null, null, false, null, null, null),
        (258, '2019-06-11 14:15:53.125000', false, null, 'WikiPathways is a resource providing an open and public collection of pathway maps created and curated by the community in a Wiki-like style.', 'MIR:00000076', '2023-01-05 18:26:05.922000', 'WikiPathways', false, 'WP\d{1,5}(\_r\d+)?$', 'wikipathways', 'WP100', null, null, false, null, null, null),
        (302, '2019-06-11 14:15:57.451000', false, null, 'The PharmGKB database is a central repository for genetic, genomic, molecular and cellular phenotype data and clinical information about people who have participated in pharmacogenomics research studies. The data includes, but is not limited to, clinical and basic pharmacokinetic and pharmacogenomic research in the cardiovascular, pulmonary, cancer, pathways, metabolic and transporter domains.', 'MIR:00000091', '2019-06-11 14:15:57.451000', 'PharmGKB Drug', false, '^PA\d+$', 'pharmgkb.drug', 'PA448710', null, null, false, null, null, null),
        (2796, '2021-08-08 09:39:33.533000', false, null, 'Resource for the community to store, retrieve, search, reference, and reuse CellML models.', 'MIR:00000845', '2021-08-08 09:39:33.533000', 'Physiome Model Repository', false, '^[a-z0-9]{32,32}$', 'pmr', 'ebf69ca24298b28b2361e7d43eb52d6c', null, null, false, null, null, null),
        (304, '2019-06-11 14:15:57.654000', false, null, 'The Therapeutic Target Database (TTD) is designed to provide information about the known therapeutic protein and nucleic acid targets described in the literature, the targeted disease conditions, the pathway information and the corresponding drugs/ligands directed at each of these targets. Cross-links to other databases allow the access to information about the sequence, 3D structure, function, nomenclature, drug/ligand binding properties, drug usage and effects, and related literature for each target.', 'MIR:00000092', '2019-06-11 14:15:57.654000', 'TTD Drug', false, '^DAP\d+$', 'ttd.drug', 'DAP000773', null, null, false, null, null, null),
        (307, '2019-06-11 14:15:57.896000', false, null, 'The Therapeutic Target Database (TTD) is designed to provide information about the known therapeutic protein and nucleic acid targets described in the literature, the targeted disease conditions, the pathway information and the corresponding drugs/ligands directed at each of these targets. Cross-links to other databases are also introduced to facilitate the access of information about the sequence, 3D structure, function, nomenclature, drug/ligand binding properties, drug usage and effects, and related literature for each target.', 'MIR:00000093', '2019-06-11 14:15:57.896000', 'TTD Target', false, '^TTDS\d+$', 'ttd.target', 'TTDS00056', null, null, false, null, null, null),
        (309, '2019-06-11 14:15:58.106000', false, null, 'NeuronDB provides a dynamically searchable database of three types of neuronal properties: voltage gated conductances, neurotransmitter receptors, and neurotransmitter substances. It contains tools that provide for integration of these properties in a given type of neuron and compartment, and for comparison of properties across different types of neurons and compartments.', 'MIR:00000094', '2019-06-11 14:15:58.106000', 'NeuronDB', false, '^\d+$', 'neurondb', '265', null, null, false, null, null, null),
        (315, '2019-06-11 14:15:58.577000', false, null, 'ChemIDplus is a web-based search system that provides access to structure and nomenclature authority files used for the identification of chemical substances cited in National Library of Medicine (NLM) databases. It also provides structure searching and direct links to many biomedical resources at NLM and on the Internet for chemicals of interest.', 'MIR:00000096', '2019-06-11 14:15:58.577000', 'ChemIDplus', false, '^\d+\-\d+\-\d+$', 'chemidplus', '57-27-2', null, null, false, null, null, null),
        (318, '2019-06-11 14:15:58.906000', false, null, 'The NCBI BioSystems database centralizes and cross-links existing biological systems databases, increasing their utility and target audience by integrating their pathways and systems into NCBI resources.', 'MIR:00000097', '2019-06-11 14:15:58.906000', 'BioSystems', false, '^\d+$', 'biosystems', '001', null, null, false, null, null, null),
        (320, '2019-06-11 14:15:59.108000', false, null, 'The Comparative Toxicogenomics Database (CTD) presents scientifically reviewed and curated information on chemicals, relevant genes and proteins, and their interactions in vertebrates and invertebrates. It integrates sequence, reference, species, microarray, and general toxicology information to provide a unique centralized resource for toxicogenomic research. The database also provides visualization capabilities that enable cross-species comparisons of gene and protein sequences.', 'MIR:00000098', '2019-06-11 14:15:59.108000', 'CTD Chemical', false, '^[CD]\d+$', 'ctd.chemical', 'D001151', null, null, false, null, null, null),
        (323, '2019-06-11 14:15:59.348000', false, null, 'The Comparative Toxicogenomics Database (CTD) presents scientifically reviewed and curated information on chemicals, relevant genes and proteins, and their interactions in vertebrates and invertebrates. It integrates sequence, reference, species, microarray, and general toxicology information to provide a unique centralized resource for toxicogenomic research. The database also provides visualization capabilities that enable cross-species comparisons of gene and protein sequences.', 'MIR:00000099', '2019-06-11 14:15:59.348000', 'CTD Disease', false, '^D\d+$', 'ctd.disease', 'D053716', null, null, false, null, null, null),
        (325, '2019-06-11 14:15:59.547000', false, null, 'The Comparative Toxicogenomics Database (CTD) presents scientifically reviewed and curated information on chemicals, relevant genes and proteins, and their interactions in vertebrates and invertebrates. It integrates sequence, reference, species, microarray, and general toxicology information to provide a unique centralized resource for toxicogenomic research. The database also provides visualization capabilities that enable cross-species comparisons of gene and protein sequences.', 'MIR:00000100', '2019-06-11 14:15:59.547000', 'CTD Gene', false, '^\d+$', 'ctd.gene', '101', null, null, false, null, null, null),
        (327, '2019-06-11 14:15:59.756000', false, null, 'BioNumbers is a database of key numberical information that may be used in molecular biology. Along with the numbers, it contains references to the original literature, useful comments, and related numeric data.', 'MIR:00000101', '2019-06-11 14:15:59.756000', 'BioNumbers', false, '^\d+$', 'bionumbers', '104674', null, null, false, null, null, null),
        (330, '2019-06-11 14:16:00.005000', false, null, 'The DrugBank database is a bioinformatics and chemoinformatics resource that combines detailed drug (i.e. chemical, pharmacological and pharmaceutical) data with comprehensive drug target (i.e. sequence, structure, and pathway) information. This collection references drug information.', 'MIR:00000102', '2019-06-11 14:16:00.005000', 'DrugBank', false, '^DB\d{5}$', 'drugbank', 'DB00001', null, null, false, null, null, null),
        (333, '2019-06-11 14:16:00.251000', false, null, 'Toxin and Toxin Target Database (T3DB) is a bioinformatics resource that combines detailed toxin data with comprehensive toxin target information.', 'MIR:00000103', '2019-06-11 14:16:00.251000', 'T3DB', false, '^T3D\d+$', 't3db', 'T3D0001', null, null, false, null, null, null),
        (336, '2019-06-11 14:16:00.499000', false, null, 'The Small Molecule Pathway Database (SMPDB) contains small molecule pathways found in humans, which are presented visually. All SMPDB pathways include information on the relevant organs, subcellular compartments, protein cofactors, protein locations, metabolite locations, chemical structures and protein quaternary structures. Accompanying data includes detailed descriptions and references, providing an overview of the pathway, condition or processes depicted in each diagram.', 'MIR:00000104', '2019-06-11 14:16:00.499000', 'Small Molecule Pathway Database', false, '^SMP\d+$', 'smpdb', 'SMP00001', null, null, false, null, null, null),
        (338, '2019-06-11 14:16:00.712000', false, null, 'PhosphoSite is a mammalian protein database that provides information about in vivo phosphorylation sites. This datatype refers to protein-level information, providing a list of phosphorylation sites for each protein in the database.', 'MIR:00000105', '2019-06-11 14:16:00.712000', 'PhosphoSite Protein', false, '^\d{5}$', 'phosphosite.protein', '12300', null, null, false, null, null, null),
        (344, '2019-06-11 14:16:01.178000', false, null, 'The Terminology for Description of Dynamics (TEDDY) is an ontology for dynamical behaviours, observable dynamical phenomena, and control elements of bio-models and biological systems in Systems Biology and Synthetic Biology.', 'MIR:00000107', '2019-06-11 14:16:01.178000', 'TEDDY', false, '^TEDDY_\d{7}$', 'biomodels.teddy', 'TEDDY_0000066', null, null, false, null, null, null),
        (347, '2019-06-11 14:16:01.508000', false, null, 'The Kinetic Simulation Algorithm Ontology (KiSAO) is an ontology that describes simulation algorithms and methods used for biological kinetic models, and the relationships between them. This provides a means to unambiguously refer to simulation algorithms when describing a simulation experiment.', 'MIR:00000108', '2019-06-11 14:16:01.508000', 'KiSAO', false, '^KISAO_\d+$', 'biomodels.kisao', 'KISAO_0000057', null, null, false, null, null, null),
        (352, '2019-06-11 14:16:02.066000', false, null, 'The Cell Ontology is designed as a structured controlled vocabulary for cell types. The ontology was constructed for use by the model organism and other bioinformatics databases, incorporating cell types from prokaryotes to mammals, and includes plants and fungi.', 'MIR:00000110', '2019-06-11 14:16:02.066000', 'Cell Type Ontology', true, '^CL:\d{7}$', 'cl', '0000232', null, null, false, null, null, null),
        (355, '2019-06-11 14:16:02.399000', false, null, 'The Brenda tissue ontology is a structured controlled vocabulary eastablished to identify the source of an enzyme cited in the Brenda enzyme database. It comprises terms of tissues, cell lines, cell types and cell cultures from uni- and multicellular organisms.', 'MIR:00000111', '2019-06-11 14:16:02.399000', 'Brenda Tissue Ontology', true, '^BTO:\d{7}$', 'bto', '0000146', null, null, false, null, null, null),
        (369, '2019-06-11 14:16:03.735000', false, null, 'KEGG Orthology (KO) consists of manually defined, generalised ortholog groups that correspond to KEGG pathway nodes and BRITE hierarchy nodes in all organisms.', 'MIR:00000116', '2019-06-11 14:16:03.735000', 'KEGG Orthology', false, '^K\d+$', 'kegg.orthology', 'K00001', null, null, false, null, null, null),
        (371, '2019-06-11 14:16:03.923000', false, null, 'ProDom is a database of protein domain families generated from the global comparison of all available protein sequences.', 'MIR:00000117', '2019-06-11 14:16:03.923000', 'ProDom', false, '^PD\d+$', 'prodom', 'PD10000', null, null, false, null, null, null),
        (374, '2019-06-11 14:16:04.151000', false, null, 'The Simple Modular Architecture Research Tool (SMART) is an online tool for the identification and annotation of protein domains, and the analysis of domain architectures.', 'MIR:00000118', '2019-06-11 14:16:04.151000', 'SMART', false, '^SM\d{5}$', 'smart', 'SM00015', null, null, false, null, null, null),
        (377, '2019-06-11 14:16:04.400000', false, null, 'The Conserved Domain Database (CDD) is a collection of multiple sequence alignments and derived database search models, which represent protein domains conserved in molecular evolution.', 'MIR:00000119', '2019-06-11 14:16:04.400000', 'Conserved Domain Database', false, '^(cd)?\d{5}$', 'cdd', 'cd00400', null, null, false, null, null, null),
        (380, '2019-06-11 14:16:04.654000', false, null, 'The OBO Relation Ontology provides consistent and unambiguous formal definitions of the relational expressions used in biomedical ontologies.', 'MIR:00000120', '2019-06-11 14:16:04.654000', 'Relation Ontology', false, '^RO_\d{7}$', 'ro', 'RO_0002533', null, null, false, null, null, null),
        (384, '2019-06-11 14:16:05.062000', false, null, 'The Molecular Modeling Database (MMDB) is a database of experimentally determined structures obtained from the Protein Data Bank (PDB). Since structures are known for a large fraction of all protein families, structure homologs may facilitate inference of biological function, or the identification of binding or catalytic sites.', 'MIR:00000121', '2019-06-11 14:16:05.062000', 'Molecular Modeling Database', false, '^\d{1,5}$', 'mmdb', '50885', null, null, false, null, null, null),
        (386, '2019-06-11 14:16:05.272000', false, null, 'The International Molecular Exchange (IMEx) is a consortium of molecular interaction databases which collaborate to share manual curation efforts and provide accessibility to multiple information sources.', 'MIR:00000122', '2019-06-11 14:16:05.272000', 'IMEx', false, '^IM-\d+(-?)(\d+?)$', 'imex', 'IM-19210-3', null, null, false, null, null, null),
        (389, '2019-06-11 14:16:05.614000', false, null, 'iRefWeb is an interface to a relational database containing the latest build of the interaction Reference Index (iRefIndex) which integrates protein interaction data from ten different interaction databases: BioGRID, BIND, CORUM, DIP, HPRD, INTACT, MINT, MPPI, MPACT and OPHID. In addition, iRefWeb associates interactions with the PubMed record from which they are derived.', 'MIR:00000123', '2019-06-11 14:16:05.614000', 'iRefWeb', false, '^\d+$', 'irefweb', '617102', null, null, false, null, null, null),
        (392, '2019-06-11 14:16:05.849000', false, null, 'The microbial protein interaction database (MPIDB) provides physical microbial interaction data. The interactions are manually curated from the literature or imported from other databases, and are linked to supporting experimental evidence, as well as evidences based on interaction conservation, protein complex membership, and 3D domain contacts.', 'MIR:00000124', '2019-06-11 14:16:05.849000', 'Microbial Protein Interaction Database', false, '^\d+$', 'mpid', '172', null, null, false, null, null, null),
        (398, '2019-06-11 14:16:06.417000', false, null, 'The NeuroLex project is a dynamic lexicon of terms used in neuroscience.  It is supported by the Neuroscience Information Framework project and incorporates information from the NIF standardised ontology (NIFSTD), and its predecessor, the Biomedical Informatics Research Network Lexicon (BIRNLex).', 'MIR:00000126', '2019-06-11 14:16:06.417000', 'NeuroLex', false, '^([Bb]irnlex_|Sao|nlx_|GO_|CogPO|HDO|nifext_)\d+$', 'neurolex', 'Birnlex_721', null, null, false, null, null, null),
        (402, '2019-06-11 14:16:06.780000', false, null, 'The Ontology for Biomedical Investigations (OBI) project is developing an integrated ontology for the description of biological and clinical investigations. The ontology will represent the design of an investigation, the protocols and instrumentation used, the material used, the data generated and the type analysis performed on it. Currently OBI is being built under the Basic Formal Ontology (BFO).', 'MIR:00000127', '2019-06-11 14:16:06.780000', 'Ontology for Biomedical Investigations', false, '(^OBI:\d{7}$)|(^OBI_\d{7}$)', 'obi', 'OBI_0000070', null, null, false, null, null, null),
        (831, '2019-06-11 14:16:44.568000', false, null, 'ASAP (a systematic annotation package for community analysis of genomes) stores bacterial genome sequence and functional characterization data. It includes multiple genome sequences at various stages of analysis, corresponding experimental data and access to collections of related genome resources.', 'MIR:00000283', '2019-06-11 14:16:44.568000', 'ASAP', false, '^[A-Za-z0-9-]+$', 'asap', 'ABE-0009634', null, null, false, null, null, null),
        (407, '2019-06-11 14:16:07.366000', false, null, 'SABIO-RK is a relational database system that contains information about biochemical reactions, their kinetic equations with their parameters, and the experimental conditions under which these parameters were measured. The EC record provides for a given enzyme classification (EC) the associated list of enzyme-catalysed reactions and their corresponding kinetic data.', 'MIR:00000128', '2019-06-11 14:16:07.366000', 'SABIO-RK EC Record', false, '^((\d+)|(\d+\.\d+)|(\d+\.\d+\.\d+)|(\d+\.\d+\.\d+\.\d+))$', 'sabiork.ec', '2.7.1.1', null, null, false, null, null, null),
        (410, '2019-06-11 14:16:07.624000', false, null, 'The OPB is a reference ontology of classical physics as applied to the dynamics of biological systems. It is designed to encompass the multiple structural scales (multiscale atoms to organisms) and multiple physical domains (multidomain fluid dynamics, chemical kinetics, particle diffusion, etc.) that are encountered in the study and analysis of biological organisms.', 'MIR:00000129', '2019-06-11 14:16:07.624000', 'Ontology of Physics for Biology', false, '^OPB_\d+$', 'opb', 'OPB_00573', null, null, false, null, null, null),
        (412, '2019-06-11 14:16:07.820000', false, null, 'JWS Online is a repository of curated biochemical pathway models, and additionally provides the ability to run simulations of these models in a web browser.', 'MIR:00000130', '2019-06-11 14:16:07.820000', 'JWS Online', false, '^\w+$', 'jws', 'curien', null, null, false, null, null, null),
        (419, '2019-06-11 14:16:08.429000', false, null, 'ModelDB is a curated, searchable database of published models in the computational neuroscience domain. It accommodates models expressed in textual form, including procedural or declarative languages (e.g. C++, XML dialects) and source code written for any simulation environment.', 'MIR:00000131', '2019-06-11 14:16:08.429000', 'ModelDB', false, '^\d+$', 'modeldb', '45539', null, null, false, null, null, null),
        (421, '2019-06-11 14:16:08.635000', false, null, 'SubtiWiki is a scientific wiki for the model bacterium Bacillus subtilis. It provides comprehensive information on all genes and their proteins and RNA products, as well as information related to the current investigation of the gene/protein. 
Note: Currently, direct access to RNA products is restricted. This is expected to be rectified soon.', 'MIR:00000132', '2019-06-11 14:16:08.635000', 'SubtiWiki', false, '^BSU\d{5}$', 'subtiwiki', 'BSU29180', null, null, false, null, null, null),
        (424, '2019-06-11 14:16:08.872000', false, null, 'The Pathway Interaction Database is a highly-structured, curated collection of information about known human biomolecular interactions and key cellular processes assembled into signaling pathways. This datatype provides access to pathway information.', 'MIR:00000133', '2019-06-11 14:16:08.872000', 'NCI Pathway Interaction Database: Pathway', false, '^\w+$', 'pid.pathway', 'pi3kcipathway', null, null, false, null, null, null),
        (427, '2019-06-11 14:16:09.111000', false, null, 'The Database of Quantitative Cellular Signaling is a repository of models of signaling pathways. It includes reaction schemes, concentrations, rate constants, as well as annotations on the models. The database provides a range of search, navigation, and comparison functions. This datatype provides access to specific models.', 'MIR:00000134', '2019-06-11 14:16:09.111000', 'Database of Quantitative Cellular Signaling: Model', false, '^\d+$', 'doqcs.model', '57', null, null, false, null, null, null),
        (684, '2019-06-11 14:16:32.267000', false, null, 'The SWISS-MODEL Repository is a database of 3D protein structure models generated by the SWISS-MODEL homology-modelling pipeline for UniProtKB protein sequences.', 'MIR:00000231', '2019-06-11 14:16:32.267000', 'SWISS-MODEL Repository', false, '^\w+$', 'swiss-model', 'P23298', null, null, false, null, null, null),
        (430, '2019-06-11 14:16:09.372000', false, null, 'The Database of Quantitative Cellular Signaling is a repository of models of signaling pathways. It includes reaction schemes, concentrations, rate constants, as well as annotations on the models. The database provides a range of search, navigation, and comparison functions. This datatype provides access to pathways.', 'MIR:00000135', '2019-06-11 14:16:09.372000', 'Database of Quantitative Cellular Signaling: Pathway', false, '^\d+$', 'doqcs.pathway', '131', null, null, false, null, null, null),
        (435, '2019-06-11 14:16:09.937000', false, null, 'ClinicalTrials.gov provides free access to information on clinical studies for a wide range of diseases and conditions. Studies listed in the database are conducted in 175 countries', 'MIR:00000137', '2019-06-11 14:16:09.937000', 'ClinicalTrials.gov', false, '^NCT\d{8}$', 'clinicaltrials', 'NCT00222573', null, null, false, null, null, null),
        (438, '2019-06-11 14:16:10.254000', false, null, 'ChemSpider is a collection of compound data from across the web, which aggregates chemical structures and their associated information into a single searchable repository entry. These entries are supplemented with additional properties, related information and links back to original data sources.', 'MIR:00000138', '2019-06-11 14:16:10.254000', 'ChemSpider', false, '^\d+$', 'chemspider', '56586', null, null, false, null, null, null),
        (441, '2019-06-11 14:16:10.500000', false, null, 'NCI Thesaurus (NCIt) provides reference terminology covering vocabulary for clinical care, translational and basic research, and public information and administrative activities, providing a stable and unique identification code.', 'MIR:00000139', '2019-06-11 14:16:10.500000', 'NCIt', false, '^C\d+$', 'ncit', 'C80519', null, null, false, null, null, null),
        (445, '2019-06-11 14:16:10.872000', false, null, 'The BioCatalogue provides a common interface for registering, browsing and annotating Web Services to the Life Science community. Registered services are monitored, allowing the identification of service problems and changes and the filtering-out of unavailable or unreliable resources. BioCatalogue is free to use, for all.', 'MIR:00000140', '2019-06-11 14:16:10.872000', 'BioCatalogue', false, '^\d+$', 'biocatalogue.service', '614', null, null, false, null, null, null),
        (451, '2019-06-11 14:16:11.523000', false, null, 'Online Mendelian Inheritance in Animals is a a database of genes, inherited disorders and traits in animal species (other than human and mouse).', 'MIR:00000142', '2019-06-11 14:16:11.523000', 'OMIA', false, '^\d+$', 'omia', '1000', null, null, false, null, null, null),
        (454, '2019-06-11 14:16:11.769000', false, null, 'The Catalytic Site Atlas (CSA) is a database documenting enzyme active sites and catalytic residues in enzymes of 3D structure. It uses a defined classification for catalytic residues which includes only those residues thought to be directly involved in some aspect of the reaction catalysed by an enzyme.', 'MIR:00000144', '2019-06-11 14:16:11.769000', 'CSA', false, '^[0-9][A-Za-z0-9]{3}$', 'csa', '1a05', null, null, false, null, null, null),
        (456, '2019-06-11 14:16:11.955000', false, null, 'The Candida Genome Database (CGD) provides access to genomic sequence data and manually curated functional information about genes and proteins of the human pathogen Candida albicans. It collects gene names and aliases, and assigns gene ontology terms to describe the molecular function, biological process, and subcellular localization of gene products.', 'MIR:00000145', '2019-06-11 14:16:11.955000', 'Candida Genome Database', false, '^CAL\d{7}$', 'cgd', 'CAL0003079', null, null, false, null, null, null),
        (462, '2019-06-11 14:16:12.446000', false, null, 'PMC International (PMCI) is a free full-text archive of biomedical and life sciences journal literature. PMCI is a collaborative effort between the U.S. National Institutes of Health and the National Library of Medicine, the publishers whose journal content makes up the PMC archive, and organizations in other countries that share NIH''s and NLM''s interest in archiving life sciences literature.', 'MIR:00000147', '2019-06-11 14:16:12.446000', 'PMC International', false, 'PMC\d+', 'pmc', 'PMC3084216', null, null, false, null, null, null),
        (834, '2019-06-11 14:16:44.811000', false, null, 'The American Type Culture Collection (ATCC) is a private, nonprofit biological resource center whose mission focuses on the acquisition, authentication, production, preservation, development and distribution of standard reference microorganisms, cell lines and other materials for research in the life sciences.', 'MIR:00000284', '2019-06-11 14:16:44.811000', 'ATCC', false, '^\d+$', 'atcc', '11303', null, null, false, null, null, null),
        (466, '2019-06-11 14:16:12.793000', false, null, 'AmoebaDB is one of the databases that can be accessed through the EuPathDB (http://EuPathDB.org; formerly ApiDB) portal, covering eukaryotic pathogens of the genera Cryptosporidium, Giardia, Leishmania, Neospora, Plasmodium, Toxoplasma, Trichomonas and Trypanosoma. While each of these groups is supported by a taxon-specific database built upon the same infrastructure, the EuPathDB portal offers an entry point to all these resources, and the opportunity to leverage orthology for searches across genera.', 'MIR:00000148', '2019-06-11 14:16:12.793000', 'AmoebaDB', false, '^EDI_\d+$', 'amoebadb', 'EDI_244000', null, null, false, null, null, null),
        (469, '2019-06-11 14:16:13.024000', false, null, 'CryptoDB is one of the databases that can be accessed through the EuPathDB (http://EuPathDB.org; formerly ApiDB) portal, covering eukaryotic pathogens of the genera Cryptosporidium, Giardia, Leishmania, Neospora, Plasmodium, Toxoplasma, Trichomonas and Trypanosoma. While each of these groups is supported by a taxon-specific database built upon the same infrastructure, the EuPathDB portal offers an entry point to all these resources, and the opportunity to leverage orthology for searches across genera.', 'MIR:00000149', '2019-06-11 14:16:13.024000', 'CryptoDB', false, '^\w+', 'cryptodb', 'cgd7_230', null, null, false, null, null, null),
        (471, '2019-06-11 14:16:13.221000', false, null, 'AmoebaDB is one of the databases that can be accessed through the EuPathDB (http://EuPathDB.org; formerly ApiDB) portal, covering eukaryotic pathogens of the genera Cryptosporidium, Giardia, Leishmania, Neospora, Plasmodium, Toxoplasma, Trichomonas and Trypanosoma. While each of these groups is supported by a taxon-specific database built upon the same infrastructure, the EuPathDB portal offers an entry point to all these resources, and the opportunity to leverage orthology for searches across genera.', 'MIR:00000150', '2019-06-11 14:16:13.221000', 'PlasmoDB', false, '^\w+$', 'plasmodb', 'PF11_0344', null, null, false, null, null, null),
        (473, '2019-06-11 14:16:13.424000', false, null, 'GiardiaDB is one of the databases that can be accessed through the EuPathDB (http://EuPathDB.org; formerly ApiDB) portal, covering eukaryotic pathogens of the genera Cryptosporidium, Giardia, Leishmania, Neospora, Plasmodium, Toxoplasma, Trichomonas and Trypanosoma. While each of these groups is supported by a taxon-specific database built upon the same infrastructure, the EuPathDB portal offers an entry point to all these resources, and the opportunity to leverage orthology for searches across genera.', 'MIR:00000151', '2019-06-11 14:16:13.424000', 'GiardiaDB', false, '^\w+$', 'giardiadb', 'GL50803_102438', null, null, false, null, null, null),
        (475, '2019-06-11 14:16:13.630000', false, null, 'MicrosporidiaDB is one of the databases that can be accessed through the EuPathDB (http://EuPathDB.org; formerly ApiDB) portal, covering eukaryotic pathogens of the genera Cryptosporidium, Giardia, Leishmania, Neospora, Plasmodium, Toxoplasma, Trichomonas and Trypanosoma. While each of these groups is supported by a taxon-specific database built upon the same infrastructure, the EuPathDB portal offers an entry point to all these resources, and the opportunity to leverage orthology for searches across genera.', 'MIR:00000152', '2019-06-11 14:16:13.630000', 'MicrosporidiaDB', false, '^\w+$', 'microsporidia', 'ECU03_0820i', null, null, false, null, null, null),
        (477, '2019-06-11 14:16:13.817000', false, null, 'ToxoDB is one of the databases that can be accessed through the EuPathDB (http://EuPathDB.org; formerly ApiDB) portal, covering eukaryotic pathogens of the genera Cryptosporidium, Giardia, Leishmania, Neospora, Plasmodium, Toxoplasma, Trichomonas and Trypanosoma. While each of these groups is supported by a taxon-specific database built upon the same infrastructure, the EuPathDB portal offers an entry point to all these resources, and the opportunity to leverage orthology for searches across genera.', 'MIR:00000153', '2019-06-11 14:16:13.817000', 'ToxoDB', false, '^\w+$', 'toxoplasma', 'TGME49_053730', null, null, false, null, null, null),
        (479, '2019-06-11 14:16:14.019000', false, null, 'TrichDB is one of the databases that can be accessed through the EuPathDB (http://EuPathDB.org; formerly ApiDB) portal, covering eukaryotic pathogens of the genera Cryptosporidium, Giardia, Leishmania, Neospora, Plasmodium, Toxoplasma, Trichomonas and Trypanosoma. While each of these groups is supported by a taxon-specific database built upon the same infrastructure, the EuPathDB portal offers an entry point to all these resources, and the opportunity to leverage orthology for searches across genera.', 'MIR:00000154', '2019-06-11 14:16:14.019000', 'TrichDB', false, '^\w+$', 'trichdb', 'TVAG_386080', null, null, false, null, null, null),
        (481, '2019-06-11 14:16:14.213000', false, null, 'TriTrypDB is one of the databases that can be accessed through the EuPathDB (http://EuPathDB.org; formerly ApiDB) portal, covering eukaryotic pathogens of the genera Cryptosporidium, Giardia, Leishmania, Neospora, Plasmodium, Toxoplasma, Trichomonas and Trypanosoma. While each of these groups is supported by a taxon-specific database built upon the same infrastructure, the EuPathDB portal offers an entry point to all these resources, and the opportunity to leverage orthology for searches across genera.', 'MIR:00000155', '2019-06-11 14:16:14.213000', 'TriTrypDB', false, '^\w+(\.)?\w+(\.)?\w+', 'tritrypdb', 'Tb927.8.620', null, null, false, null, null, null),
        (484, '2019-06-11 14:16:14.437000', false, null, 'BDGP gene disruption collection provides a public resource of gene disruptions of Drosophila genes using a single transposable element.', 'MIR:00000156', '2019-06-11 14:16:14.437000', 'BDGP insertion DB', false, '^\w+$', 'bdgp.insertion', 'KG09531', null, null, false, null, null, null),
        (487, '2019-06-11 14:16:14.695000', false, null, 'BeetleBase is a comprehensive sequence database and community resource for Tribolium genetics, genomics and developmental biology. It incorporates information about genes, mutants, genetic markers, expressed sequence tags and publications.', 'MIR:00000157', '2019-06-11 14:16:14.695000', 'BeetleBase', false, '^TC\d+$', 'beetlebase', 'TC010103', null, null, false, null, null, null),
        (490, '2019-06-11 14:16:14.938000', false, null, 'The Barcode of Life Data System (BOLD) is an informatics workbench aiding the acquisition, storage, analysis and publication of DNA barcode records. The associated taxonomy browser shows the progress of DNA barcoding and provides sample collection site distribution, and taxon occurence information.', 'MIR:00000158', '2019-06-11 14:16:14.938000', 'BOLD Taxonomy', false, '^\d+$', 'bold.taxonomy', '27267', null, null, false, null, null, null),
        (493, '2019-06-11 14:16:15.166000', false, null, 'The dbEST contains sequence data and other information on "single-pass" cDNA sequences, or "Expressed Sequence Tags", from a number of organisms.', 'MIR:00000159', '2019-06-11 14:16:15.166000', 'dbEST', false, '^([A-Z]+)?\d+(\.\d+)?$', 'dbest', 'BP100000', null, null, false, null, null, null),
        (497, '2019-06-11 14:16:15.607000', false, null, 'The NCBI Probe Database is a public registry of nucleic acid reagents designed for use in a wide variety of biomedical research applications, together with information on reagent distributors, probe effectiveness, and computed sequence similarities.', 'MIR:00000160', '2019-06-11 14:16:15.607000', 'dbProbe', false, '^\d+$', 'dbprobe', '1000000', null, null, false, null, null, null),
        (499, '2019-06-11 14:16:15.831000', false, null, 'The dbSNP database is a repository for both single base nucleotide subsitutions and short deletion and insertion polymorphisms.', 'MIR:00000161', '2019-06-11 14:16:15.831000', 'dbSNP', false, '^rs\d+$', 'dbsnp', 'rs121909098', null, null, false, null, null, null),
        (503, '2019-06-11 14:16:16.225000', false, null, 'UniSTS is a comprehensive database of sequence tagged sites (STSs) derived from STS-based maps and other experiments. STSs are defined by PCR primer pairs and are associated with additional information such as genomic position, genes, and sequences.', 'MIR:00000162', '2019-06-11 14:16:16.225000', 'UniSTS', false, '^\d+$', 'unists', '456789', null, null, false, null, null, null),
        (505, '2019-06-11 14:16:16.429000', false, null, 'The EcoGene database contains updated information about the E. coli K-12 genome and proteome sequences, including extensive gene bibliographies. A major EcoGene focus has been the re-evaluation of translation start sites.', 'MIR:00000163', '2019-06-11 14:16:16.429000', 'EcoGene', false, '^EG\d+$', 'ecogene', 'EG10173', null, null, false, null, null, null),
        (837, '2019-06-11 14:16:45.049000', false, null, 'The BDGP EST database collects the expressed sequence tags (ESTs) derived from a variety of tissues and developmental stages for Drosophila melanogaster. All BDGP ESTs are available at dbEST (NCBI).', 'MIR:00000285', '2019-06-11 14:16:45.049000', 'BDGP EST', false, '^\w+(\.)?(\d+)?$', 'bdgp.est', 'EY223054.1', null, null, false, null, null, null),
        (508, '2019-06-11 14:16:16.652000', false, null, 'GabiPD (Genome Analysis of Plant Biological Systems Primary Database) constitutes a repository for a wide array of heterogeneous data from high-throughput experiments in several plant species. These data (i.e. genomics, transcriptomics, proteomics and metabolomics), originating from different model or crop species, can be accessed through a central gene ''Green Card''.', 'MIR:00000164', '2019-06-11 14:16:16.652000', 'GABI', false, '^\w+$', 'gabi', '2679240', null, null, false, null, null, null),
        (511, '2019-06-11 14:16:16.885000', false, null, 'A 16S rRNA gene database which provides chimera screening, standard alignment, and taxonomic classification using multiple published taxonomies.', 'MIR:00000165', '2019-06-11 14:16:16.885000', 'GreenGenes', false, '^\d+$', 'greengenes', '100000', null, null, false, null, null, null),
        (514, '2019-06-11 14:16:17.150000', false, null, 'GRIN (Germplasm Resources Information Network) Taxonomy for Plants provides information on scientific and common names, classification, distribution, references, and economic impact.', 'MIR:00000166', '2019-06-11 14:16:17.150000', 'GRIN Plant Taxonomy', false, '^\d+$', 'grin.taxonomy', '19333', null, null, false, null, null, null),
        (517, '2019-06-11 14:16:17.382000', false, null, 'H-Invitational Database (H-InvDB) is an integrated database of human genes and transcripts. It provides curated annotations of human genes and transcripts including gene structures, alternative splicing isoforms, non-coding functional RNAs, protein functions, functional domains, sub-cellular localizations, metabolic pathways, protein 3D structure, genetic polymorphisms (SNPs, indels and microsatellite repeats), relation with diseases, gene expression profiling, molecular evolutionary features, protein-protein interactions (PPIs) and gene families/groups. This datatype provides access to the ''Locus'' view.', 'MIR:00000167', '2019-06-11 14:16:17.382000', 'H-InvDb Locus', false, '^HIX\d{7}(\.\d+)?$', 'hinv.locus', 'HIX0004394', null, null, false, null, null, null),
        (520, '2019-06-11 14:16:17.622000', false, null, 'H-Invitational Database (H-InvDB) is an integrated database of human genes and transcripts. It provides curated annotations of human genes and transcripts including gene structures, alternative splicing isoforms, non-coding functional RNAs, protein functions, functional domains, sub-cellular localizations, metabolic pathways, protein 3D structure, genetic polymorphisms (SNPs, indels and microsatellite repeats), relation with diseases, gene expression profiling, molecular evolutionary features, protein-protein interactions (PPIs) and gene families/groups. This datatype provides access to the ''Transcript'' view.', 'MIR:00000168', '2019-06-11 14:16:17.622000', 'H-InvDb Transcript', false, '^HIT\d{9}(\.\d+)?$', 'hinv.transcript', 'HIT000195363', null, null, false, null, null, null),
        (522, '2019-06-11 14:16:17.817000', false, null, 'H-Invitational Database (H-InvDB) is an integrated database of human genes and transcripts. It provides curated annotations of human genes and transcripts including gene structures, alternative splicing isoforms, non-coding functional RNAs, protein functions, functional domains, sub-cellular localizations, metabolic pathways, protein 3D structure, genetic polymorphisms (SNPs, indels and microsatellite repeats), relation with diseases, gene expression profiling, molecular evolutionary features, protein-protein interactions (PPIs) and gene families/groups. This datatype provides access to the ''Protein'' view.', 'MIR:00000169', '2019-06-11 14:16:17.817000', 'H-InvDb Protein', false, '^HIP\d{9}(\.\d+)?$', 'hinv.protein', 'HIP000030660', null, null, false, null, null, null),
        (524, '2019-06-11 14:16:18.019000', false, null, 'The Human Oral Microbiome Database (HOMD) provides a site-specific comprehensive database for the more than 600 prokaryote species that are present in the human oral cavity. It contains genomic information based on a curated 16S rRNA gene-based provisional naming scheme, and taxonomic information. This datatype contains genomic sequence information.', 'MIR:00000170', '2019-06-11 14:16:18.019000', 'HOMD Sequence Metainformation', false, '^SEQF\d+$', 'homd.seq', 'SEQF1003', null, null, false, null, null, null),
        (527, '2019-06-11 14:16:18.268000', false, null, 'The Human Oral Microbiome Database (HOMD) provides a site-specific comprehensive database for the more than 600 prokaryote species that are present in the human oral cavity. It contains genomic information based on a curated 16S rRNA gene-based provisional naming scheme, and taxonomic information. This datatype contains taxonomic information.', 'MIR:00000171', '2019-06-11 14:16:18.268000', 'HOMD Taxonomy', false, '^\d+$', 'homd.taxon', '811', null, null, false, null, null, null),
        (529, '2019-06-11 14:16:18.461000', false, null, 'Influenza Research Database (IRD) contains information related to influenza virus, including genomic sequence, strain, protein, epitope  and bibliographic information. The Segment Details page contains descriptive information and annotation data about a particular genomic segment and its encoded product(s).', 'MIR:00000172', '2019-06-11 14:16:18.461000', 'IRD Segment Sequence', false, '^\w+(\_)?\d+(\.\d+)?$', 'ird.segment', 'CY077097', null, null, false, null, null, null),
        (532, '2019-06-11 14:16:18.690000', false, null, 'ISfinder is a database of bacterial insertion sequences (IS). It assigns IS nomenclature and acts as a repository for ISs. Each IS is annotated with information such as the open reading frame DNA sequence, the sequence of the ends of the element and target sites, its origin and distribution together with a bibliography, where available.', 'MIR:00000173', '2019-06-11 14:16:18.690000', 'ISFinder', false, '^IS\w+(\-\d)?$', 'isfinder', 'ISA1083-2', null, null, false, null, null, null),
        (535, '2019-06-11 14:16:18.921000', false, null, 'The Japan Collection of Microorganisms (JCM) collects, catalogues, and distributes cultured microbial strains, restricted to those classified in Risk Group 1 or 2.', 'MIR:00000174', '2019-06-11 14:16:18.921000', 'Japan Collection of Microorganisms', false, '^\d+$', 'jcm', '17254', null, null, false, null, null, null),
        (538, '2019-06-11 14:16:19.173000', false, null, 'The integrated microbial genomes (IMG) system is a data management, analysis and annotation platform for all publicly available genomes. IMG contains both draft and complete JGI (DoE Joint Genome Institute) microbial genomes integrated with all other publicly available genomes from all three domains of life, together with a large number of plasmids and viruses. This datatype refers to taxon information.', 'MIR:00000175', '2019-06-11 14:16:19.173000', 'Integrated Microbial Genomes Taxon', false, '^\d+$', 'img.taxon', '648028003', null, null, false, null, null, null),
        (541, '2019-06-11 14:16:19.420000', false, null, 'The integrated microbial genomes (IMG) system is a data management, analysis and annotation platform for all publicly available genomes. IMG contains both draft and complete JGI (DoE Joint Genome Institute) microbial genomes integrated with all other publicly available genomes from all three domains of life, together with a large number of plasmids and viruses. This datatype refers to gene information.', 'MIR:00000176', '2019-06-11 14:16:19.420000', 'Integrated Microbial Genomes Gene', false, '^\d+$', 'img.gene', '638309541', null, null, false, null, null, null),
        (543, '2019-06-11 14:16:19.610000', false, null, 'MaizeGDB is the maize research community''s central repository for genetics and genomics information.', 'MIR:00000177', '2019-06-11 14:16:19.610000', 'MaizeGDB Locus', false, '^\d+$', 'maizegdb.locus', '25011', null, null, false, null, null, null),
        (546, '2019-06-11 14:16:19.843000', false, null, 'MycoBank is an online database, documenting new mycological names and combinations, eventually combined with descriptions and illustrations.', 'MIR:00000178', '2019-06-11 14:16:19.843000', 'MycoBank', false, '^\d+$', 'mycobank', '349124', null, null, false, null, null, null),
        (549, '2019-06-11 14:16:20.103000', false, null, 'NITE Biological Research Center (NBRC) provides a collection of microbial resources, performing taxonomic characterization of individual microorganisms such as bacteria including actinomycetes and archaea, yeasts, fungi, algaes, bacteriophages and DNA resources for academic research and industrial applications. A catalogue is maintained which states strain nomenclature, synonyms, and culture and sequence information.', 'MIR:00000179', '2019-06-11 14:16:20.103000', 'NITE Biological Research Center Catalogue', false, '^\d+$', 'nbrc', '00001234', null, null, false, null, null, null),
        (552, '2019-06-11 14:16:20.362000', false, null, 'The Pseudomonas Genome Database is a resource for peer-reviewed, continually updated annotation for all Pseudomonas species. It includes gene and protein sequence information, as well as regulation and predicted function and annotation.', 'MIR:00000180', '2019-06-11 14:16:20.362000', 'Pseudomonas Genome Database', false, '^P\w+$', 'pseudomonas', 'PSEEN0001', null, null, false, null, null, null),
        (555, '2019-06-11 14:16:20.589000', false, null, 'Gramene is a comparative genome mapping database for grasses and crop plants. It combines a semi-automatically generated database of cereal genomic and expressed sequence tag sequences, genetic maps, map relations, quantitative trait loci (QTL), and publications, with a curated database of mutants (genes and alleles), molecular markers, and proteins. This datatype refers to proteins in Gramene.', 'MIR:00000181', '2019-06-11 14:16:20.589000', 'Gramene protein', false, '^\d+$', 'gramene.protein', '78073', null, null, false, null, null, null),
        (558, '2019-06-11 14:16:20.812000', false, null, 'Gramene is a comparative genome mapping database for grasses and crop plants. It combines a semi-automatically generated database of cereal genomic and expressed sequence tag sequences, genetic maps, map relations, quantitative trait loci (QTL), and publications, with a curated database of mutants (genes and alleles), molecular markers, and proteins. This datatype refers to genes in Gramene.', 'MIR:00000182', '2019-06-11 14:16:20.812000', 'Gramene genes', false, '^GR\:\d+$', 'gramene.gene', 'GR:0080039', null, null, false, null, null, null),
        (560, '2019-06-11 14:16:21.008000', false, null, 'Gramene is a comparative genome mapping database for grasses and crop plants. It combines a semi-automatically generated database of cereal genomic and expressed sequence tag sequences, genetic maps, map relations, quantitative trait loci (QTL), and publications, with a curated database of mutants (genes and alleles), molecular markers, and proteins. This datatype refers to taxonomic information in Gramene.', 'MIR:00000183', '2019-06-11 14:16:21.008000', 'Gramene Taxonomy', false, '^GR\_tax\:\d+$', 'gramene.taxonomy', 'GR_tax:013681', null, null, false, null, null, null),
        (562, '2019-06-11 14:16:21.219000', false, null, 'Gramene is a comparative genome mapping database for grasses and crop plants. It combines a semi-automatically generated database of cereal genomic and expressed sequence tag sequences, genetic maps, map relations, quantitative trait loci (QTL), and publications, with a curated database of mutants (genes and alleles), molecular markers, and proteins. This datatype refers to quantitative trait loci identified in Gramene.', 'MIR:00000184', '2019-06-11 14:16:21.219000', 'Gramene QTL', false, '^\w+$', 'gramene.qtl', 'CQG5', null, null, false, null, null, null),
        (564, '2019-06-11 14:16:21.425000', false, null, 'The Sol Genomics Network (SGN) is a database and website dedicated to the genomic information of the nightshade family, which includes species such as tomato, potato, pepper, petunia and eggplant.', 'MIR:00000185', '2019-06-11 14:16:21.425000', 'Sol Genomics Network', false, '^\d+$', 'sgn', '0001', null, null, false, null, null, null),
        (570, '2019-06-11 14:16:21.882000', false, null, 'BioPortal is an open repository of biomedical ontologies that provides access via Web services and Web browsers to ontologies developed in OWL, RDF, OBO format and Protégé frames. BioPortal functionality includes the ability to browse, search and visualize ontologies.', 'MIR:00000187', '2019-06-11 14:16:21.882000', 'BioPortal', false, '^\d+$', 'bioportal', '1046', null, null, false, null, null, null),
        (573, '2019-06-11 14:16:22.127000', false, null, 'MIRIAM Registry is an online resource created to catalogue data types (Gene Ontology, Taxonomy or PubMed are some examples), their URIs and the corresponding resources (or physical locations), whether these are controlled vocabularies or databases.', 'MIR:00000188', '2019-06-11 14:16:22.127000', 'MIRIAM Registry resource', false, '^MIR:001\d{5}$', 'miriam.resource', 'MIR:00100005', null, null, false, null, null, null),
        (681, '2019-06-11 14:16:32.004000', false, null, 'REBASE is a comprehensive database of information about restriction enzymes, DNA methyltransferases and related proteins involved in the biological process of restriction-modification (R-M). It contains fully referenced information about recognition and cleavage sites, isoschizomers, neoschizomers, commercial availability, methylation sensitivity, crystal and sequence data.', 'MIR:00000230', '2019-06-11 14:16:32.004000', 'REBASE', false, '^\d+$', 'rebase', '101', null, null, false, null, null, null),
        (575, '2019-06-11 14:16:22.318000', false, null, 'EDAM is an ontology of general bioinformatics concepts, including topics, data types, formats, identifiers and operations. EDAM provides a controlled vocabulary for the description, in semantic terms, of things such as: web services (e.g. WSDL files), applications, tool collections and packages, work-benches and workflow software, databases and ontologies, XSD data schema and data objects, data syntax and file formats, web portals and pages, resource catalogues and documents (such as scientific publications).', 'MIR:00000189', '2019-06-11 14:16:22.318000', 'EDAM Ontology', false, '^(data|topic|operation|format)\_\d{4}$', 'edam', 'data_1664', null, null, false, null, null, null),
        (578, '2019-06-11 14:16:22.644000', false, null, 'The Protein Model DataBase (PMDB), is a database that collects manually built three dimensional protein models, obtained by different structure prediction techniques.', 'MIR:00000190', '2019-06-11 14:16:22.644000', 'Protein Model Database', false, '^PM\d{7}', 'pmdb', 'PM0012345', null, null, false, null, null, null),
        (581, '2019-06-11 14:16:22.902000', false, null, 'ArachnoServer (www.arachnoserver.org) is a manually curated database providing information on the sequence, structure and biological activity of protein toxins from spider venoms. It include a molecular target ontology designed specifically for venom toxins, as well as current and historic taxonomic information.', 'MIR:00000193', '2019-06-11 14:16:22.902000', 'ArachnoServer', false, '^AS\d{6}$', 'arachnoserver', 'AS000060', null, null, false, null, null, null),
        (584, '2019-06-11 14:16:23.132000', false, null, 'BioCyc is a collection of Pathway/Genome Databases (PGDBs) which provides an electronic reference source on the genomes and metabolic pathways of sequenced organisms.', 'MIR:00000194', '2019-06-11 14:16:23.132000', 'BioCyc', false, '^[A-Z-0-9]+(\:)?[A-Za-z0-9+_.%-:]+$', 'biocyc', 'ECOLI:CYT-D-UBIOX-CPLX', null, null, false, null, null, null),
        (587, '2019-06-11 14:16:23.358000', false, null, 'The Carbohydrate-Active Enzyme (CAZy) database is a resource specialized in enzymes that build and breakdown complex carbohydrates and glycoconjugates. These enzymes are classified into families based on structural features.', 'MIR:00000195', '2019-06-11 14:16:23.358000', 'CAZy', false, '^(GT|GH|PL|CE|CBM)\d+(\_\d+)?$', 'cazy', 'GT10', null, null, false, null, null, null),
        (590, '2019-06-11 14:16:23.594000', false, null, 'The GOA (Gene Ontology Annotation) project provides high-quality Gene Ontology (GO) annotations to proteins in the UniProt Knowledgebase (UniProtKB) and International Protein Index (IPI). This involves electronic annotation and the integration of high-quality manual GO annotation from all GO Consortium model organism groups and specialist groups.', 'MIR:00000196', '2019-06-11 14:16:23.594000', 'GOA', false, '^(([A-N,R-Z][0-9][A-Z][A-Z, 0-9][A-Z, 0-9][0-9])|([O,P,Q][0-9][A-Z, 0-9][A-Z, 0-9][A-Z, 0-9][0-9]))|(URS[0-9A-F]{10}(_[0-9]+){0,1})|(EBI-[0-9]+)$', 'goa', 'P12345', null, null, false, null, null, null),
        (592, '2019-06-11 14:16:23.782000', false, null, 'The Paleobiology Database seeks to provide researchers and the public with information about the entire fossil record. It stores global, collection-based occurrence and taxonomic data for marine and terrestrial animals and plants of any geological age, as well as web-based software for statistical analysis of the data.', 'MIR:00000197', '2019-06-11 14:16:23.782000', 'PaleoDB', false, '^\d+$', 'paleodb', '83088', null, null, false, null, null, null),
        (595, '2019-06-11 14:16:24.045000', false, null, 'Compluyeast-2D-DB is a two-dimensional polyacrylamide gel electrophoresis federated database. This collection references a subset of Uniprot, and contains general information about the protein record.', 'MIR:00000198', '2019-06-11 14:16:24.045000', 'Compulyeast', false, '^([A-N,R-Z][0-9][A-Z][A-Z, 0-9][A-Z, 0-9][0-9])|([O,P,Q][0-9][A-Z, 0-9][A-Z, 0-9][A-Z, 0-9][0-9])$', 'compulyeast', 'O08709', null, null, false, null, null, null),
        (601, '2019-06-11 14:16:24.496000', false, null, 'EchoBASE is a database designed to contain and manipulate information from post-genomic experiments using the model bacterium Escherichia coli K-12. The database is built on an enhanced annotation of the updated genome sequence of strain MG1655 and the association of experimental data with the E.coli genes and their products.', 'MIR:00000200', '2019-06-11 14:16:24.496000', 'EchoBASE', false, '^EB\d+$', 'echobase', 'EB0170', null, null, false, null, null, null),
        (598, '2019-06-11 14:16:24.278000', false, null, 'DisProt is a database of intrinsically disordered proteins and protein disordered regions, manually curated from literature.', 'MIR:00000199', '2021-02-17 17:15:29.025000', 'DisProt', false, '^DP\d{5}$', 'disprot', 'DP00003', null, null, false, null, null, null),
        (604, '2019-06-11 14:16:24.719000', false, null, 'eggNOG (evolutionary genealogy of genes: Non-supervised Orthologous Groups) is a database of orthologous groups of genes. The orthologous groups are annotated with functional description lines (derived by identifying a common denominator for the genes based on their various annotations), with functional categories (i.e derived from the original COG/KOG categories).', 'MIR:00000201', '2019-06-11 14:16:24.719000', 'eggNOG', false, '^\w+$', 'eggnog', 'veNOG12876', null, null, false, null, null, null),
        (607, '2019-06-11 14:16:24.944000', false, null, 'Ensembl Genomes consists of five sub-portals (for bacteria, protists, fungi, plants and invertebrate metazoa) designed to complement the availability of vertebrate genomes in Ensembl. This collection is concerned with bacterial genomes.', 'MIR:00000202', '2019-06-11 14:16:24.944000', 'Ensembl Bacteria', false, '^((EB\w+)|([A-Z0-9]+\_[A-Z0-9]+))$', 'ensembl.bacteria', 'MU9_3181', null, null, false, null, null, null),
        (609, '2019-06-11 14:16:25.183000', false, null, 'Ensembl Genomes consists of five sub-portals (for bacteria, protists, fungi, plants and invertebrate metazoa) designed to complement the availability of vertebrate genomes in Ensembl. This collection is concerned with protist genomes.', 'MIR:00000203', '2019-06-11 14:16:25.183000', 'Ensembl Protists', false, '^\w+$', 'ensembl.protist', 'PF3D7_1328700', null, null, false, null, null, null),
        (611, '2019-06-11 14:16:25.396000', false, null, 'Ensembl Genomes consists of five sub-portals (for bacteria, protists, fungi, plants and invertebrate metazoa) designed to complement the availability of vertebrate genomes in Ensembl. This collection is concerned with metazoa genomes.', 'MIR:00000204', '2019-06-11 14:16:25.396000', 'Ensembl Metazoa', false, '^\w+(\.)?\d+$', 'ensembl.metazoa', 'FBtr0084214', null, null, false, null, null, null),
        (613, '2019-06-11 14:16:25.597000', false, null, 'Ensembl Genomes consists of five sub-portals (for bacteria, protists, fungi, plants and invertebrate metazoa) designed to complement the availability of vertebrate genomes in Ensembl. This collection is concerned with plant genomes.', 'MIR:00000205', '2019-06-11 14:16:25.597000', 'Ensembl Plants', false, '^\w+(\.\d+)?(\.\d+)?$', 'ensembl.plant', 'AT1G73965', null, null, false, null, null, null),
        (615, '2019-06-11 14:16:25.804000', false, null, 'Ensembl Genomes consists of five sub-portals (for bacteria, protists, fungi, plants and invertebrate metazoa) designed to complement the availability of vertebrate genomes in Ensembl. This collection is concerned with fungal genomes.', 'MIR:00000206', '2019-06-11 14:16:25.804000', 'Ensembl Fungi', false, '^[A-Z-a-z0-9]+$', 'ensembl.fungi', 'CADAFLAT00006211', null, null, false, null, null, null),
        (617, '2019-06-11 14:16:26.018000', false, null, 'the European Hepatitis C Virus Database (euHCVdb, http://euhcvdb.ibcp.fr), a collection of computer-annotated sequences based on reference genomes.mainly dedicated to HCV protein sequences, 3D structures and functional analyses.', 'MIR:00000207', '2019-06-11 14:16:26.018000', 'HCVDB', false, '^M\d{5}$', 'hcvdb', 'M58335', null, null, false, null, null, null),
        (620, '2019-06-11 14:16:26.301000', false, null, 'GenAtlas is a database containing information on human genes, markers and phenotypes.', 'MIR:00000208', '2019-06-11 14:16:26.301000', 'Genatlas', false, '^\w+$', 'genatlas', 'HBB', null, null, false, null, null, null),
        (623, '2019-06-11 14:16:26.635000', false, null, 'The CATH database is a hierarchical domain classification of protein structures in the Protein Data Bank. Protein structures are classified using a combination of automated and manual procedures. There are four major levels in this hierarchy; Class (secondary structure classification, e.g. mostly alpha), Architecture (classification based on overall shape), Topology (fold family) and  Homologous superfamily (protein domains which are thought to share a common ancestor). This colelction is concerned with superfamily classification.', 'MIR:00000209', '2019-06-11 14:16:26.635000', 'CATH superfamily', false, '^\d+(\.\d+(\.\d+(\.\d+)?)?)?$', 'cath.superfamily', '1.10.10.200', null, null, false, null, null, null),
        (817, '2019-06-11 14:16:43.451000', false, null, 'The antimicrobial peptide database (APD) provides information on anticancer, antiviral, antifungal and antibacterial peptides.', 'MIR:00000278', '2019-06-11 14:16:43.451000', 'APD', false, '^\d{5}$', 'apd', '01001', null, null, false, null, null, null),
        (626, '2019-06-11 14:16:26.899000', false, null, 'The CATH database is a hierarchical domain classification of protein structures in the Protein Data Bank. Protein structures are classified using a combination of automated and manual procedures. There are four major levels in this hierarchy; Class (secondary structure classification, e.g. mostly alpha), Architecture (classification based on overall shape), Topology (fold family) and Homologous superfamily (protein domains which are thought to share a common ancestor). This colelction is concerned with CATH domains.', 'MIR:00000210', '2019-06-11 14:16:26.899000', 'CATH domain', false, '^\w+$', 'cath.domain', '1cukA01', null, null, false, null, null, null),
        (628, '2019-06-11 14:16:27.145000', false, null, 'GeneFarm is a database whose purpose is to store traceable annotations for Arabidopsis nuclear genes and gene products.', 'MIR:00000211', '2019-06-11 14:16:27.145000', 'GeneFarm', false, '^\d+$', 'genefarm', '4892', null, null, false, null, null, null),
        (631, '2019-06-11 14:16:27.419000', false, null, 'The G protein-coupled receptor database (GPCRDB) collects, large amounts of heterogeneous data on GPCRs. It contains experimental data on sequences, ligand-binding constants, mutations and oligomers, and derived data such as multiple sequence alignments and homology models.', 'MIR:00000212', '2019-06-11 14:16:27.419000', 'GPCRDB', false, '^\w+$', 'gpcrdb', 'RL3R1_HUMAN', null, null, false, null, null, null),
        (634, '2019-06-11 14:16:27.678000', false, null, 'HOGENOM is a database of homologous genes from fully sequenced organisms (bacteria, archeae and eukarya). This collection references phylogenetic trees which can be retrieved using either UniProt accession numbers, or HOGENOM tree family identifier.', 'MIR:00000213', '2019-06-11 14:16:27.678000', 'HOGENOM', false, '^\w+$', 'hogenom', 'HBG284870', null, null, false, null, null, null),
        (637, '2019-06-11 14:16:27.950000', false, null, 'Genetree displays the maximum likelihood phylogenetic (protein) trees representing the evolutionary history of the genes. These are constructed using the canonical protein for every gene in Ensembl.', 'MIR:00000214', '2019-06-11 14:16:27.950000', 'GeneTree', false, '^ENSGT\d+$', 'genetree', 'ENSGT00550000074763', null, null, false, null, null, null),
        (639, '2019-06-11 14:16:28.184000', false, null, 'HSSP (homology-derived structures of proteins) is a derived database merging structural (2-D and 3-D) and sequence information (1-D). For each protein of known 3D structure from the Protein Data Bank, the database has a file with all sequence homologues, properly aligned to the PDB protein.', 'MIR:00000215', '2019-06-11 14:16:28.184000', 'HSSP', false, '^\w{4}$', 'hssp', '102l', null, null, false, null, null, null),
        (712, '2019-06-11 14:16:34.772000', false, null, 'The Japan Chemical Substance Dictionary is an organic compound dictionary database prepared by the Japan Science and Technology Agency (JST).', 'MIR:00000241', '2019-06-11 14:16:34.772000', 'Japan Chemical Substance Dictionary', false, '^J\d{1,3}(\.\d{3})?(\.\d{1,3})?[A-Za-z]$', 'jcsd', 'J55.713G', null, null, false, null, null, null),
        (644, '2019-06-11 14:16:28.639000', false, null, 'Mycobrowser is a resource that provides both in silico generated and manually reviewed information within databases dedicated to the complete genomes of Mycobacterium tuberculosis, Mycobacterium leprae, Mycobacterium marinum and Mycobacterium smegmatis. This collection references Mycobacteria tuberculosis information.', 'MIR:00000216', '2019-06-11 14:16:28.639000', 'MycoBrowser tuberculosis', false, '^Rv\d{4}(A|B|c)?$', 'myco.tuber', 'Rv1908c', null, null, false, null, null, null),
        (647, '2019-06-11 14:16:28.887000', false, null, 'Mycobrowser is a resource that provides both in silico generated and manually reviewed information within databases dedicated to the complete genomes of Mycobacterium tuberculosis, Mycobacterium leprae, Mycobacterium marinum and Mycobacterium smegmatis. This collection references Mycobacteria leprae information.', 'MIR:00000217', '2019-06-11 14:16:28.887000', 'MycoBrowser leprae', false, '^ML\w+$', 'myco.lepra', 'ML0224', null, null, false, null, null, null),
        (649, '2019-06-11 14:16:29.087000', false, null, 'Mycobrowser is a resource that provides both in silico generated and manually reviewed information within databases dedicated to the complete genomes of Mycobacterium tuberculosis, Mycobacterium leprae, Mycobacterium marinum and Mycobacterium smegmatis. This collection references Mycobacteria marinum information.', 'MIR:00000218', '2019-06-11 14:16:29.087000', 'MycoBrowser marinum', false, '^MMAR\_\d+$', 'myco.marinum', 'MMAR_2462', null, null, false, null, null, null),
        (651, '2019-06-11 14:16:29.310000', false, null, 'Mycobrowser is a resource that provides both in silico generated and manually reviewed information within databases dedicated to the complete genomes of Mycobacterium tuberculosis, Mycobacterium leprae, Mycobacterium marinum and Mycobacterium smegmatis. This collection references Mycobacteria smegmatis information.', 'MIR:00000219', '2019-06-11 14:16:29.310000', 'MycoBrowser smegmatis', false, '^MSMEG\w+$', 'myco.smeg', 'MSMEG_3769', null, null, false, null, null, null),
        (653, '2019-06-11 14:16:29.544000', false, null, 'Orphanet is a reference portal for information on rare diseases and orphan drugs. It’s aim is to help improve the diagnosis, care and treatment of patients with rare diseases.', 'MIR:00000220', '2019-06-11 14:16:29.544000', 'Orphanet', false, '^\d+$', 'orphanet', '85163', null, null, false, null, null, null),
        (657, '2019-06-11 14:16:29.860000', false, null, 'OrthoDB presents a catalog of eukaryotic orthologous protein-coding genes across vertebrates, arthropods, and fungi. Orthology refers to the last common ancestor of the species under consideration, and thus OrthoDB explicitly delineates orthologs at each radiation along the species phylogeny. The database of orthologs presents available protein descriptors, together with Gene Ontology and InterPro attributes, which serve to provide general descriptive annotations of the orthologous groups', 'MIR:00000221', '2019-06-11 14:16:29.860000', 'OrthoDB', false, '^\w+$', 'orthodb', 'Q9P0K8', null, null, false, null, null, null),
        (660, '2019-06-11 14:16:30.097000', false, null, 'Peroxibase provides access to peroxidase sequences from all kingdoms of life, and provides a series of bioinformatics tools and facilities suitable for analysing these sequences.', 'MIR:00000222', '2019-06-11 14:16:30.097000', 'Peroxibase', false, '^\d+$', 'peroxibase', '5282', null, null, false, null, null, null),
        (663, '2019-06-11 14:16:30.326000', false, null, 'PhylomeDB is a database of complete phylomes derived for different genomes within a specific taxonomic range. It provides alignments, phylogentic trees and tree-based orthology predictions for all encoded proteins.', 'MIR:00000223', '2019-06-11 14:16:30.326000', 'PhylomeDB', false, '^\w+$', 'phylomedb', 'Phy000CLXM_RAT', null, null, false, null, null, null),
        (666, '2019-06-11 14:16:30.547000', false, null, 'The Proteolysis MAP is a resource for proteolytic networks and pathways. PMAP is comprised of five databases, linked together in one environment. SubstrateDB contains molecular information on documented protease substrates.', 'MIR:00000224', '2019-06-11 14:16:30.547000', 'SubstrateDB', false, '^\d+$', 'pmap.substratedb', '1915', null, null, false, null, null, null),
        (669, '2019-06-11 14:16:30.793000', false, null, 'The Proteolysis MAP is a resource for proteolytic networks and pathways. PMAP is comprised of five databases, linked together in one environment. CutDB is a database of individual proteolytic events (cleavage sites).', 'MIR:00000225', '2019-06-11 14:16:30.793000', 'CutDB', false, '^\d+$', 'pmap.cutdb', '25782', null, null, false, null, null, null),
        (671, '2019-06-11 14:16:31.086000', false, null, 'ProtClustDB is a collection of related protein sequences (clusters) consisting of Reference Sequence proteins encoded by complete genomes. This database contains both curated and non-curated clusters.', 'MIR:00000226', '2019-06-11 14:16:31.086000', 'ProtClustDB', false, '^\w+$', 'protclustdb', 'O80725', null, null, false, null, null, null),
        (673, '2019-06-11 14:16:31.282000', false, null, 'The number of known protein sequences exceeds those of experimentally solved protein structures. Homology (or comparative) modeling methods make use of experimental protein structures to build models for evolutionary related proteins. The Protein Model Portal (PMP) provides a single portal to access these models, which are accessed through their UniProt identifiers.', 'MIR:00000227', '2019-06-11 14:16:31.282000', 'PMP', false, '^([A-N,R-Z][0-9][A-Z][A-Z, 0-9][A-Z, 0-9][0-9])|([O,P,Q][0-9][A-Z, 0-9][A-Z, 0-9][A-Z, 0-9][0-9])$', 'pmp', 'Q0VCA6', null, null, false, null, null, null),
        (676, '2019-06-11 14:16:31.529000', false, null, 'ProtoNet provides automatic hierarchical classification of protein sequences in the UniProt database, partitioning the protein space into clusters of similar proteins. This collection references protein information.', 'MIR:00000228', '2019-06-11 14:16:31.529000', 'ProtoNet ProteinCard', false, '^\d+$', 'protonet.proteincard', '16941567', null, null, false, null, null, null),
        (679, '2019-06-11 14:16:31.786000', false, null, 'ProtoNet provides automatic hierarchical classification of protein sequences in the UniProt database, partitioning the protein space into clusters of similar proteins. This collection references cluster information.', 'MIR:00000229', '2019-06-11 14:16:31.786000', 'ProtoNet Cluster', false, '^\d+$', 'protonet.cluster', '4349895', null, null, false, null, null, null),
        (687, '2019-06-11 14:16:32.515000', false, null, 'VectorBase is an NIAID-funded Bioinformatic Resource Center focused on invertebrate vectors of human pathogens. VectorBase annotates and curates vector genomes providing a web accessible integrated resource for the research community. Currently, VectorBase contains genome information for three mosquito species: Aedes aegypti, Anopheles gambiae and Culex quinquefasciatus, a body louse Pediculus humanus and a tick species Ixodes scapularis.', 'MIR:00000232', '2019-06-11 14:16:32.515000', 'VectorBase', false, '^\D{4}\d{6}(\-\D{2})?$', 'vectorbase', 'ISCW007415', null, null, false, null, null, null),
        (696, '2019-06-11 14:16:33.415000', false, null, 'The miRBase Sequence Database is a searchable database of published miRNA sequences and annotation. This collection refers specifically to the mature miRNA sequence.', 'MIR:00000235', '2019-06-11 14:16:33.415000', 'miRBase mature sequence', false, 'MIMAT\d{7}', 'mirbase.mature', 'MIMAT0000001', null, null, false, null, null, null),
        (698, '2019-06-11 14:16:33.634000', false, null, 'neXtProt is a resource on human proteins, and includes information such as proteins’ function, subcellular location, expression, interactions and role in diseases.', 'MIR:00000236', '2019-06-11 14:16:33.634000', 'nextProt', false, '^NX_\w+', 'nextprot', 'NX_O00165', null, null, false, null, null, null),
        (701, '2019-06-11 14:16:33.869000', false, null, 'CAS (Chemical Abstracts Service) is a division of the American Chemical Society and is the producer of comprehensive databases of chemical information.', 'MIR:00000237', '2019-06-11 14:16:33.869000', 'CAS', false, '^\d{1,7}\-\d{2}\-\d$', 'cas', '50-00-0', null, null, false, null, null, null),
        (704, '2019-06-11 14:16:34.113000', false, null, 'KEGG Genome is a collection of organisms whose genomes have been completely sequenced.', 'MIR:00000238', '2019-06-11 14:16:34.113000', 'KEGG Genome', false, '^(T0\d+|\w{3,5})$', 'kegg.genome', 'eco', null, null, false, null, null, null),
        (707, '2019-06-11 14:16:34.345000', false, null, 'The KEGG Metagenome Database collection information on environmental samples (ecosystems) of genome sequences for multiple species.', 'MIR:00000239', '2019-06-11 14:16:34.345000', 'KEGG Metagenome', false, '^T3\d+$', 'kegg.metagenome', 'T30002', null, null, false, null, null, null),
        (709, '2019-06-11 14:16:34.542000', false, null, 'NARCIS provides access to scientific information, including (open access) publications from the repositories of all the Dutch universities, KNAW, NWO and a number of research institutes, which is not referenced in other citation databases.', 'MIR:00000240', '2019-06-11 14:16:34.542000', 'NARCIS', false, '^oai\:cwi\.nl\:\d+$', 'narcis', 'oai:cwi.nl:4725', null, null, false, null, null, null),
        (715, '2019-06-11 14:16:35.052000', false, null, 'The Pathway Ontology captures information on biological networks, the relationships between netweorks and the alterations or malfunctioning of such networks within a hierarchical structure. The five main branches of the ontology are: classic metabolic pathways, regulatory, signaling, drug, and disease pathwaysfor complex human conditions.', 'MIR:00000242', '2019-06-11 14:16:35.052000', 'Pathway Ontology', true, '^PW:\d{7}$', 'pw', '0000208', null, null, false, null, null, null),
        (694, '2019-06-11 14:16:33.213000', false, null, 'The Cell Cycle Ontology is an application ontology that captures and integrates detailed knowledge on the cell cycle process.', 'MIR:00000234', '2023-01-10 14:47:52.365000', 'Cell Cycle Ontology', true, '^CCO:\w+$', 'cco', '0000003', null, null, false, null, null, null),
        (721, '2019-06-11 14:16:35.560000', false, null, 'The Sequence Read Archive (SRA) stores raw sequencing data from the next generation of sequencing platforms Data submitted to SRA. It is organized using a metadata model consisting of six objects: study, sample, experiment, run, analysis and submission. The SRA study contains high-level information including goals of the study and literature references, and may be linked to the INSDC BioProject database.', 'MIR:00000243', '2019-06-11 14:16:35.560000', 'Sequence Read Archive', false, '^[SED]R[APRSXZ]\d+$', 'insdc.sra', 'SRX000007', null, null, false, null, null, null),
        (725, '2019-06-11 14:16:35.987000', false, null, 'ScerTF is a database of position weight matrices (PWMs) for transcription factors in Saccharomyces species. It identifies a single matrix for each TF that best predicts in vivo data, providing metrics related to the performance of that matrix in accurately representing the DNA binding specificity of the annotated transcription factor.', 'MIR:00000244', '2019-06-11 14:16:35.987000', 'ScerTF', false, '^\w+$', 'scretf', 'RSC3', null, null, false, null, null, null),
        (728, '2019-06-11 14:16:36.222000', false, null, 'The PharmGKB database is a central repository for genetic, genomic, molecular and cellular phenotype data and clinical information about people who have participated in pharmacogenomics research studies. The data includes, but is not limited to, clinical and basic pharmacokinetic and pharmacogenomic research in the cardiovascular, pulmonary, cancer, pathways, metabolic and transporter domains.', 'MIR:00000245', '2019-06-11 14:16:36.222000', 'PharmGKB Gene', false, '^PA\w+$', 'pharmgkb.gene', 'PA131', null, null, false, null, null, null),
        (730, '2019-06-11 14:16:36.416000', false, null, 'miRNEST is a database of animal, plant and virus microRNAs, containing  miRNA predictions conducted on Expressed Sequence Tags of animal and  plant species.', 'MIR:00000246', '2019-06-11 14:16:36.416000', 'miRNEST', false, '^MNEST\d+$', 'mirnest', 'MNEST029358', null, null, false, null, null, null),
        (733, '2019-06-11 14:16:36.669000', false, null, 'NAPP (Nucleic Acids Phylogenetic Profiling is a clustering method based on conserved noncoding RNA (ncRNA) elements in a bacterial genomes. Short intergenic regions from a reference genome are compared with other genomes to identify RNA rich clusters.', 'MIR:00000247', '2019-06-11 14:16:36.669000', 'NAPP', false, '^\d+$', 'napp', '351', null, null, false, null, null, null),
        (736, '2019-06-11 14:16:36.900000', false, null, 'NONCODE is a database of expression and functional lncRNA (long noncoding RNA) data obtained from microarray studies. LncRNAs have been shown to play key roles in various biological processes such as imprinting control, circuitry controlling pluripotency and differentiation, immune responses and chromosome dynamics. The collection references NONCODE version 3. This was replaced in 2013 by version 4.', 'MIR:00000248', '2019-06-11 14:16:36.900000', 'NONCODE v3', false, '^\d+$', 'noncodev3', '377550', null, null, false, null, null, null),
        (739, '2019-06-11 14:16:37.163000', false, null, 'The VIRsiRNA database contains details of siRNA/shRNA which target viral genome regions. It provides efficacy information where available, as well as the siRNA sequence, viral target and subtype, as well as the target genomic region.', 'MIR:00000249', '2019-06-11 14:16:37.163000', 'VIRsiRNA', false, '^virsi\d+$', 'virsirna', 'virsi1909', null, null, false, null, null, null),
        (742, '2019-06-11 14:16:37.386000', false, null, 'Linear motifs are short, evolutionarily plastic components of regulatory proteins. Mainly focused on the eukaryotic sequences,the Eukaryotic Linear Motif resource (ELM) is a database of curated motif classes and instances.', 'MIR:00000250', '2019-06-11 14:16:37.386000', 'ELM', false, '^[A-Za-z_0-9]+$', 'elm', 'CLV_MEL_PAP_1', null, null, false, null, null, null),
        (745, '2019-06-11 14:16:37.622000', false, null, 'MimoDB is a database collecting peptides that have been selected from random peptide libraries based on their ability to bind small compounds, nucleic acids, proteins, cells, tissues and organs. It also stores other information such as the corresponding target, template, library, and structures. As of March 2016, this database was renamed Biopanning Data Bank.', 'MIR:00000251', '2019-06-11 14:16:37.622000', 'MimoDB', false, '^\d+$', 'mimodb', '1', null, null, false, null, null, null),
        (748, '2019-06-11 14:16:37.867000', false, null, 'SitEx is a database containing information on eukaryotic protein functional sites. It stores the amino acid sequence positions in the functional site, in relation to the exon structure of encoding gene This can be used to detect the exons involved in shuffling in protein evolution, or to design protein-engineering experiments.', 'MIR:00000252', '2019-06-11 14:16:37.867000', 'SitEx', false, '^\d+$', 'sitex', '1000', null, null, false, null, null, null),
        (751, '2019-06-11 14:16:38.105000', false, null, 'The bacterial tyrosine kinase database (BYKdb) that collects sequences of putative and authentic bacterial tyrosine kinases,  providing structural and functional information.', 'MIR:00000253', '2019-06-11 14:16:38.105000', 'BYKdb', false, '^[A-Z0-9]+$', 'bykdb', 'A0A009E7X8', null, null, false, null, null, null),
        (754, '2019-06-11 14:16:38.340000', false, null, 'ConoServer is a database specialized in the sequence and structures of conopeptides, which are peptides expressed by carnivorous marine cone snails.', 'MIR:00000254', '2019-06-11 14:16:38.340000', 'Conoserver', false, '^\d+$', 'conoserver', '2639', null, null, false, null, null, null),
        (756, '2019-06-11 14:16:38.521000', false, null, 'TopFIND is a database of protein termini, terminus modifications and their proteolytic processing in the species: Homo sapiens, Mus musculus, Arabidopsis thaliana, Saccharomyces cerevisiae and Escherichia coli.', 'MIR:00000255', '2019-06-11 14:16:38.521000', 'TopFind', false, '^([A-N,R-Z][0-9][A-Z][A-Z, 0-9][A-Z, 0-9][0-9])|([O,P,Q][0-9][A-Z, 0-9][A-Z, 0-9][A-Z, 0-9][0-9])$', 'topfind', 'Q9UKQ2', null, null, false, null, null, null),
        (759, '2019-06-11 14:16:38.756000', false, null, 'MIPModDb is a database of comparative protein structure models of MIP (Major Intrinsic Protein) family of proteins, identified from complete genome sequence. It provides key information of MIPs based on their sequence and structures.', 'MIR:00000256', '2019-06-11 14:16:38.756000', 'MIPModDB', false, '^\w+$', 'mipmod', 'HOSAPI0399', null, null, false, null, null, null),
        (762, '2019-06-11 14:16:38.984000', false, null, 'The Cell: An Image Library™ is a freely accessible, public repository of reviewed and annotated images, videos, and animations of cells from a variety of organisms, showcasing cell architecture, intracellular functionalities, and both normal and abnormal processes.', 'MIR:00000257', '2019-06-11 14:16:38.984000', 'Cell Image Library', false, '^\d+$', 'cellimage', '24801', null, null, false, null, null, null),
        (767, '2019-06-11 14:16:39.396000', false, null, 'CABRI (Common Access to Biotechnological Resources and Information) is an online service where users can search a number of European Biological Resource Centre catalogues. It lists the availability of a particular organism or genetic resource and defines the set of technical specifications and procedures which should be used to handle it.', 'MIR:00000261', '2019-06-11 14:16:39.396000', 'CABRI', false, '^([A-Za-z]+)?(\_)?([A-Za-z-]+)\:([A-Za-z0-9 ]+)$', 'cabri', 'dsmz_mutz-id:ACC 291', null, null, false, null, null, null),
        (772, '2019-06-11 14:16:39.763000', false, null, 'The Human Unidentified Gene-Encoded (HUGE) protein database contains  results from sequence analysis of human novel large (>4 kb) cDNAs identified in the Kazusa cDNA sequencing project.', 'MIR:00000263', '2019-06-11 14:16:39.763000', 'HUGE', false, '^KIAA\d{4}$', 'huge', 'KIAA0001', null, null, false, null, null, null),
        (775, '2019-06-11 14:16:39.982000', false, null, 'BindingDB is the first public database of protein-small molecule affinity data.', 'MIR:00000264', '2019-06-11 14:16:39.982000', 'BindingDB', false, '^\w\d+$', 'bindingdb', 'e999', null, null, false, null, null, null),
        (1775, '2019-06-11 14:18:08.921000', false, null, 'The Virtual Metabolic Human (VMH) is a resource that combines human and gut microbiota metabolism with nutrition and disease.', 'MIR:00000640', '2019-06-11 14:18:08.921000', 'VMH reaction', false, '[a-zA-Z0-9_\(\_\)\[\]]+', 'vmhreaction', 'HEX1', null, null, false, null, null, null),
        (839, '2019-06-11 14:16:45.247000', false, null, 'The dictyBase database provides data on the model organism Dictyostelium discoideum and related species. It contains the complete genome sequence, ESTs, gene models and functional annotations. This collection references gene information.', 'MIR:00000286', '2019-06-11 14:16:45.247000', 'Dictybase Gene', false, '^DDB_G\d+$', 'dictybase.gene', 'DDB_G0267522', null, null, false, null, null, null),
        (778, '2019-06-11 14:16:40.213000', false, null, 'STRING (Search Tool for Retrieval of Interacting Genes/Proteins) is a database of known and predicted protein interactions.
The interactions include direct (physical) and indirect (functional) associations; they are derived from four sources:Genomic Context, High-throughput Experiments,(Conserved) Coexpression, Previous Knowledge. STRING quantitatively integrates interaction data from these sources for a large number of organisms, and transfers information between these organisms where applicable.', 'MIR:00000265', '2019-06-11 14:16:40.213000', 'STRING', false, '^([A-N,R-Z][0-9][A-Z][A-Z, 0-9][A-Z, 0-9][0-9])|([O,P,Q][0-9][A-Z, 0-9][A-Z, 0-9][A-Z, 0-9][0-9])|([0-9][A-Za-z0-9]{3})$', 'string', 'P53350', null, null, false, null, null, null),
        (781, '2019-06-11 14:16:40.524000', false, null, 'STITCH is a resource to explore known and predicted interactions of chemicals and proteins. Chemicals are linked to other chemicals and proteins by evidence derived from experiments, databases and the literature.', 'MIR:00000266', '2019-06-11 14:16:40.524000', 'STITCH', false, '^\w{14}$', 'stitch', 'BQJCRHHNABKAKU', null, null, false, null, null, null),
        (783, '2019-06-11 14:16:40.712000', false, null, 'The ATCvet system for the classification of veterinary medicines is based on the same overall principles as the ATC system for substances used in human medicine. In ATCvet systems, preparations are divided into groups, according to their therapeutic use. First, they are divided into 15 anatomical groups (1st level), classified as QA-QV in the ATCvet system, on the basis of their main therapeutic use.', 'MIR:00000267', '2019-06-11 14:16:40.712000', 'Anatomical Therapeutic Chemical Vetinary', false, '^Q[A-Z0-9]+$', 'atcvet', 'QJ51RV02', null, null, false, null, null, null),
        (785, '2019-06-11 14:16:40.928000', false, null, 'Phenol-Explorer is an electronic database on polyphenol content in foods. Polyphenols form a wide group of natural antioxidants present in a large number of foods and beverages. They contribute to food characteristics such as taste, colour or shelf-life. They also participate in the prevention of several major chronic diseases such as cardiovascular diseases, diabetes, cancers, neurodegenerative diseases or osteoporosis.', 'MIR:00000268', '2019-06-11 14:16:40.928000', 'Phenol-Explorer', false, '^\d+$', 'phenolexplorer', '75', null, null, false, null, null, null),
        (788, '2019-06-11 14:16:41.184000', false, null, 'SNOMED CT (Systematized Nomenclature of Medicine -- Clinical Terms), is a systematically organized computer processable collection of medical terminology covering most areas of clinical information such as diseases, findings, procedures, microorganisms, pharmaceuticals, etc.', 'MIR:00000269', '2019-06-11 14:16:41.184000', 'SNOMED CT', false, '^(\w+)?\d+$', 'snomedct', '284196006', null, null, false, null, null, null),
        (791, '2019-06-11 14:16:41.417000', false, null, 'MeSH (Medical Subject Headings) is the National Library of Medicine''s controlled vocabulary thesaurus. It consists of sets of terms naming descriptors in a hierarchical structure that permits searching at various levels of specificity. This thesaurus is used by NLM for indexing articles from biomedical journals, cataloging of books, documents, etc. This collection references MeSH terms published in 2012.', 'MIR:00000270', '2019-06-11 14:16:41.417000', 'MeSH 2012', false, '^[A-Za-z0-9]+$', 'mesh.2012', '17186', null, null, false, null, null, null),
        (797, '2019-06-11 14:16:41.852000', false, null, 'The Canadian Drug Product Database (DPD) contains product specific information on drugs approved for use in Canada, and includes human pharmaceutical and biological drugs, veterinary drugs and disinfectant products. This information includes ''brand name'', ''route of administration'' and a Canadian ''Drug Identification Number'' (DIN).', 'MIR:00000272', '2019-06-11 14:16:41.852000', 'Canadian Drug Product Database', false, '^\d+$', 'cdpd', '63250', null, null, false, null, null, null),
        (805, '2019-06-11 14:16:42.514000', false, null, 'Golm Metabolome Database (GMD) provides public access to custom mass spectral libraries, metabolite profiling experiments as well as additional information and tools. This collection references metabolite information, relating the biologically active substance to metabolic pathways or signalling phenomena.', 'MIR:00000274', '2019-06-11 14:16:42.514000', 'Golm Metabolome Database', false, '^([0-9a-fA-F]){8}(-([0-9a-fA-F]){4}){3}-([0-9a-fA-F]){12}$', 'gmd', '68513255-fc44-4041-bc4b-4fd2fae7541d', null, null, false, null, null, null),
        (808, '2019-06-11 14:16:42.733000', false, null, 'HomoloGene is a system for automated detection of homologs among the annotated genes of several completely sequenced eukaryotic genomes.', 'MIR:00000275', '2019-06-11 14:16:42.733000', 'HomoloGene', false, '^\d+$', 'homologene', '1000', null, null, false, null, null, null),
        (811, '2019-06-11 14:16:42.994000', false, null, 'The University of Minnesota Biocatalysis/Biodegradation Database (UM-BBD) contains information on microbial biocatalytic reactions and biodegradation pathways for primarily xenobiotic, chemical compounds. The goal of the UM-BBD is to provide information on microbial enzyme-catalyzed reactions that are important for biotechnology. This collection refers to compound information.', 'MIR:00000276', '2019-06-11 14:16:42.994000', 'UM-BBD Compound', false, '^c\d+$', 'umbbd.compound', 'c0001', null, null, false, null, null, null),
        (814, '2019-06-11 14:16:43.224000', false, null, 'The database of Annotated regulatory Binding Sites (from orthologous promoters), ABS, is a public database of known binding sites identified in promoters of orthologous vertebrate genes that have been manually curated from bibliography.', 'MIR:00000277', '2019-06-11 14:16:43.224000', 'ABS', false, '^A\d+$', 'abs', 'A0014', null, null, false, null, null, null),
        (820, '2019-06-11 14:16:43.696000', false, null, 'ChemDB is a chemical database containing commercially available small molecules, important for use as synthetic building blocks, probes in systems biology and as leads for the discovery of drugs and other useful compounds.', 'MIR:00000279', '2019-06-11 14:16:43.696000', 'ChemDB', false, '^\d+$', 'chemdb', '3966782', null, null, false, null, null, null),
        (823, '2019-06-11 14:16:43.916000', false, null, 'Description of Plant Viruses (DPV) provides information about viruses, viroids and satellites of plants, fungi and protozoa. It provides taxonomic information, including brief descriptions of each family and genus, and classified lists of virus sequences. The database also holds detailed information for all sequences of viruses, viroids and satellites of plants, fungi and protozoa that are complete or that contain at least one complete gene.', 'MIR:00000280', '2019-06-11 14:16:43.916000', 'DPV', false, '^\d+$', 'dpv', '100', null, null, false, null, null, null),
        (826, '2019-06-11 14:16:44.139000', false, null, 'The IUPHAR Compendium details the molecular, biophysical and pharmacological properties of identified mammalian sodium, calcium and potassium channels, as well as the related cyclic nucleotide-modulated ion channels and transient receptor potential channels. It includes information on nomenclature systems, and on inter and intra-species molecular structure variation. This collection references individual receptors or subunits.', 'MIR:00000281', '2019-06-11 14:16:44.139000', 'IUPHAR receptor', false, '^\d+$', 'iuphar.receptor', '101', null, null, false, null, null, null),
        (829, '2019-06-11 14:16:44.374000', false, null, 'AceView provides a curated sequence representation of all public mRNA sequences (mRNAs from GenBank or RefSeq, and single pass cDNA sequences from dbEST and Trace). These are aligned on the genome and clustered into a minimal number of alternative transcript variants and grouped into genes. In addition, alternative features such as promoters, and expression in tissues is recorded. This collection references C. elegans genes and expression.', 'MIR:00000282', '2019-06-11 14:16:44.374000', 'Aceview Worm', false, '^[a-z0-9-]+$', 'aceview.worm', 'aap-1', null, null, false, null, null, null),
        (800, '2019-06-11 14:16:42.071000', false, null, 'MassBank is a federated database of reference spectra from different instruments, including high-resolution mass spectra of small metabolites (<3000 Da).', 'MIR:00000273', '2022-12-13 16:15:18.652000', 'MassBank', false, '^MSBNK-[0-9a-zA-Z_]+-[A-Z0-9_]+$', 'massbank', 'MSBNK-IPB_Halle-PB000166', null, null, false, null, null, null),
        (842, '2019-06-11 14:16:45.469000', false, null, 'IMGT, the international ImMunoGeneTics project, is a collection of high-quality integrated databases specialising in Immunoglobulins, T cell receptors and the Major Histocompatibility Complex (MHC) of all vertebrate species. IMGT/LIGM is a comprehensive database of fully annotated sequences of Immunoglobulins and T cell receptors from human and other vertebrates.', 'MIR:00000287', '2019-06-11 14:16:45.469000', 'IMGT LIGM', false, '^M\d+$', 'imgt.ligm', 'M94112', null, null, false, null, null, null),
        (847, '2019-06-11 14:16:45.846000', false, null, 'WOrfDB (Worm ORFeome DataBase) contains data from the cloning of complete set of predicted protein-encoding Open Reading Frames (ORFs) of Caenorhabditis elegans. This collection describes experimentally defined transcript structures of unverified genes through RACE (Rapid Amplification of cDNA Ends).', 'MIR:00000288', '2019-06-11 14:16:45.846000', 'Worfdb', false, '^\w+(\.\d+)?', 'worfdb', 'T01B6.1', null, null, false, null, null, null),
        (850, '2019-06-11 14:16:46.065000', false, null, 'NextDb is a database that provides information on the expression pattern map of the 100Mb genome of the nematode Caenorhabditis elegans. This was done through EST analysis and systematic whole mount in situ hybridization. Information available includes 5'' and 3'' ESTs, and in-situ hybridization images of 11,237 cDNA clones.', 'MIR:00000289', '2019-06-11 14:16:46.065000', 'NEXTDB', false, '^[A-Za-z0-9]+$', 'nextdb', '6b1', null, null, false, null, null, null),
        (853, '2019-06-11 14:16:46.310000', false, null, 'SoyBase is a repository for curated genetics, genomics and related data resources for soybean.', 'MIR:00000291', '2019-06-11 14:16:46.310000', 'SoyBase', false, '^\w+(\-)?\w+(\-)?\w+$', 'soybase', 'BARC-013845-01256', null, null, false, null, null, null),
        (856, '2019-06-11 14:16:46.532000', false, null, 'HAMAP is a system that identifies and semi-automatically annotates proteins that are part of well-conserved and orthologous microbial families or subfamilies. These are used to build rules which are used to propagate annotations to member bacterial, archaeal and plastid-encoded protein entries.', 'MIR:00000292', '2019-06-11 14:16:46.532000', 'HAMAP', false, '^MF_\d+$', 'hamap', 'MF_01400', null, null, false, null, null, null),
        (858, '2019-06-11 14:16:46.721000', false, null, 'The Rouge protein database contains results from sequence analysis of novel large (>4 kb) cDNAs identified in the Kazusa cDNA sequencing project.', 'MIR:00000293', '2019-06-11 14:16:46.721000', 'Rouge', false, '^m\w+$', 'rouge', 'mKIAA4200', null, null, false, null, null, null),
        (861, '2019-06-11 14:16:46.944000', false, null, 'ArrayExpress is a public repository for microarray data, which is aimed at storing MIAME-compliant data in accordance with Microarray Gene Expression Data (MGED) recommendations.This collection references the specific platforms used in the generation of experimental results.', 'MIR:00000294', '2019-06-11 14:16:46.944000', 'ArrayExpress Platform', false, '^[AEP]-\w{4}-\d+$', 'arrayexpress.platform', 'A-GEOD-50', null, null, false, null, null, null),
        (863, '2019-06-11 14:16:47.138000', false, null, 'The CGSC Database of E. coli genetic information includes genotypes and reference information for the strains in the CGSC collection, the names, synonyms, properties, and map position for genes, gene product information, and information on specific mutations and references to primary literature.', 'MIR:00000295', '2019-06-11 14:16:47.138000', 'CGSC Strain', false, '^\d+$', 'cgsc', '74', null, null, false, null, null, null),
        (866, '2019-06-11 14:16:47.375000', false, null, 'DragonDB is a genetic and genomic database for Antirrhinum majus (Snapdragon). This collection refers to DNA sequence information.', 'MIR:00000297', '2019-06-11 14:16:47.375000', 'DragonDB DNA', false, '^\d\w+$', 'dragondb.dna', '3hB06', null, null, false, null, null, null),
        (869, '2019-06-11 14:16:47.607000', false, null, 'DragonDB is a genetic and genomic database for Antirrhinum majus (Snapdragon). This collection refers to protein sequence information.', 'MIR:00000298', '2019-06-11 14:16:47.607000', 'DragonDB Protein', false, '^\w+$', 'dragondb.protein', 'AMDEFA', null, null, false, null, null, null),
        (871, '2019-06-11 14:16:47.798000', false, null, 'DragonDB is a genetic and genomic database for Antirrhinum majus (Snapdragon). This collection refers to Locus information.', 'MIR:00000299', '2019-06-11 14:16:47.798000', 'DragonDB Locus', false, '^\w+$', 'dragondb.locus', 'DEF', null, null, false, null, null, null),
        (875, '2019-06-11 14:16:48.189000', false, null, 'The International Standard Serial Number (ISSN) is a unique eight-digit number used to identify a print or electronic periodical publication, rather than individual articles or books.', 'MIR:00000301', '2019-06-11 14:16:48.189000', 'ISSN', false, '^\d{4}-\d{3}[\dX]$', 'issn', '0745-4570', null, null, false, null, null, null),
        (880, '2019-06-11 14:16:48.579000', false, null, 'The MEROPS database is an information resource for peptidases (also termed proteases, proteinases and proteolytic enzymes) and the proteins that inhibit them. These are hierarchically classified and assigned to a Family on the basis of statistically significant similarities in amino acid sequence. Families thought to be homologous are grouped together in a Clan. This collection references peptidase families.', 'MIR:00000302', '2019-06-11 14:16:48.579000', 'MEROPS Family', false, '^[SCTAGMNU]\d+$', 'merops.family', 'S1', null, null, false, null, null, null),
        (882, '2019-06-11 14:16:48.772000', false, null, 'The MGED Ontology (MO) provides terms for annotating all aspects of a microarray experiment from the design of the experiment and array layout, through to the preparation of the biological sample and the protocols used to hybridize the RNA and analyze the data.', 'MIR:00000303', '2019-06-11 14:16:48.772000', 'MGED Ontology', false, '^\w+$', 'mo', 'ArrayGroup', null, null, false, null, null, null),
        (886, '2019-06-11 14:16:49.131000', false, null, 'The Nottingham Arabidopsis Stock Centre (NASC) provides seed and information resources to the International Arabidopsis Genome Programme and the wider research community.', 'MIR:00000304', '2019-06-11 14:16:49.131000', 'NASC code', false, '^(\w+)?\d+$', 'nasc', 'N1899', null, null, false, null, null, null),
        (889, '2019-06-11 14:16:49.376000', false, null, 'A catalog of mouse genes expressed in early embryos, embryonic and adult stem cells, including 250000 ESTs, was assembled by the NIA (National Institute on Aging) assembled.This collection represents the name and sequence from individual cDNA clones.', 'MIR:00000305', '2019-06-11 14:16:49.376000', 'NIAEST', false, '^\w\d{4}\w\d{2}(\-[35])?$', 'niaest', 'J0705A10', null, null, false, null, null, null),
        (892, '2019-06-11 14:16:49.605000', false, null, 'The PAZAR database unites independently created and maintained data collections of transcription factor and regulatory sequence annotation. It provides information on the sequence and target of individual transcription factors.', 'MIR:00000306', '2019-06-11 14:16:49.605000', 'Pazar Transcription Factor', false, '^TF\w+$', 'pazar', 'TF0001053', null, null, false, null, null, null),
        (895, '2019-06-11 14:16:49.830000', false, null, 'The Plant Ontology is a structured vocabulary and database resource that links plant anatomy, morphology and growth and development to plant genomics data.', 'MIR:00000307', '2019-06-11 14:16:49.830000', 'Plant Ontology', true, '^PO:\d+$', 'po', '0009089', null, null, false, null, null, null),
        (900, '2019-06-11 14:16:50.326000', false, null, 'The RNA modification database provides a comprehensive listing of post-transcriptionally modified nucleosides from RNA. The database consists of all RNA-derived ribonucleosides of known structure, including those from established sequence positions, as well as those detected or characterized from hydrolysates of RNA.', 'MIR:00000308', '2019-06-11 14:16:50.326000', 'RNA Modification Database', false, '^\d{3}$', 'rnamods', '101', null, null, false, null, null, null),
        (903, '2019-06-11 14:16:50.556000', false, null, 'TreeBASE is a relational database designed to manage and explore information on phylogenetic relationships. It includes phylogenetic trees and data matrices, together with information about the relevant publication, taxa, morphological and sequence-based characters, and published analyses. Data in TreeBASE are exposed to the public if they are used in a publication that is in press or published in a peer-reviewed scientific journal, etc.', 'MIR:00000312', '2019-06-11 14:16:50.556000', 'TreeBASE', false, '^TB[1,2]?:[A-Z][a-z]?\d+$', 'treebase', 'TB2:S1000', null, null, false, null, null, null),
        (1235, '2019-06-11 14:17:18.559000', false, null, 'Cell Signaling Technology is a commercial organisation which provides a pathway portal to showcase their phospho-antibody products. This collection references antibody products.', 'MIR:00000430', '2019-06-11 14:17:18.559000', 'Cell Signaling Technology Antibody', false, '^\d+$', 'cst.ab', '3305', null, null, false, null, null, null),
        (906, '2019-06-11 14:16:50.779000', false, null, 'The Tetrahymena Genome Database (TGD) Wiki is a database of information about the Tetrahymena thermophila genome sequence. It provides information curated from the literature about each published gene, including a standardized gene name, a link to the genomic locus, gene product annotations utilizing the Gene Ontology, and links to published literature.', 'MIR:00000313', '2019-06-11 14:16:50.779000', 'Tetrahymena Genome Database', false, '^TTHERM\_\d+$', 'tgd', 'TTHERM_00648910', null, null, false, null, null, null),
        (908, '2019-06-11 14:16:50.975000', false, null, 'TIGRFAMs is a resource consisting of curated multiple sequence alignments, Hidden Markov Models (HMMs) for protein sequence classification, and associated information designed to support automated annotation of (mostly prokaryotic) proteins.', 'MIR:00000315', '2019-06-11 14:16:50.975000', 'TIGRFAMS', false, '^TIGR\d+$', 'tigrfam', 'TIGR00010', null, null, false, null, null, null),
        (911, '2019-06-11 14:16:51.241000', false, null, 'The Animal Transcription Factor DataBase (AnimalTFDB) classifies TFs in sequenced animal genomes, as well as collecting the transcription co-factors and chromatin remodeling factors of those genomes. This collections refers to transcription factor families, and the species in which they are found.', 'MIR:00000316', '2019-06-11 14:16:51.241000', 'Animal TFDB Family', false, '^\w+$', 'atfdb.family', 'CUT', null, null, false, null, null, null),
        (914, '2019-06-11 14:16:51.481000', false, null, 'The IUPHAR Compendium details the molecular, biophysical and pharmacological properties of identified mammalian sodium, calcium and potassium channels, as well as the related cyclic nucleotide-modulated ion channels and the recently described transient receptor potential channels. It includes information on nomenclature systems, and on inter and intra-species molecular structure variation. This collection references families of receptors or subunits.', 'MIR:00000317', '2019-06-11 14:16:51.481000', 'IUPHAR family', false, '^\d+$', 'iuphar.family', '78', null, null, false, null, null, null),
        (917, '2019-06-11 14:16:51.708000', false, null, 'The Database for Bacterial Group II Introns  provides a catalogue of full-length, non-redundant group II introns present in bacterial DNA sequences in GenBank.', 'MIR:00000318', '2019-06-11 14:16:51.708000', 'DBG2 Introns', false, '^\w{1,2}\.(\w{1,2}\.)?[A-Za-z0-9]+$', 'dbg2introns', 'Cu.me.I1', null, null, false, null, null, null),
        (920, '2019-06-11 14:16:51.940000', false, null, 'The Spectral Database for Organic Compounds (SDBS) is an integrated spectral database system for organic compounds. It provides access to 6 different types of spectra for each compound, including Mass spectrum (EI-MS), a Fourier transform infrared spectrum (FT-IR), and NMR spectra.', 'MIR:00000319', '2019-06-11 14:16:51.940000', 'Spectral Database for Organic Compounds', false, '\d+$', 'sdbs', '4544', null, null, false, null, null, null),
        (926, '2019-06-11 14:16:52.396000', false, null, 'SPIKE (Signaling Pathways Integrated Knowledge Engine) is a repository that can store, organise and allow retrieval of pathway information in a way that will be useful for the research community. The database currently focuses primarily on pathways describing DNA damage response, cell cycle, programmed cell death and hearing related pathways. Pathways are regularly updated, and additional pathways are gradually added. The complete database and the individual maps are freely exportable in several formats. This collection references pathway maps.', 'MIR:00000321', '2019-06-11 14:16:52.396000', 'SPIKE Map', false, '^spike\d{5}$', 'spike.map', 'spike00001', null, null, false, null, null, null),
        (929, '2019-06-11 14:16:52.640000', false, null, 'The METLIN (Metabolite and Tandem Mass Spectrometry) Database is a repository of metabolite information as well as tandem mass spectrometry data, providing public access to its comprehensive MS and MS/MS metabolite data. An annotated list of known metabolites and their mass, chemical formula, and structure are available, with each metabolite linked to external resources for further reference and inquiry.', 'MIR:00000322', '2019-06-11 14:16:52.640000', 'METLIN', false, '^\d{4}$', 'metlin', '1455', null, null, false, null, null, null),
        (932, '2019-06-11 14:16:52.858000', false, null, 'The GeneCards human gene database stores gene related transcriptomic, genetic, proteomic, functional and disease information. It uses standard nomenclature and approved gene symbols. GeneCards presents a complete summary for each human gene.', 'MIR:00000323', '2019-06-11 14:16:52.858000', 'GeneCards', false, '^[A-Za-z-0-9_]+(\@)?$', 'genecards', 'ABL1', null, null, false, null, null, null),
        (938, '2019-06-11 14:16:53.335000', false, null, 'The University of Minnesota Biocatalysis/Biodegradation Database (UM-BBD) contains information on microbial biocatalytic reactions and biodegradation pathways for primarily xenobiotic, chemical compounds. The goal of the UM-BBD is to provide information on microbial enzyme-catalyzed reactions that are important for biotechnology. This collection refers to reaction information.', 'MIR:00000325', '2019-06-11 14:16:53.335000', 'UM-BBD Reaction', false, '^r\d+$', 'umbbd.reaction', 'r0001', null, null, false, null, null, null),
        (940, '2019-06-11 14:16:53.546000', false, null, 'The University of Minnesota Biocatalysis/Biodegradation Database (UM-BBD) contains information on microbial biocatalytic reactions and biodegradation pathways for primarily xenobiotic, chemical compounds. The goal of the UM-BBD is to provide information on microbial enzyme-catalyzed reactions that are important for biotechnology. This collection refers to enzyme information.', 'MIR:00000326', '2019-06-11 14:16:53.546000', 'UM-BBD Enzyme', false, '^e\d+$', 'umbbd.enzyme', 'e0333', null, null, false, null, null, null),
        (942, '2019-06-11 14:16:53.741000', false, null, 'The University of Minnesota Biocatalysis/Biodegradation Database (UM-BBD) contains information on microbial biocatalytic reactions and biodegradation pathways for primarily xenobiotic, chemical compounds. The goal of the UM-BBD is to provide information on microbial enzyme-catalyzed reactions that are important for biotechnology. This collection refers to pathway information.', 'MIR:00000327', '2019-06-11 14:16:53.741000', 'UM-BBD Pathway', false, '^\w+$', 'umbbd.pathway', 'ala', null, null, false, null, null, null),
        (944, '2019-06-11 14:16:53.927000', false, null, 'The University of Minnesota Biocatalysis/Biodegradation Database (UM-BBD) contains information on microbial biocatalytic reactions and biodegradation pathways for primarily xenobiotic, chemical compounds. The UM-BBD Pathway Prediction System (PPS) predicts microbial catabolic reactions using substructure searching, a rule-base, and atom-to-atom mapping. The PPS recognizes organic functional groups found in a compound and predicts transformations based on biotransformation rules. These rules are based on reactions found in the UM-BBD database. This collection references those rules.', 'MIR:00000328', '2019-06-11 14:16:53.927000', 'UM-BBD Biotransformation Rule', false, '^bt\d+$', 'umbbd.rule', 'bt0001', null, null, false, null, null, null),
        (946, '2019-06-11 14:16:54.147000', false, null, 'mirEX is a comprehensive platform for comparative analysis of primary microRNA expression data, storing RT–qPCR-based gene expression profile over seven development stages of Arabidopsis. It also provides RNA structural models, publicly available deep sequencing results and experimental procedure details. This collection provides profile information for a single microRNA over all development stages.', 'MIR:00000329', '2019-06-11 14:16:54.147000', 'mirEX', false, '^\d+(\w+)?$', 'mirex', '165a', null, null, false, null, null, null),
        (948, '2019-06-11 14:16:54.345000', false, null, 'The dictyBase database provides data on the model organism Dictyostelium discoideum and related species. It contains the complete genome sequence, ESTs, gene models and functional annotations. This collection references expressed sequence tag (EST) information.', 'MIR:00000330', '2019-06-11 14:16:54.345000', 'Dictybase EST', false, '^DDB\d+$', 'dictybase.est', 'DDB0016567', null, null, false, null, null, null),
        (1768, '2019-06-11 14:18:08.223000', false, null, 'MobiDB is a database of protein disorder and mobility annotations.', 'MIR:00000637', '2019-06-11 14:18:08.223000', 'MobiDB', false, '^[OPQ][0-9][A-Z0-9]{3}[0-9]|[A-NR-Z][0-9]([A-Z][A-Z0-9]{2}[0-9]){1,2}$', 'mobidb', 'P10636', null, null, false, null, null, null),
        (1264, '2019-06-11 14:17:20.995000', false, null, 'The CORUM database provides a resource of manually annotated protein complexes from mammalian organisms. Annotation includes protein complex function, localization, subunit composition, literature references and more. All information is obtained from individual experiments published in scientific articles, data from high-throughput experiments is excluded.', 'MIR:00000440', '2019-06-11 14:17:20.995000', 'CORUM', false, '^\d+$', 'corum', '100', null, null, false, null, null, null),
        (950, '2019-06-11 14:16:54.535000', false, null, 'IMGT, the international ImMunoGeneTics project, is a collection of high-quality integrated databases specialising in Immunoglobulins, T cell receptors and the Major Histocompatibility Complex (MHC) of all vertebrate species. IMGT/HLA is a database for sequences of the human MHC, referred to as HLA. It includes all the official sequences for the WHO Nomenclature Committee For Factors of the HLA System. This collection references allele information through the WHO nomenclature.', 'MIR:00000331', '2019-06-11 14:16:54.535000', 'IMGT HLA', false, '^[A-Z0-9*:]+$', 'imgt.hla', 'A*01:01:01:01', null, null, false, null, null, null),
        (952, '2019-06-11 14:16:54.741000', false, null, 'The Bloomington Drosophila Stock Center collects, maintains and distributes Drosophila melanogaster strains for research.', 'MIR:00000332', '2019-06-11 14:16:54.741000', 'Bloomington Drosophila Stock Center', false, '^\d+$', 'bdsc', '33607', null, null, false, null, null, null),
        (955, '2019-06-11 14:16:54.970000', false, null, 'The Orientations of Proteins in Membranes (OPM) database provides spatial positions of membrane-bound peptides and proteins of known three-dimensional structure in the lipid bilayer, together with their structural classification, topology and intracellular localization.', 'MIR:00000333', '2019-06-11 14:16:54.970000', 'OPM', false, '^[0-9][A-Za-z0-9]{3}$', 'opm', '1h68', null, null, false, null, null, null),
        (958, '2019-06-11 14:16:55.214000', false, null, 'Allergome is a repository of data related to all IgE-binding compounds. Its purpose is to collect a list of allergenic sources and molecules by using the widest selection criteria and sources.', 'MIR:00000334', '2019-06-11 14:16:55.214000', 'Allergome', false, '^\d+$', 'allergome', '1948', null, null, false, null, null, null),
        (961, '2019-06-11 14:16:55.438000', false, null, 'PomBase is a model organism database established to provide access to molecular data and biological information for the fission yeast Schizosaccharomyces pombe. It encompasses annotation of genomic sequence and features, comprehensive manual literature curation and genome-wide data sets.', 'MIR:00000335', '2019-06-11 14:16:55.438000', 'PomBase', false, '^S\w+(\.)?\w+(\.)?$', 'pombase', 'SPCC13B11.01', null, null, false, null, null, null),
        (964, '2019-06-11 14:16:55.662000', false, null, 'The Human Protein Atlas (HPA) is a publicly available database with high-resolution images showing the spatial distribution of proteins in different normal and cancer human cell lines. Primary access to this collection is through Ensembl Gene identifiers.', 'MIR:00000336', '2019-06-11 14:16:55.662000', 'HPA', false, '^ENSG\d{11}$', 'hpa', 'ENSG00000026508', null, null, false, null, null, null),
        (967, '2019-06-11 14:16:55.877000', false, null, 'JAX Mice is a catalogue of mouse strains supplied by the Jackson Laboratory.', 'MIR:00000337', '2019-06-11 14:16:55.877000', 'JAX Mice', false, '^\d+$', 'jaxmice', '005012', null, null, false, null, null, null),
        (970, '2019-06-11 14:16:56.122000', false, null, 'NameBank is a "biological name server" focused on storing names and objectively-derived nomenclatural attributes. NameBank is a repository for all recorded names including scientific names, vernacular (or common names), misspelled names, as well as ad-hoc nomenclatural labels that may have limited context.', 'MIR:00000338', '2019-06-11 14:16:56.122000', 'uBio NameBank', false, '^\d+$', 'ubio.namebank', '2555646', null, null, false, null, null, null),
        (973, '2019-06-11 14:16:56.366000', false, null, 'The Yeast Transcription Factor Specificity Compendium (YeTFasCO) is a database of transcription factor specificities for the yeast Saccharomyces cerevisiae in Position Frequency Matrix (PFM) or Position Weight Matrix (PWM) formats.', 'MIR:00000339', '2019-06-11 14:16:56.366000', 'YeTFasCo', false, '^\w+\_\d+(\.\d+)?$', 'yetfasco', 'YOR172W_571.0', null, null, false, null, null, null),
        (976, '2019-06-11 14:16:56.599000', false, null, 'TarBase stores microRNA (miRNA) information for miRNA–gene interactions, as well as miRNA- and gene-related facts to information specific to the interaction and the experimental validation methodologies used.', 'MIR:00000340', '2019-06-11 14:16:56.599000', 'TarBase', false, '^[a-z]{3}\-(mir|let|lin)\-\w+(\-\w+\-\w+)?', 'tarbase', 'hsa-let-7a-2-3p', null, null, false, null, null, null),
        (979, '2019-06-11 14:16:56.827000', false, null, 'CharProt is a database of biochemically characterized proteins designed to support automated annotation pipelines. Entries are annotated with gene name, symbol and various controlled vocabulary terms, including Gene Ontology terms, Enzyme Commission number and TransportDB accession.', 'MIR:00000341', '2019-06-11 14:16:56.827000', 'CharProt', false, '^CH_\d+$', 'charprot', 'CH_001923', null, null, false, null, null, null),
        (982, '2019-06-11 14:16:57.058000', false, null, 'OMA (Orthologous MAtrix) is a database that identifies orthologs among publicly available, complete genome sequences. It identifies orthologous relationships which can be accessed either group-wise, where all group members are orthologous to all other group members, or on a sequence-centric basis, where for a given protein all its orthologs in all other species are displayed. This collection references individual protein records.', 'MIR:00000342', '2019-06-11 14:16:57.058000', 'OMA Protein', false, '^[A-Z0-9]{5}\d+$', 'oma.protein', 'HUMAN16963', null, null, false, null, null, null),
        (985, '2019-06-11 14:16:57.285000', false, null, 'OMA (Orthologous MAtrix) is a database that identifies orthologs among publicly available, complete genome sequences. It identifies orthologous relationships which can be accessed either group-wise, where all group members are orthologous to all other group members, or on a sequence-centric basis, where for a given protein all its orthologs in all other species are displayed. This collection references groupings of orthologs.', 'MIR:00000343', '2019-06-11 14:16:57.285000', 'OMA Group', false, '^[A-Z]+$', 'oma.grp', 'LCSCCPN', null, null, false, null, null, null),
        (987, '2019-06-11 14:16:57.477000', false, null, 'The Protein database is a collection of sequences from several sources, including translations from annotated coding regions in GenBank, RefSeq and TPA, as well as records from SwissProt, PIR, PRF, and PDB.', 'MIR:00000344', '2019-06-11 14:16:57.477000', 'NCBI Protein', false, '^(\w+\d+(\.\d+)?)|(NP_\d+)$', 'ncbiprotein', 'CAA71118.1', null, null, false, null, null, null),
        (991, '2019-06-11 14:16:57.856000', false, null, 'A UniGene entry is a set of transcript sequences that appear to come from the same transcription locus (gene or expressed pseudogene), together with information on protein similarities, gene expression, cDNA clone reagents, and genomic location.', 'MIR:00000346', '2019-06-11 14:16:57.856000', 'UniGene', false, '^\d+$', 'unigene', '4900', null, null, false, null, null, null),
        (994, '2019-06-11 14:16:58.089000', false, null, 'BitterDB is a database of compounds reported to taste bitter to humans. The compounds can be searched by name, chemical structure, similarity to other bitter compounds, association with a particular human bitter taste receptor, and so on. The database also contains information on mutations in bitter taste receptors that were shown to influence receptor activation by bitter compounds. The aim of BitterDB is to facilitate studying the chemical features associated with bitterness. This collection references receptors.', 'MIR:00000347', '2019-06-11 14:16:58.089000', 'BitterDB Receptor', false, '^\d+$', 'bitterdb.rec', '1', null, null, false, null, null, null),
        (997, '2019-06-11 14:16:58.347000', false, null, 'BitterDB is a database of compounds reported to taste bitter to humans. The compounds can be searched by name, chemical structure, similarity to other bitter compounds, association with a particular human bitter taste receptor, and so on. The database also contains information on mutations in bitter taste receptors that were shown to influence receptor activation by bitter compounds. The aim of BitterDB is to facilitate studying the chemical features associated with bitterness. This collection references compounds.', 'MIR:00000348', '2019-06-11 14:16:58.347000', 'BitterDB Compound', false, '^\d+$', 'bitterdb.cpd', '46', null, null, false, null, null, null),
        (999, '2019-06-11 14:16:58.543000', false, null, 'BioProject provides an organizational framework to access metadata about research projects and the data from the projects that are deposited into different databases. It provides information about a project’s scope, material, objectives, funding source and general relevance categories.', 'MIR:00000349', '2019-06-11 14:16:58.543000', 'BioProject', false, '^PRJ[DEN][A-Z]\d+$', 'bioproject', 'PRJDB3', null, null, false, null, null, null),
        (1004, '2019-06-11 14:16:59.017000', false, null, 'The BioSample Database stores information about biological samples used in molecular experiments, such as sequencing, gene expression or proteomics. It includes reference samples, such as cell lines, which are repeatedly used in experiments. Accession numbers for the reference samples will be exchanged with a similar database at NCBI, and DDBJ (Japan). Record access may be affected due to different release cycles and inter-institutional synchronisation.', 'MIR:00000350', '2019-06-11 14:16:59.017000', 'BioSample', false, '^SAM[NED](\w)?\d+$', 'biosample', 'SAMEA2397676', null, null, false, null, null, null),
        (1009, '2019-06-11 14:16:59.494000', false, null, 'PiroplasmaDB is one of the databases that can be accessed through the EuPathDB (http://EuPathDB.org; formerly ApiDB) portal, covering eukaryotic pathogens of the genera Cryptosporidium, Giardia, Leishmania, Neospora, Plasmodium, Toxoplasma, Trichomonas and Trypanosoma. While each of these groups is supported by a taxon-specific database built upon the same infrastructure, the EuPathDB portal offers an entry point to all these resources, and the opportunity to leverage orthology for searches across genera.', 'MIR:00000351', '2019-06-11 14:16:59.494000', 'PiroplasmaDB', false, '^TA\d+$', 'piroplasma', 'TA14985', null, null, false, null, null, null),
        (1012, '2019-06-11 14:16:59.723000', false, null, 'UNITE is a fungal rDNA internal transcribed spacer (ITS) sequence database. It focuses on high-quality ITS sequences generated from fruiting bodies collected and identified by experts and deposited in public herbaria. Entries may be supplemented with metadata on describing locality, habitat, soil, climate, and interacting taxa.', 'MIR:00000352', '2019-06-11 14:16:59.723000', 'Unite', false, '^UDB\d{6}$', 'unite', 'UDB000691', null, null, false, null, null, null),
        (1015, '2019-06-11 14:16:59.945000', false, null, 'NCI Metathesaurus (NCIm) is a wide-ranging biomedical terminology database that covers most terminologies used by NCI for clinical care, translational and basic research, and public information and administrative activities. It integrates terms and definitions from different terminologies, including NCI Thesaurus, however the representation is not identical.', 'MIR:00000353', '2019-06-11 14:16:59.945000', 'NCIm', false, '^C\d+$', 'ncim', 'C0026339', null, null, false, null, null, null),
        (1017, '2019-06-11 14:17:00.162000', false, null, 'ProGlycProt (Prokaryotic Glycoprotein) is a repository of bacterial and archaeal glycoproteins with at least one experimentally validated glycosite (glycosylated residue). Each entry in the database is fully cross-referenced and enriched with available published information about source organism, coding gene, protein, glycosites, glycosylation type, attached glycan, associated oligosaccharyl/glycosyl transferases (OSTs/GTs), supporting references, and applicable additional information.', 'MIR:00000354', '2019-06-11 14:17:00.162000', 'ProGlycProt', false, '^[A-Z]C\d{1,3}$', 'proglyc', 'AC119', null, null, false, null, null, null),
        (1020, '2019-06-11 14:17:00.403000', false, null, 'Polbase is a database of DNA polymerases providing information on polymerase protein sequence, target DNA sequence, enzyme structure, sequence mutations and details on polymerase activity.', 'MIR:00000355', '2019-06-11 14:17:00.403000', 'PolBase', false, '^[A-Za-z-0-9]+$', 'polbase', '19-T4', null, null, false, null, null, null),
        (1022, '2019-06-11 14:17:00.593000', false, null, 'NucleaRDB is an information system that stores heterogenous data on Nuclear Hormone Receptors (NHRs). It contains data on sequences, ligand binding constants and mutations for NHRs.', 'MIR:00000356', '2019-06-11 14:17:00.593000', 'NucleaRDB', false, '^\w+\_\w+$', 'nuclearbd', 'prgr_human', null, null, false, null, null, null),
        (1025, '2019-06-11 14:17:00.815000', false, null, 'SUPERFAMILY provides structural, functional and evolutionary information for proteins from all completely sequenced genomes, and large sequence collections such as UniProt.', 'MIR:00000357', '2019-06-11 14:17:00.815000', 'SUPFAM', false, '^\w+$', 'supfam', 'SSF57615', null, null, false, null, null, null),
        (1028, '2019-06-11 14:17:01.041000', false, null, 'The objective of this project is to provide high quality annotation for the rice genome Oryza sativa spp japonica cv Nipponbare. All genes are annotated with functional annotation including expression data, gene ontologies, and tagged lines.', 'MIR:00000358', '2019-06-11 14:17:01.041000', 'Rice Genome Annotation Project', false, '^LOC\_Os\d{1,2}g\d{5}$', 'ricegap', 'LOC_Os02g13300', null, null, false, null, null, null),
        (1030, '2019-06-11 14:17:01.276000', false, null, 'Protein Interaction Network Analysis (PINA) platform is an integrated platform for protein interaction network construction, filtering, analysis, visualization and management. It integrates protein-protein interaction data from six public curated databases and builds a complete, non-redundant protein interaction dataset for six model organisms.', 'MIR:00000359', '2019-06-11 14:17:01.276000', 'PINA', false, '^([A-N,R-Z][0-9][A-Z][A-Z, 0-9][A-Z, 0-9][0-9])|([O,P,Q][0-9][A-Z, 0-9][A-Z, 0-9][A-Z, 0-9][0-9])$', 'pina', 'Q13485', null, null, false, null, null, null),
        (1033, '2019-06-11 14:17:01.500000', false, null, 'The UniProt Tissue List is a controlled vocabulary of terms used to annotate biological tissues. It also contains cross-references to other ontologies where tissue types are specified.', 'MIR:00000360', '2019-06-11 14:17:01.500000', 'Tissue List', false, '^TS-\d{4}$', 'tissuelist', 'TS-0285', null, null, false, null, null, null),
        (1036, '2019-06-11 14:17:01.735000', false, null, 'BacMap is an electronic, interactive atlas of fully sequenced bacterial genomes. It contains labeled, zoomable and searchable chromosome maps for sequenced prokaryotic (archaebacterial and eubacterial) species. Each map can be zoomed to the level of individual genes and each gene is hyperlinked to a richly annotated gene card. All bacterial genome maps are supplemented with separate prophage genome maps as well as separate tRNA and rRNA maps. Each bacterial chromosome entry in BacMap contains graphs and tables on a variety of gene and protein statistics. Likewise, every bacterial species entry contains a bacterial ''biography'' card, with taxonomic details, phenotypic details, textual descriptions and images. This collection references ''biography'' information.', 'MIR:00000361', '2019-06-11 14:17:01.735000', 'BacMap Biography', false, '^\d+$', 'bacmap.biog', '1050', null, null, false, null, null, null),
        (1039, '2019-06-11 14:17:01.955000', false, null, 'The HGNC (HUGO Gene Nomenclature Committee) provides an approved gene name and symbol (short-form abbreviation) for each known human gene. All approved symbols are stored in the HGNC database, and each symbol is unique. This collection refers to records using the HGNC symbol.', 'MIR:00000362', '2019-06-11 14:17:01.955000', 'HGNC Symbol', false, '^[A-Za-z-0-9_]+(\@)?$', 'hgnc.symbol', 'DAPK1', null, null, false, null, null, null),
        (1041, '2019-06-11 14:17:02.153000', false, null, 'The PANTHER (Protein ANalysis THrough Evolutionary Relationships) Classification System is a resource that classifies genes by their functions, using published scientific experimental evidence and evolutionary relationships to predict function even in the absence of direct experimental evidence. The PANTHER Pathway collection references pathway information, primarily for signaling pathways, each with subfamilies and protein sequences mapped to individual pathway components.', 'MIR:00000363', '2019-06-11 14:17:02.153000', 'PANTHER Pathway', false, '^P\d{5}$', 'panther.pathway', 'P00024', null, null, false, null, null, null),
        (1043, '2019-06-11 14:17:02.358000', false, null, 'The web-based FAIRSharing catalogues aim to centralize bioscience data policies, reporting standards and links to other related portals. This collection references bioinformatics data exchange standards, which includes ''Reporting Guidelines'', Format Specifications and Terminologies.', 'MIR:00000364', '2019-06-11 14:17:02.358000', 'FAIRsharing', false, '^bsg-[dscp]?\d{6}$', 'fairsharing', 'bsg-000052', null, null, false, null, null, null),
        (1046, '2019-06-11 14:17:02.591000', false, null, 'FungiDB is a genomic resource for fungal genomes. It contains contains genome sequence and annotation from several fungal classes, including the Ascomycota classes, Eurotiomycetes, Sordariomycetes, Saccharomycetes and the Basidiomycota orders, Pucciniomycetes and Tremellomycetes, and the basal ''Zygomycete'' lineage Mucormycotina.', 'MIR:00000365', '2019-06-11 14:17:02.591000', 'FungiDB', false, '^[A-Za-z_0-9]+$', 'fungidb', 'CNBG_0001', null, null, false, null, null, null),
        (1771, '2019-06-11 14:18:08.473000', false, null, 'Neurovault is an online repository for statistical maps, parcellations and atlases of the brain. This collection references individual images.', 'MIR:00000638', '2019-06-11 14:18:08.473000', 'NeuroVault Image', false, '^[1-9][0-9]*$', 'neurovault.image', '58788', null, null, false, null, null, null),
        (1049, '2019-06-11 14:17:02.814000', false, null, 'DARC (Database of Aligned Ribosomal Complexes) stores available cryo-EM (electron microscopy) data and atomic coordinates of ribosomal particles from the PDB, which are aligned within a common coordinate system. The aligned coordinate system simplifies direct visualization of conformational changes in the ribosome, such as subunit rotation and head-swiveling, as well as direct comparison of bound ligands, such as antibiotics or translation factors.', 'MIR:00000366', '2019-06-11 14:17:02.814000', 'DARC', false, '^\d+$', 'darc', '1250', null, null, false, null, null, null),
        (1052, '2019-06-11 14:17:03.033000', false, null, 'The DRSC (Drosophila RNAi Screening Cente) tracks both production of reagents for RNA interference (RNAi) screening in Drosophila cells and RNAi screen results. It maintains a list of Drosophila gene names, identifiers, symbols and synonyms and provides  information for cell-based or in vivo RNAi reagents, other types of reagents, screen results, etc. corresponding for a given gene.', 'MIR:00000367', '2019-06-11 14:17:03.033000', 'DRSC', false, '^DRSC\d+$', 'drsc', 'DRSC05221', null, null, false, null, null, null),
        (1055, '2019-06-11 14:17:03.255000', false, null, 'OriDB is a database of collated genome-wide mapping studies of confirmed and predicted replication origin sites in Saccharomyces cerevisiae and the fission yeast Schizosaccharomyces pombe. This collection references Schizosaccharomyces pombe.', 'MIR:00000368', '2019-06-11 14:17:03.255000', 'OriDB Schizosaccharomyces', false, '^\d+$', 'oridb.schizo', '1', null, null, false, null, null, null),
        (1058, '2019-06-11 14:17:03.475000', false, null, 'OriDB is a database of collated genome-wide mapping studies of confirmed and predicted replication origin sites in Saccharomyces cerevisiae and the fission yeast Schizosaccharomyces pombe. This collection references Saccharomyces cerevisiae.', 'MIR:00000369', '2019-06-11 14:17:03.475000', 'OriDB Saccharomyces', false, '^\d+$', 'oridb.sacch', '1', null, null, false, null, null, null),
        (1060, '2019-06-11 14:17:03.650000', false, null, 'The PSCDB (Protein Structural Change DataBase) collects information on the relationship between protein structural change upon ligand binding. Each entry page provides detailed information about this structural motion.', 'MIR:00000370', '2019-06-11 14:17:03.650000', 'PSCDB', false, '^\d+$', 'pscdb', '051', null, null, false, null, null, null),
        (1063, '2019-06-11 14:17:03.870000', false, null, 'The SCOP (Structural Classification of Protein) database is a comprehensive ordering of all proteins of known structure according to their evolutionary, functional and structural relationships. The basic classification unit is the protein domain. Domains are hierarchically classified into species, proteins, families, superfamilies, folds, and classes.', 'MIR:00000371', '2019-06-11 14:17:03.870000', 'SCOP', false, '^\d+$', 'scop', '47419', null, null, false, null, null, null),
        (1068, '2019-06-11 14:17:04.223000', false, null, 'The European Nucleotide Archive (ENA) captures and presents information relating to experimental workflows that are based around nucleotide sequencing. ENA is made up of a number of distinct databases that includes EMBL-Bank, the Sequence Read Archive (SRA) and the Trace Archive each with their own data formats and standards. This collection references Embl-Bank identifiers.', 'MIR:00000372', '2019-06-11 14:17:04.223000', 'ENA', false, '^[A-Z]+[0-9]+(\.\d+)?$', 'ena.embl', 'BN000065', null, null, false, null, null, null),
        (1071, '2019-06-11 14:17:04.514000', false, null, 'DOMMINO is a database of macromolecular interactions that includes the interactions between protein domains, interdomain linkers, N- and C-terminal regions and protein peptides.', 'MIR:00000373', '2019-06-11 14:17:04.514000', 'DOMMINO', false, '^[0-9][A-Za-z0-9]{3}$', 'dommino', '2GC4', null, null, false, null, null, null),
        (1076, '2019-06-11 14:17:04.925000', false, null, 'The Consensus CDS (CCDS) project is a collaborative effort to identify a core set of human and mouse protein coding regions that are consistently annotated and of high quality. The CCDS set is calculated following coordinated whole genome annotation updates carried out by the NCBI, WTSI, and Ensembl. The long term goal is to support convergence towards a standard set of gene annotations.', 'MIR:00000375', '2019-06-11 14:17:04.925000', 'Consensus CDS', false, '^CCDS\d+\.\d+$', 'ccds', 'CCDS13573.1', null, null, false, null, null, null),
        (1086, '2019-06-11 14:17:05.741000', false, null, 'The Human Protein Reference Database (HPRD) represents a centralized platform to visually depict and integrate information pertaining to domain architecture, post-translational modifications, interaction networks and disease association for each protein in the human proteome.', 'MIR:00000377', '2019-06-11 14:17:05.741000', 'HPRD', false, '^\d+$', 'hprd', '00001', null, null, false, null, null, null),
        (1089, '2019-06-11 14:17:05.964000', false, null, 'The Gene Expression Atlas (GXA) is a semantically enriched database of meta-analysis based summary statistics over a curated subset of ArrayExpress Archive, servicing queries for condition-specific gene expression patterns as well as broader exploratory searches for biologically interesting genes/samples. This collection references genes.', 'MIR:00000378', '2019-06-11 14:17:05.964000', 'GXA Gene', false, '^\w+$', 'gxa.gene', 'AT4G01080', null, null, false, null, null, null),
        (1091, '2019-06-11 14:17:06.163000', false, null, 'The Gene Expression Atlas (GXA) is a semantically enriched database of meta-analysis based summary statistics over a curated subset of ArrayExpress Archive, servicing queries for condition-specific gene expression patterns as well as broader exploratory searches for biologically interesting genes/samples. This collection references experiments.', 'MIR:00000379', '2019-06-11 14:17:06.163000', 'GXA Expt', false, '^[AEP]-\w{4}-\d+$', 'gxa.expt', 'E-MTAB-2037', null, null, false, null, null, null),
        (1094, '2019-06-11 14:17:06.457000', false, null, 'MetaboLights is a database for Metabolomics experiments and derived information. The database is cross-species, cross-technique and covers metabolite structures and their reference spectra as well as their biological roles, locations and concentrations, and experimental data from metabolic experiments. This collection references individual metabolomics studies.', 'MIR:00000380', '2019-06-11 14:17:06.457000', 'MetaboLights', false, '^MTBLS\d+$', 'metabolights', 'MTBLS1', null, null, false, null, null, null),
        (1100, '2019-06-11 14:17:06.994000', false, null, 'ORCID (Open Researcher and Contributor ID) is an open, non-profit, community-based effort to create and maintain a registry of unique identifiers for individual researchers. ORCID records hold non-sensitive information such as name, email, organization name, and research activities.', 'MIR:00000382', '2019-06-11 14:17:06.994000', 'ORCID', false, '^\d{4}-\d{4}-\d{4}-\d{3}(\d|X)$', 'orcid', '0000-0002-5355-2576', null, null, false, null, null, null),
        (1103, '2019-06-11 14:17:07.236000', false, null, 'The IUPAC International Chemical Identifier (InChI) is a non-proprietary identifier for chemical substances that can be used in printed and electronic data sources. It is derived solely from a structural representation of that substance, such that a single compound always yields the same identifier.', 'MIR:00000383', '2019-06-11 14:17:07.236000', 'InChI', false, '^InChI\=1S?\/[A-Za-z0-9\.]+(\+[0-9]+)?(\/[cnpqbtmsih][A-Za-z0-9\-\+\(\)\,\/\?\;\.]+)*$', 'inchi', 'InChI=1S/C2H6O/c1-2-3/h3H,2H2,1H3', null, null, false, null, null, null),
        (1110, '2019-06-11 14:17:07.845000', false, null, 'Wikipedia is a multilingual, web-based, free-content encyclopedia project based on an openly editable model. It is written collaboratively by largely anonymous Internet volunteers who write without pay.', 'MIR:00000384', '2019-06-11 14:17:07.845000', 'Wikipedia (En)', false, '^[A-Za-z-0-9_]+$', 'wikipedia.en', 'SM_UB-81', null, null, false, null, null, null),
        (1115, '2019-06-11 14:17:08.222000', false, null, 'PhosphoPOINT is a database of the human kinase and phospho-protein interactome. It describes the interactions among kinases, their potential substrates and their interacting (phospho)-proteins. It also incorporates gene expression and uses gene ontology (GO) terms to annotate interactions. This collection references kinase information.', 'MIR:00000385', '2019-06-11 14:17:08.222000', 'PhosphoPoint Kinase', false, '^\w+$', 'phosphopoint.kinase', 'AURKA', null, null, false, null, null, null),
        (1118, '2019-06-11 14:17:08.458000', false, null, 'PhosphoPOINT is a database of the human kinase and phospho-protein interactome. It describes the interactions among kinases, their potential substrates and their interacting (phospho)-proteins. It also incorporates gene expression and uses gene ontology (GO) terms to annotate interactions. This collection references phosphoprotein information.', 'MIR:00000386', '2019-06-11 14:17:08.458000', 'PhosphoPoint Phosphoprotein', false, '^\w+$', 'phosphopoint.protein', 'AURKA', null, null, false, null, null, null),
        (1120, '2019-06-11 14:17:08.649000', false, null, 'The IUPAC International Chemical Identifier (InChI, see MIR:00000383) is an identifier for chemical substances, and is derived solely from a structural representation of that substance. Since these can be quite unwieldly, particularly for web use, the InChIKey was developed. These are of a fixed length (25 character) and were created as a condensed, more web friendly, digital representation of the InChI.', 'MIR:00000387', '2019-06-11 14:17:08.649000', 'InChIKey', false, '^[A-Z]{14}\-[A-Z]{10}(\-[A-Z])?', 'inchikey', 'RYYVLZVUVIJVGH-UHFFFAOYSA-N', null, null, false, null, null, null),
        (1123, '2019-06-11 14:17:08.943000', false, null, 'The UniProt Knowledgebase (UniProtKB) is a comprehensive resource for protein sequence and functional information with extensive cross-references to more than 120 external databases. This collection is a subset of UniProtKB, and provides a means to reference isoform information.', 'MIR:00000388', '2019-06-11 14:17:08.943000', 'UniProt Isoform', false, '^([A-N,R-Z][0-9][A-Z][A-Z, 0-9][A-Z, 0-9][0-9])|([O,P,Q][0-9][A-Z, 0-9][A-Z, 0-9][A-Z, 0-9][0-9])(\-\d+)$', 'uniprot.isoform', 'Q5BJF6-3', null, null, false, null, null, null),
        (1127, '2019-06-11 14:17:09.349000', false, null, 'KEGG ENVIRON (renamed from EDRUG) is a collection of crude drugs, essential oils, and other health-promoting substances, which are mostly natural products of plants. It will contain environmental substances and other health-damagine substances as well. Each KEGG ENVIRON entry is identified by the E number and is associated with the chemical component, efficacy information, and source species information whenever applicable.', 'MIR:00000389', '2019-06-11 14:17:09.349000', 'KEGG Environ', false, '^(ev\:)?E\d+$', 'kegg.environ', 'ev:E00032', null, null, false, null, null, null),
        (1129, '2019-06-11 14:17:09.531000', false, null, 'The Cell Line Data Base (CLDB) is a reference information source for human and animal cell lines. It provides the characteristics of the cell lines and their availability through  distributors, allowing cell line requests to be made from collections and laboratories.', 'MIR:00000390', '2019-06-11 14:17:09.531000', 'CLDB', false, '^(cl|tum)\d+$', 'cldb', 'cl3603', null, null, false, null, null, null),
        (1136, '2019-06-11 14:17:10.208000', false, null, 'The Human Gene Mutation Database (HGMD) collates data on germ-line mutations in nuclear genes associated with human inherited disease. It includes information on single base-pair substitutions in coding, regulatory and splicing-relevant regions; micro-deletions and micro-insertions; indels; triplet repeat expansions as well as gross deletions; insertions; duplications; and complex rearrangements. Each mutation entry is unique, and includes cDNA reference sequences for most genes, splice junction sequences, disease-associated and functional polymorphisms, as well as links to data present in publicly available online locus-specific mutation databases.', 'MIR:00000392', '2019-06-11 14:17:10.208000', 'HGMD', false, '^[A-Z_0-9]+$', 'hgmd', 'CALM1', null, null, false, null, null, null),
        (1139, '2019-06-11 14:17:10.425000', false, null, 'AphidBase is a centralized bioinformatic resource that was developed to facilitate community annotation of the pea aphid genome by the International Aphid Genomics Consortium (IAGC). The AphidBase Information System was designed to organize and distribute genomic data and annotations for a large international community. This collection references the transcript report, which describes genomic location, sequence and exon information.', 'MIR:00000393', '2019-06-11 14:17:10.425000', 'AphidBase Transcript', false, '^ACYPI\d{6}(-RA)?$', 'aphidbase.transcript', 'ACYPI000159', null, null, false, null, null, null),
        (1142, '2019-06-11 14:17:10.647000', false, null, 'An Affymetrix ProbeSet is a collection of up to 11 short (~22 nucleotide) microarray probes designed to measure a single gene or a family of genes as a unit. Multiple probe sets may be available for each gene under consideration.', 'MIR:00000394', '2019-06-11 14:17:10.647000', 'Affymetrix Probeset', false, '\d{4,}((_[asx])?_at)?', 'affy.probeset', '243002_at', null, null, false, null, null, null),
        (1146, '2019-06-11 14:17:10.973000', false, null, 'TreeFam is a database of phylogenetic trees of gene families found in animals. Automatically generated trees are curated, to create a curated resource that presents the accurate evolutionary history of all animal gene families, as well as reliable ortholog and paralog assignments.', 'MIR:00000395', '2019-06-11 14:17:10.973000', 'TreeFam', false, '^\w{1,2}\d+$', 'treefam', 'TF101014', null, null, false, null, null, null),
        (1149, '2019-06-11 14:17:11.199000', false, null, 'CAPS-DB is a structural classification of helix-cappings or caps compiled from protein structures. The regions of the polypeptide chain immediately preceding or following an alpha-helix are known as Nt- and Ct cappings, respectively. Caps extracted from protein structures have been structurally classified based on geometry and conformation and organized in a tree-like hierarchical classification where the different levels correspond to different properties of the caps.', 'MIR:00000396', '2019-06-11 14:17:11.199000', 'CAPS-DB', false, '^\d+$', 'caps', '434', null, null, false, null, null, null),
        (1152, '2019-06-11 14:17:11.437000', false, null, 'Cube-DB is a database of pre-evaluated results for detection of functional divergence in human/vertebrate protein families. It analyzes comparable taxonomical samples for all paralogues under consideration, storing functional specialisation at the level of residues. The data are presented as a table of per-residue scores, and mapped onto related structures where available.', 'MIR:00000397', '2019-06-11 14:17:11.437000', 'Cube db', false, '^[A-Za-z_0-9]+$', 'cubedb', 'AKR', null, null, false, null, null, null),
        (1155, '2019-06-11 14:17:11.651000', false, null, 'IDEAL provides a collection of knowledge on experimentally verified intrinsically disordered proteins. It contains manual annotations by curators on intrinsically disordered regions, interaction regions to other molecules, post-translational modification sites, references and structural domain assignments.', 'MIR:00000398', '2019-06-11 14:17:11.651000', 'IDEAL', false, '^IID\d+$', 'ideal', 'IID00001', null, null, false, null, null, null),
        (1158, '2019-06-11 14:17:11.871000', false, null, 'STAP (Statistical Torsional Angles Potentials) was developed since, according to several studies, some nuclear magnetic resonance (NMR) structures are of lower quality, are less reliable and less suitable for structural analysis than high-resolution X-ray crystallographic structures. The refined NMR solution structures (statistical torsion angle potentials; STAP) in the database are refined from the Protein Data Bank (PDB).', 'MIR:00000399', '2019-06-11 14:17:11.871000', 'STAP', false, '^[0-9][A-Za-z0-9]{3}$', 'stap', '1a24', null, null, false, null, null, null),
        (1161, '2019-06-11 14:17:12.099000', false, null, 'Pocketome is an encyclopedia of conformational ensembles of all druggable binding sites that can be identified experimentally from co-crystal structures in the Protein Data Bank. Each Pocketome entry corresponds to a small molecule binding site in a protein which has been co-crystallized in complex with at least one drug-like small molecule, and is represented in at least two PDB entries.', 'MIR:00000400', '2019-06-11 14:17:12.099000', 'Pocketome', false, '^[A-Za-z_0-9]+', 'pocketome', '1433C_TOBAC_1_252', null, null, false, null, null, null),
        (1169, '2019-06-11 14:17:12.749000', false, null, 'BugBase is a MIAME-compliant microbial gene expression and comparative genomic database. It stores experimental annotation and multiple raw and analysed data formats, as well as protocols for bacterial microarray designs. This collection references design protocols.', 'MIR:00000403', '2019-06-11 14:17:12.749000', 'BugBase Protocol', false, '^\d+$', 'bugbase.protocol', '67', null, null, false, null, null, null),
        (1172, '2019-06-11 14:17:12.968000', false, null, 'BugBase is a MIAME-compliant microbial gene expression and comparative genomic database. It stores experimental annotation and multiple raw and analysed data formats, as well as protocols for bacterial microarray designs. This collection references microarray experiments.', 'MIR:00000404', '2019-06-11 14:17:12.968000', 'BugBase Expt', false, '^\d+$', 'bugbase.expt', '288', null, null, false, null, null, null),
        (1267, '2019-06-11 14:17:21.287000', false, null, 'EcoliWiki is a wiki-based resource to store information related to non-pathogenic E. coli, its phages, plasmids, and mobile genetic elements. This collection references genes.', 'MIR:00000442', '2019-06-11 14:17:21.287000', 'EcoliWiki', false, '^[A-Za-z0-9-]+$', 'ecoliwiki', 'aaeA', null, null, false, null, null, null),
        (2852, '2021-09-05 17:54:24.640000', false, null, 'The Python Package Index (PyPI) is a repository for Python packages.', 'MIR:00000863', '2021-09-05 17:54:24.640000', 'PyPI', false, '^[a-zA-Z_][a-zA-Z0-9\-_]+$', 'pypi', 'numpy', null, null, false, null, null, null),
        (1174, '2019-06-11 14:17:13.167000', false, null, 'The Tree of Life Web Project (ToL) is a collaborative effort of biologists and nature enthusiasts from around the world. On more than 10,000 World Wide Web pages, the project provides information about biodiversity, the characteristics of different groups of organisms, and their evolutionary history (phylogeny). 

Each page contains information about a particular group, with pages linked one to another hierarchically, in the form of the evolutionary tree of life. Starting with the root of all Life on Earth and moving out along diverging branches to individual species, the structure of the ToL project thus illustrates the genetic connections between all living things.', 'MIR:00000405', '2019-06-11 14:17:13.167000', 'Tree of Life', false, '^\d+$', 'tol', '98034', null, null, false, null, null, null),
        (1177, '2019-06-11 14:17:13.429000', false, null, 'The Variation Ontology (VariO) is an ontology for the standardized, systematic description of effects, consequences and mechanisms of variations. It describes the effects of variations at the DNA, RNA and/or protein level.', 'MIR:00000406', '2019-06-11 14:17:13.429000', 'VariO', true, '^VariO:\d+$', 'vario', '0294', null, null, false, null, null, null),
        (1182, '2019-06-11 14:17:13.893000', false, null, 'The Virus Pathogen Database and Analysis Resource (ViPR) supports bioinformatics workflows for a broad range of human virus pathogens and other related viruses. It provides access to sequence records, gene and protein annotations, immune epitopes, 3D structures,  and host factor data. This collection references viral strain information.', 'MIR:00000407', '2019-06-11 14:17:13.893000', 'ViPR Strain', false, '^[A-Za-z 0-9]+$', 'vipr', 'BeAn 70563', null, null, false, null, null, null),
        (1185, '2019-06-11 14:17:14.109000', false, null, 'The Eukaryotic Promoter Database (EPD) is an annotated non-redundant collection of eukaryotic POL II promoters, for which the transcription start site has been determined experimentally. Access to promoter sequences is provided by pointers to positions in nucleotide sequence entries. The annotation part of an entry includes description of the initiation site mapping data, cross-references to other databases, and bibliographic references. EPD is structured in a way that facilitates dynamic extraction of biologically meaningful promoter subsets for comparative sequence analysis.', 'MIR:00000408', '2019-06-11 14:17:14.109000', 'EPD', false, '^[A-Z-_0-9]+$', 'epd', 'TA_H3', null, null, false, null, null, null),
        (1187, '2019-06-11 14:17:14.331000', false, null, 'The Rfam database is a collection of RNA families, each represented by multiple sequence alignments, consensus secondary structures and covariance models (CMs). The families in Rfam break down into three broad functional classes: non-coding RNA genes, structured cis-regulatory elements and self-splicing RNAs. Typically these functional RNAs often have a conserved secondary structure which may be better preserved than the RNA sequence. The CMs used to describe each family are a slightly more complicated relative of the profile hidden Markov models (HMMs) used by Pfam. CMs can simultaneously model RNA sequence and the structure in an elegant and accurate fashion.', 'MIR:00000409', '2019-06-11 14:17:14.331000', 'RFAM', false, '^RF\d{5}$', 'rfam', 'RF00230', null, null, false, null, null, null),
        (1192, '2019-06-11 14:17:14.756000', false, null, 'The Assembling the Fungal Tree of Life (AFTOL) project is dedicated to significantly enhancing our understanding of the evolution of the Kingdom Fungi, which represents one of the major clades of life. There are roughly 80,000 described species of Fungi, but the actual diversity in the group has been estimated to be about 1.5 million species.', 'MIR:00000411', '2019-06-11 14:17:14.756000', 'AFTOL', false, '^\d+$', 'aftol.taxonomy', '959', null, null, false, null, null, null),
        (1195, '2019-06-11 14:17:14.975000', false, null, 'The Aspergillus Genome Database (AspGD) is a repository for information relating to fungi of the genus Aspergillus, which includes organisms of clinical, agricultural and industrial importance. AspGD facilitates comparative genomics by providing a full-featured genomics viewer, as well as matched and standardized sets of genomic information for the sequenced aspergilli. This collection references gene information.', 'MIR:00000412', '2019-06-11 14:17:14.975000', 'AspGD Locus', false, '^[A-Za-z_0-9]+$', 'aspgd.locus', 'ASPL0000349247', null, null, false, null, null, null),
        (1198, '2019-06-11 14:17:15.227000', false, null, 'The Aspergillus Genome Database (AspGD) is a repository for information relating to fungi of the genus Aspergillus, which includes organisms of clinical, agricultural and industrial importance. AspGD facilitates comparative genomics by providing a full-featured genomics viewer, as well as matched and standardized sets of genomic information for the sequenced aspergilli. This collection references protein information.', 'MIR:00000413', '2019-06-11 14:17:15.227000', 'AspGD Protein', false, '^[A-Za-z_0-9]+$', 'aspgd.protein', 'ASPL0000349247', null, null, false, null, null, null),
        (1237, '2019-06-11 14:17:18.754000', false, null, 'The National Drug Code (NDC) is a unique, three-segment number used by the Food and Drug Administration (FDA) to identify drug products for commercial use. This is required by the Drug Listing Act of 1972. The FDA publishes and updates the listed NDC numbers daily.', 'MIR:00000431', '2019-06-11 14:17:18.754000', 'National Drug Code', false, '^\d+\-\d+\-\d+', 'ndc', '0002-1975-61', null, null, false, null, null, null),
        (1200, '2019-06-11 14:17:15.426000', false, null, 'AutDB is a curated database for autism research. It is built on information extracted from the studies on molecular genetics and biology of Autism Spectrum Disorders (ASD). The four modules of AutDB include information on Human Genes, Animal models, Protein Interactions (PIN) and Copy Number Variants (CNV) respectively. It provides an annotated list of ASD candidate genes in the form of reference dataset for interrogating molecular mechanisms underlying the disorder.', 'MIR:00000415', '2019-06-11 14:17:15.426000', 'AutDB', false, '^[A-Z]+[A-Z-0-9]{2,}$', 'autdb', 'ADA', null, null, false, null, null, null),
        (1203, '2019-06-11 14:17:15.634000', false, null, 'BacMap is an electronic, interactive atlas of fully sequenced bacterial genomes. It contains labeled, zoomable and searchable chromosome maps for sequenced prokaryotic (archaebacterial and eubacterial) species. Each map can be zoomed to the level of individual genes and each gene is hyperlinked to a richly annotated gene card. All bacterial genome maps are supplemented with separate prophage genome maps as well as separate tRNA and rRNA maps. Each bacterial chromosome entry in BacMap contains graphs and tables on a variety of gene and protein statistics. Likewise, every bacterial species entry contains a bacterial ''biography'' card, with taxonomic details, phenotypic details, textual descriptions and images. This collection references genome map information.', 'MIR:00000416', '2019-06-11 14:17:15.634000', 'BacMap Map', false, '^\w+(\_)?\d+(\.\d+)?$', 'bacmap.map', 'AP011135', null, null, false, null, null, null),
        (1215, '2019-06-11 14:17:16.688000', false, null, 'BioCarta is a supplier and distributor of characterized reagents and assays for biopharmaceutical and academic research. It catalogs community produced online maps depicting molecular relationships from areas of active research, generating classical pathways as well as suggestions for new pathways. This collections references pathway maps.', 'MIR:00000421', '2019-06-11 14:17:16.688000', 'BioCarta Pathway', false, '^([hm]\_)?\w+Pathway$', 'biocarta.pathway', 'h_aktPathway', null, null, false, null, null, null),
        (1219, '2019-06-11 14:17:17.038000', false, null, 'Golm Metabolome Database (GMD) provides public access to custom mass spectral libraries, metabolite profiling experiments as well as additional information and tools. GMD''s metabolite profiles provide relative metabolite concentrations normalised according to fresh weight (or comparable quantitative data, such as volume, cell count, etc.) and internal standards (e.g. ribotol) of biological reference conditions and tissues.', 'MIR:00000423', '2019-06-11 14:17:17.038000', 'Golm Metabolome Database Profile', false, '^([0-9a-fA-F]){8}(-([0-9a-fA-F]){4}){3}-([0-9a-fA-F]){12}$', 'gmd.profile', '10b38aaf-b977-4950-85b8-f4775f66658d', null, null, false, null, null, null),
        (1272, '2019-06-11 14:17:21.690000', false, null, 'JSTOR (Journal Storage) is a digital library containing digital versions of historical academic journals, as well as books, pamphlets and current issues of journals. Some public domain content is free to access, while other articles require registration.', 'MIR:00000444', '2019-06-11 14:17:21.690000', 'JSTOR', false, '^\d+$', 'jstor', '3075966', null, null, false, null, null, null),
        (1221, '2019-06-11 14:17:17.255000', false, null, 'Golm Metabolome Database (GMD) provides public access to custom mass spectral libraries, metabolite profiling experiments as well as additional information and tools. Analytes are subjected to a gas chromatograph coupled to a mass spectrometer, which records the mass spectrum and the retention time linked to an analyte. This collection references GC-MS spectra.', 'MIR:00000424', '2019-06-11 14:17:17.255000', 'Golm Metabolome Database GC-MS spectra', false, '^([0-9a-fA-F]){8}(-([0-9a-fA-F]){4}){3}-([0-9a-fA-F]){12}$', 'gmd.gcms', '53d583d8-40c6-40e1-9296-23f821cd77a5', null, null, false, null, null, null),
        (1223, '2019-06-11 14:17:17.475000', false, null, 'Golm Metabolome Database (GMD) provides public access to custom mass spectral libraries, metabolite profiling experiments as well as additional information and tools. Since metabolites often cannot be obtained in their respective native biological state, for example organic acids may be only acquirable as salts, the concept of reference substance was introduced. This collection references reference substances.', 'MIR:00000425', '2019-06-11 14:17:17.475000', 'Golm Metabolome Database Reference Substance', false, '^([0-9a-fA-F]){8}(-([0-9a-fA-F]){4}){3}-([0-9a-fA-F]){12}$', 'gmd.ref', '8cf84adb-b4db-4807-ac98-0004247c35df', null, null, false, null, null, null),
        (1225, '2019-06-11 14:17:17.661000', false, null, 'Golm Metabolome Database (GMD) provides public access to custom mass spectral libraries, metabolite profiling experiments as well as additional information and tools. For GC-MS profiling analyses, polar metabolite extracts are chemically converted, i.e. derivatised into less polar and volatile compounds, so called analytes.  This collection references analytes.', 'MIR:00000426', '2019-06-11 14:17:17.661000', 'Golm Metabolome Database Analyte', false, '^([0-9a-fA-F]){8}(-([0-9a-fA-F]){4}){3}-([0-9a-fA-F]){12}$', 'gmd.analyte', '4f0fa9b6-514f-4ff4-98cc-0009bc08eb80', null, null, false, null, null, null),
        (1227, '2019-06-11 14:17:17.850000', false, null, 'IntAct provides a freely available, open source database system and analysis tools for protein interaction data. This collection references interactor molecules.', 'MIR:00000427', '2019-06-11 14:17:17.850000', 'IntAct Molecule', false, '^EBI\-[0-9]+$', 'intact.molecule', 'EBI-366083', null, null, false, null, null, null),
        (1229, '2019-06-11 14:17:18.034000', false, null, 'The human DEPhOsphorylation Database (DEPOD) contains information on known human active phosphatases and their experimentally verified protein and nonprotein substrates. Reliability scores are provided for dephosphorylation interactions, according to the type of assay used, as well as the number of laboratories that have confirmed such interaction. Phosphatase and substrate entries are listed along with the dephosphorylation site, bioassay type, and original literature, and contain links to other resources.', 'MIR:00000428', '2019-06-11 14:17:18.034000', 'DEPOD', false, '^[A-Z0-9]+$', 'depod', 'PTPN1', null, null, false, null, null, null),
        (1232, '2019-06-11 14:17:18.324000', false, null, 'Cell Signaling Technology is a commercial organisation which provides a pathway portal to showcase their phospho-antibody products. This collection references pathways.', 'MIR:00000429', '2019-06-11 14:17:18.324000', 'Cell Signaling Technology Pathways', false, '^[A-Za-z0-9_-]+$', 'cst', 'Akt_PKB', null, null, false, null, null, null),
        (1241, '2019-06-11 14:17:19.049000', false, null, 'Phytozome is a project to facilitate comparative genomic studies amongst green plants. Famlies of orthologous and paralogous genes that represent the modern descendents of ancestral gene sets are constructed at key phylogenetic nodes. These families allow easy access to clade specific orthology/paralogy relationships as well as clade specific genes and gene expansions. This collection references locus information.', 'MIR:00000432', '2019-06-11 14:17:19.049000', 'Phytozome Locus', false, '^[A-Za-z0-9]+$', 'phytozome.locus', 'Glyma0021s00410', null, null, false, null, null, null),
        (1244, '2019-06-11 14:17:19.310000', false, null, 'SubtiList serves to collate and integrate various aspects of the genomic information from B. subtilis, the paradigm of sporulating Gram-positive bacteria.
SubtiList provides a complete dataset of DNA and protein sequences derived from the paradigm strain B. subtilis 168, linked to the relevant annotations and functional assignments.', 'MIR:00000433', '2019-06-11 14:17:19.310000', 'SubtiList', false, '^BG\d+$', 'subtilist', 'BG11523', null, null, false, null, null, null),
        (1247, '2019-06-11 14:17:19.532000', false, null, 'DailyMed provides information about marketed drugs. This information includes FDA labels (package inserts). The Web site provides a standard, comprehensive, up-to-date, look-up and download resource of medication content and labeling as found in medication package inserts. Drug labeling is the most recent submitted to the Food and Drug Administration (FDA) and currently in use; it may include, for example, strengthened warnings undergoing FDA review or minor editorial changes. These labels have been reformatted to make them easier to read.', 'MIR:00000434', '2019-06-11 14:17:19.532000', 'DailyMed', false, '^[A-Za-z0-9-]+', 'dailymed', '973a9333-fec7-46dd-8eb5-25738f06ee54', null, null, false, null, null, null),
        (1250, '2019-06-11 14:17:19.846000', false, null, 'SIDER (Side Effect Resource) is a public, computer-readable side effect resource that connects drugs to side effect terms. It aggregates dispersed public information on side effects. This collection references drugs in SIDER.', 'MIR:00000435', '2019-06-11 14:17:19.846000', 'SIDER Drug', false, '^\d+$', 'sider.drug', '2244', null, null, false, null, null, null),
        (1253, '2019-06-11 14:17:20.079000', false, null, 'SIDER (Side Effect Resource) is a public, computer-readable side effect resource that connects drugs to side effect terms. It aggregates dispersed public information on side effects. This collection references side effects of drugs as referenced in SIDER.', 'MIR:00000436', '2019-06-11 14:17:20.079000', 'SIDER Side Effect', false, '^C\d+$', 'sider.effect', 'C0017565', null, null, false, null, null, null),
        (1205, '2019-06-11 14:17:15.821000', true, '2023-07-04 10:27:03.694000', 'Bgee is a database of gene expression patterns within particular anatomical structures within a species, and between different animal species. This collection refers to expression across species.', 'MIR:00000417', '2023-09-13 08:55:41.857000', 'Bgee family', false, '^(ENSFM|ENSGTV:)\d+$', 'bgee.family', 'ENSFM00500000270089', null, null, true, 'These entries are not available any more in the last versions of the Bgee database.', null, null),
        (1255, '2019-06-11 14:17:20.303000', false, null, 'WikiGenes is a collaborative knowledge resource for the life sciences, which is based on the general wiki idea but employs specifically developed technology to serve as a rigorous scientific tool. The rationale behind WikiGenes is to provide a platform for the scientific community to collect, communicate and evaluate knowledge about genes, chemicals, diseases and other biomedical concepts in a bottom-up process.', 'MIR:00000437', '2019-06-11 14:17:20.303000', 'WikiGenes', false, '^\d+$', 'wikigenes', '3771877', null, null, false, null, null, null),
        (1258, '2019-06-11 14:17:20.539000', false, null, 'Magnaporthe grisea, the causal agent of rice blast disease, is one of the most devasting threats to food security worldwide and is a model organism for studying fungal phytopathogenicity and host-parasite interactions. The Magnaporthe comparative genomics database provides accesses to multiple fungal genomes from the Magnaporthaceae family to facilitate the comparative analysis. As part of the Broad Fungal Genome Initiative, the Magnaporthe comparative project includes the finished M. oryzae (formerly M. grisea) genome, as well as the draft assemblies of Gaeumannomyces graminis var. tritici and M. poae.', 'MIR:00000438', '2019-06-11 14:17:20.539000', 'Broad Fungal Genome Initiative', false, '^S\d+$', 'broad', 'S7000002168151102', null, null, false, null, null, null),
        (1261, '2019-06-11 14:17:20.763000', false, null, 'The Coriell Cell Repositories provide essential research reagents to the scientific community by establishing, verifying, maintaining, and distributing cell cultures and DNA derived from cell cultures. These collections, supported by funds from the National Institutes of Health (NIH) and several foundations, are extensively utilized by research scientists around the world.', 'MIR:00000439', '2019-06-11 14:17:20.763000', 'Coriell Cell Repositories', false, '^[A-Z]{2}\d+$', 'coriell', 'GM17027', null, null, false, null, null, null),
        (1283, '2019-06-11 14:17:22.748000', false, null, 'Unimod is a public domain database created to provide a community supported, comprehensive database of protein modifications for mass spectrometry applications. That is, accurate and verifiable values, derived from elemental compositions, for the mass differences introduced by all types of natural and artificial modifications. Other important information includes any mass change, (neutral loss), that occurs during MS/MS analysis, and site specificity, (which residues are susceptible to modification and any constraints on the position of the modification within the protein or peptide).', 'MIR:00000447', '2019-06-11 14:17:22.748000', 'Unimod', false, '^\d+$', 'unimod', '1200', null, null, false, null, null, null),
        (1286, '2019-06-11 14:17:22.962000', false, null, 'The VBRC provides bioinformatics resources to support scientific research directed at viruses belonging to the Arenaviridae, Bunyaviridae, Filoviridae, Flaviviridae, Paramyxoviridae, Poxviridae, and Togaviridae families. The Center consists of a relational database and web application that support the data storage, annotation, analysis, and information exchange goals of this work. Each data release contains the complete genomic sequences for all viral pathogens and related strains that are available for species in the above-named families. In addition to sequence data, the VBRC provides a curation for each virus species, resulting in a searchable, comprehensive mini-review of gene function relating genotype to biological phenotype, with special emphasis on pathogenesis.', 'MIR:00000448', '2019-06-11 14:17:22.962000', 'VBRC', false, '^\d+$', 'vbrc', '35742', null, null, false, null, null, null),
        (1289, '2019-06-11 14:17:23.207000', false, null, 'ViralZone is a resource bridging textbook knowledge with genomic and proteomic sequences. It provides fact sheets on all known virus families/genera with easy access to sequence data. A selection of reference strains (RefStrain) provides annotated standards to circumvent the exponential increase of virus sequences. Moreover ViralZone offers a complete set of detailed and accurate virion pictures.', 'MIR:00000449', '2019-06-11 14:17:23.207000', 'ViralZone', false, '^\d+$', 'viralzone', '992', null, null, false, null, null, null),
        (1294, '2019-06-11 14:17:23.659000', false, null, 'Rat Genome Database seeks to collect, consolidate, and integrate rat genomic and genetic data with curated functional and physiological data and make these data widely available to the scientific community. This collection references quantitative trait loci (qTLs), providing phenotype and disease descriptions, mapping, and strain information as well as links to markers and candidate genes.', 'MIR:00000451', '2019-06-11 14:17:23.659000', 'Rat Genome Database qTL', false, '^\d+$', 'rgd.qtl', '1354581', null, null, false, null, null, null),
        (1297, '2019-06-11 14:17:23.876000', false, null, 'Rat Genome Database seeks to collect, consolidate, and integrate rat genomic and genetic data with curated functional and physiological data and make these data widely available to the scientific community. This collection references strain reports, which include a description of strain origin, disease, phenotype, genetics and immunology.', 'MIR:00000452', '2019-06-11 14:17:23.876000', 'Rat Genome Database strain', false, '^\d+$', 'rgd.strain', '5688061', null, null, false, null, null, null),
        (1299, '2019-06-11 14:17:24.062000', false, null, 'DOOR (Database for prOkaryotic OpeRons) contains computationally predicted operons of all the sequenced prokaryotic genomes. It includes operons for RNA genes.', 'MIR:00000453', '2019-06-11 14:17:24.062000', 'DOOR', false, '^\d+$', 'door', '1398574', null, null, false, null, null, null),
        (1302, '2019-06-11 14:17:24.294000', false, null, 'The Degradome Database contains information on the complete set of predicted proteases present in a a variety of mammalian species that have been subjected to whole genome sequencing. Each protease sequence is curated and, when necessary, cloned and sequenced.', 'MIR:00000454', '2019-06-11 14:17:24.294000', 'Degradome Database', false, '^[AMCST][0-9x][0-9]$', 'degradome', 'Ax1', null, null, false, null, null, null),
        (1305, '2019-06-11 14:17:24.514000', false, null, 'The DBD (transcription factor database) provides genome-wide transcription factor predictions for organisms across the tree of life. The prediction method identifies sequence-specific DNA-binding transcription factors through homology using profile hidden Markov models (HMMs) of domains from Pfam and SUPERFAMILY. It does not include basal transcription factors or chromatin-associated proteins.', 'MIR:00000455', '2019-06-11 14:17:24.514000', 'DBD', false, '^\d+$', 'dbd', '0045310', null, null, false, null, null, null),
        (1307, '2019-06-11 14:17:24.701000', false, null, 'DATF contains known and predicted Arabidopsis transcription factors (1827 genes in 56 families) with the unique information of 1177 cloned sequences and many other features including 3D structure templates, EST expression information, transcription factor binding sites and nuclear location signals.', 'MIR:00000456', '2019-06-11 14:17:24.701000', 'DATF', false, '^AT[1-5]G\d{5}(\.\d+)?$', 'datf', 'AT1G01030.1', null, null, false, null, null, null),
        (1433, '2019-06-11 14:17:35.969000', false, null, 'The Animal Quantitative Trait Loci (QTL) database (Animal QTLdb) is designed to house publicly all available QTL and single-nucleotide polymorphism/gene association data on livestock animal species. This collection references pig QTLs.', 'MIR:00000506', '2019-06-11 14:17:35.969000', 'Animal Genome Pig QTL', false, '^\d+$', 'pigqtldb', '14', null, null, false, null, null, null),
        (1310, '2019-06-11 14:17:24.936000', false, null, 'The IUPHAR Compendium details the molecular, biophysical and pharmacological properties of identified mammalian sodium, calcium and potassium channels, as well as the related cyclic nucleotide-modulated ion channels and the recently described transient receptor potential channels. It includes information on nomenclature systems, and on inter and intra-species molecular structure variation. This collection references ligands.', 'MIR:00000457', '2019-06-11 14:17:24.936000', 'IUPHAR ligand', false, '^\d+$', 'iuphar.ligand', '1755', null, null, false, null, null, null),
        (1312, '2019-06-11 14:17:25.144000', false, null, 'Molbase provides compound data information for researchers as well as listing suppliers and price information. It can be searched by keyword or CAS indetifier.', 'MIR:00000458', '2019-06-11 14:17:25.144000', 'Molbase', false, '^(\d{1,7}\-\d{2}\-\d)|([A-Za-z0-9\+\-\_]+)$', 'molbase', '128796-39-4', null, null, false, null, null, null),
        (1315, '2019-06-11 14:17:25.397000', false, null, 'The Yeast Resource Center Public Data Repository (YRC PDR) serves as a single point of access for the experimental data produced from many collaborations typically studying Saccharomyces cerevisiae (baker''s yeast). The experimental data include large amounts of mass spectrometry results from protein co-purification experiments, yeast two-hybrid interaction experiments, fluorescence microscopy images and protein structure predictions.', 'MIR:00000459', '2019-06-11 14:17:25.397000', 'YRC PDR', false, '^\d+$', 'yrcpdr', '2673500', null, null, false, null, null, null),
        (1318, '2019-06-11 14:17:25.610000', false, null, 'The YEast Intron Database (version 3) contains information on the spliceosomal introns of the yeast Saccharomyces cerevisiae. It includes expression data that relates to the efficiency of splicing relative to other processes in strains of yeast lacking nonessential splicing factors.  The data are displayed on each intron page. An updated version of the database is available through [MIR:00000521].', 'MIR:00000460', '2019-06-11 14:17:25.610000', 'Yeast Intron Database v3', false, '^[A-Z0-9]+$', 'yid', 'SNR17A', null, null, false, null, null, null),
        (1321, '2019-06-11 14:17:25.854000', false, null, 'Computational gene function prediction can serve to focus experimental resources on high-priority experimental tasks. FuncBase is a web resource for viewing quantitative machine learning-based gene function annotations. Quantitative annotations of genes, including fungal and mammalian genes, with Gene Ontology terms are accompanied by a community feedback system. Evidence underlying function annotations is shown. FuncBase provides links to external resources, and may be accessed directly or via links from species-specific databases. This collection references Drosophila data.', 'MIR:00000461', '2019-06-11 14:17:25.854000', 'FuncBase Fly', false, '^\d+$', 'funcbase.fly', '10194', null, null, false, null, null, null),
        (2152, '2020-03-20 12:58:53.045000', false, null, 'SNP2TFBS is aimed at studying variations (SNPs/indels) that affect transcription factor binding (TFB) in the Human genome.', 'MIR:00000766', '2020-03-20 12:58:53.045000', 'SNP2TFBS', false, '^rs[0-9]+$', 'snp2tfbs', 'rs11603840', null, null, false, null, null, null),
        (1324, '2019-06-11 14:17:26.074000', false, null, 'Computational gene function prediction can serve to focus experimental resources on high-priority experimental tasks. FuncBase is a web resource for viewing quantitative machine learning-based gene function annotations. Quantitative annotations of genes, including fungal and mammalian genes, with Gene Ontology terms are accompanied by a community feedback system. Evidence underlying function annotations is shown. FuncBase provides links to external resources, and may be accessed directly or via links from species-specific databases. This collection references human data.', 'MIR:00000462', '2019-06-11 14:17:26.074000', 'FuncBase Human', false, '^\d+$', 'funcbase.human', '119514', null, null, false, null, null, null),
        (1326, '2019-06-11 14:17:26.285000', false, null, 'Computational gene function prediction can serve to focus experimental resources on high-priority experimental tasks. FuncBase is a web resource for viewing quantitative machine learning-based gene function annotations. Quantitative annotations of genes, including fungal and mammalian genes, with Gene Ontology terms are accompanied by a community feedback system. Evidence underlying function annotations is shown. FuncBase provides links to external resources, and may be accessed directly or via links from species-specific databases. This collection references mouse.', 'MIR:00000463', '2019-06-11 14:17:26.285000', 'FuncBase Mouse', false, '^\d+$', 'funcbase.mouse', '1351341', null, null, false, null, null, null),
        (1881, '2019-06-11 14:18:18.874000', false, null, 'The cBioPortal for Cancer Genomics provides visualization, analysis and download of large-scale cancer genomics data sets.', 'MIR:00000679', '2019-06-11 14:18:18.874000', 'The cBioPortal for Cancer Genomics', false, '^[a-z0-9\_]+$', 'cbioportal', 'laml_tcga_pub', null, null, false, null, null, null),
        (1328, '2019-06-11 14:17:26.470000', false, null, 'Computational gene function prediction can serve to focus experimental resources on high-priority experimental tasks. FuncBase is a web resource for viewing quantitative machine learning-based gene function annotations. Quantitative annotations of genes, including fungal and mammalian genes, with Gene Ontology terms are accompanied by a community feedback system. Evidence underlying function annotations is shown. FuncBase provides links to external resources, and may be accessed directly or via links from species-specific databases. This collection references yeast.', 'MIR:00000464', '2019-06-11 14:17:26.470000', 'FuncBase Yeast', false, '^\d+$', 'funcbase.yeast', '2701', null, null, false, null, null, null),
        (1330, '2019-06-11 14:17:26.654000', false, null, 'The YDPM database serves to support the Yeast Deletion and the Mitochondrial Proteomics Project. The project aims to increase the understanding of mitochondrial function and biogenesis in the context of the cell. In the Deletion Project, strains from the deletion collection were monitored under 9 different media conditions selected for the study of mitochondrial function. The YDPM database contains both the raw data and growth rates calculated for each strain in each media condition.', 'MIR:00000465', '2019-06-11 14:17:26.654000', 'YDPM', false, '^Y[A-Z]{2}\d+[CW]$', 'ydpm', 'YAL001C', null, null, false, null, null, null),
        (1333, '2019-06-11 14:17:26.886000', false, null, 'WormBase is an online bioinformatics database of the biology and genome of the model organism Caenorhabditis elegans and related nematodes. It is used by the C. elegans research community both as an information resource and as a mode to publish and distribute their results. This collection references RNAi experiments, detailing target and phenotypes.', 'MIR:00000466', '2019-06-11 14:17:26.886000', 'WormBase RNAi', false, '^WBRNAi\d{8}$', 'wb.rnai', 'WBRNAi00086878', null, null, false, null, null, null),
        (1335, '2019-06-11 14:17:27.086000', false, null, 'The PASS2 database provides alignments of proteins related at the superfamily level and are characterized by low sequence identity.', 'MIR:00000468', '2019-06-11 14:17:27.086000', 'PASS2', false, '^\d+$', 'pass2', '46977', null, null, false, null, null, null),
        (1338, '2019-06-11 14:17:27.338000', false, null, 'ICEberg (Integrative and conjugative elements) is a database of integrative and conjugative elements (ICEs) found in bacteria. ICEs are conjugative self-transmissible elements that can integrate into and excise from a host chromosome, and can carry likely virulence determinants, antibiotic-resistant factors and/or genes coding for other beneficial traits. It contains details of ICEs found in representatives bacterial species, and which are organised as families. This collection references ICE elements.', 'MIR:00000469', '2019-06-11 14:17:27.338000', 'ICEberg element', false, '^\d+$', 'iceberg.element', '100', null, null, false, null, null, null),
        (1341, '2019-06-11 14:17:27.601000', false, null, 'ICEberg (Integrative and conjugative elements) is a database of integrative and conjugative elements (ICEs) found in bacteria. ICEs are conjugative self-transmissible elements that can integrate into and excise from a host chromosome, and can carry likely virulence determinants, antibiotic-resistant factors and/or genes coding for other beneficial traits. It contains details of ICEs found in representatives bacterial species, and which are organised as families. This collection references ICE families.', 'MIR:00000470', '2019-06-11 14:17:27.601000', 'ICEberg family', false, '^\d+$', 'iceberg.family', '1', null, null, false, null, null, null),
        (1344, '2019-06-11 14:17:27.811000', false, null, 'VFDB is a repository of virulence factors (VFs) of pathogenic bacteria.This collection references VF information by Genus.', 'MIR:00000471', '2019-06-11 14:17:27.811000', 'VFDB Genus', false, '^\w+$', 'vfdb.genus', 'Chlamydia', null, null, false, null, null, null),
        (1431, '2019-06-11 14:17:35.752000', false, null, 'The Animal Quantitative Trait Loci (QTL) database (Animal QTLdb) is designed to house publicly all available QTL and single-nucleotide polymorphism/gene association data on livestock animal species. This collection references chicken QTLs.', 'MIR:00000505', '2019-06-11 14:17:35.752000', 'Animal Genome Chicken QTL', false, '^\d+$', 'chickenqtldb', '14362', null, null, false, null, null, null),
        (1349, '2019-06-11 14:17:28.224000', false, null, 'MeSH (Medical Subject Headings) is the National Library of Medicine''s controlled vocabulary thesaurus. It consists of sets of terms naming descriptors in a hierarchical structure that permits searching at various levels of specificity. This thesaurus is used by NLM for indexing articles from biomedical journals, cataloging of books, documents, etc. This collection references MeSH terms published in 2013.', 'MIR:00000473', '2019-06-11 14:17:28.224000', 'MeSH 2013', false, '^[A-Za-z0-9]+$', 'mesh.2013', '17165', null, null, false, null, null, null),
        (1351, '2019-06-11 14:17:28.414000', false, null, 'KEGG Modules are manually defined functional units used in the annotation and biological interpretation of sequenced genomes. Each module corresponds to a set of ''KEGG Orthology'' (MIR:00000116) entries. KEGG Modules can represent pathway, structural, functional or signature modules.', 'MIR:00000474', '2019-06-11 14:17:28.414000', 'KEGG Module', false, '^([a-z]{3,5}_)?M\d{5}$', 'kegg.module', 'M00002', null, null, false, null, null, null),
        (1353, '2019-06-11 14:17:28.601000', false, null, 'The KEGG DISEASE database is a collection of disease entries capturing knowledge on genetic and environmental perturbations. Each disease entry contains a list of known genetic factors (disease genes), environmental factors, diagnostic markers, and therapeutic drugs. Diseases are viewed as perturbed states of the molecular system, and drugs as perturbants to the molecular system.', 'MIR:00000475', '2019-06-11 14:17:28.601000', 'KEGG Disease', false, '^H\d+$', 'kegg.disease', 'H00076', null, null, false, null, null, null),
        (1355, '2019-06-11 14:17:28.795000', false, null, 'MedlinePlus is the National Institutes of Health''s Web site for patients and their families and friends. Produced by the National Library of Medicine, it provides information about diseases, conditions, and wellness issues using non-technical terms and language.', 'MIR:00000476', '2019-06-11 14:17:28.795000', 'MedlinePlus', false, '^\d+$', 'medlineplus', '002804', null, null, false, null, null, null),
        (1360, '2019-06-11 14:17:29.214000', false, null, 'GlycoEpitope is a database containing useful information about carbohydrate antigens (glyco-epitopes) and the antibodies (polyclonal or monoclonal) that can be used to analyze their expression. This collection references Glycoepitopes.', 'MIR:00000478', '2019-06-11 14:17:29.214000', 'GlycoEpitope', false, '^EP\d{4}$', 'glycoepitope', 'EP0311', null, null, false, null, null, null),
        (1363, '2019-06-11 14:17:29.437000', false, null, 'JCGGDB (Japan Consortium for Glycobiology and Glycotechnology DataBase) is a database that aims to integrate all glycan-related data held in various repositories in Japan. This includes databases for large-quantity synthesis of glycogenes and glycans, analysis and detection of glycan structure and glycoprotein, glycan-related differentiation markers, glycan functions, glycan-related diseases and transgenic and knockout animals, etc.', 'MIR:00000479', '2019-06-11 14:17:29.437000', 'JCGGDB', false, '^JCGG-STR\d{6}$', 'jcggdb', 'JCGG-STR008690', null, null, false, null, null, null),
        (1366, '2019-06-11 14:17:29.649000', false, null, 'NONCODE is a database of expression and functional lncRNA (long noncoding RNA) data obtained from microarray studies. LncRNAs have been shown to play key roles in various biological processes such as imprinting control, circuitry controlling pluripotency and differentiation, immune responses and chromosome dynamics. The collection references NONCODE version 4 and relates to gene regions.', 'MIR:00000480', '2019-06-11 14:17:29.649000', 'NONCODE v4 Gene', false, '^NONHSAG\d{5}$', 'noncodev4.gene', 'NONHSAG00001', null, null, false, null, null, null),
        (1884, '2019-06-11 14:18:19.150000', false, null, 'An interactive tool for neurobiologists to explore the detailed neuroanatomy, neuron connectivity and gene expression of the Drosophila melanogaster.', 'MIR:00000680', '2019-06-11 14:18:19.150000', 'Virtual Fly Brain', false, '^[0-9a-zA-Z]{8}$', 'vfb', '00000001', null, null, false, null, null, null),
        (1368, '2019-06-11 14:17:29.833000', false, null, 'NONCODE is a database of expression and functional lncRNA (long noncoding RNA) data obtained from microarray studies. LncRNAs have been shown to play key roles in various biological processes such as imprinting control, circuitry controlling pluripotency and differentiation, immune responses and chromosome dynamics. The collection references NONCODE version 4 and relates to individual transcripts.', 'MIR:00000481', '2019-06-11 14:17:29.833000', 'NONCODE v4 Transcript', false, '^NONHSAT\d{6}$', 'noncodev4.rna', 'NONHSAT000001', null, null, false, null, null, null),
        (1370, '2019-06-11 14:17:30.027000', false, null, 'Oryzabase provides a view of rice (Oryza sativa) as a model monocot plant by integrating biological data with molecular genomic information. It contains information about rice development and anatomy, rice mutants, and genetic resources, especially for wild varieties of rice. Developmental and anatomical descriptions include in situ gene expression data serving as stage and tissue markers. This collection references gene information.', 'MIR:00000482', '2019-06-11 14:17:30.027000', 'Oryzabase Gene', false, '^\d+$', 'oryzabase.gene', '117', null, null, false, null, null, null),
        (1373, '2019-06-11 14:17:30.248000', false, null, 'Oryzabase provides a view of rice (Oryza sativa) as a model monocot plant by integrating biological data with molecular genomic information. It contains information about rice development and anatomy, rice mutants, and genetic resources, especially for wild varieties of rice. Developmental and anatomical descriptions include in situ gene expression data serving as stage and tissue markers. This collection references mutant strain information.', 'MIR:00000483', '2019-06-11 14:17:30.248000', 'Oryzabase Mutant', false, '^\d+$', 'oryzabase.mutant', '21393', null, null, false, null, null, null),
        (1375, '2019-06-11 14:17:30.425000', false, null, 'Oryzabase provides a view of rice (Oryza sativa) as a model monocot plant by integrating biological data with molecular genomic information. It contains information about rice development and anatomy, rice mutants, and genetic resources, especially for wild varieties of rice. Developmental and anatomical descriptions include in situ gene expression data serving as stage and tissue markers. This collection references wild strain information.', 'MIR:00000484', '2019-06-11 14:17:30.425000', 'Oryzabase Strain', false, '^\d+$', 'oryzabase.strain', '1', null, null, false, null, null, null),
        (1377, '2019-06-11 14:17:30.616000', false, null, 'Oryzabase provides a view of rice (Oryza sativa) as a model monocot plant by integrating biological data with molecular genomic information. It contains information about rice development and anatomy, rice mutants, and genetic resources, especially for wild varieties of rice. Developmental and anatomical descriptions include in situ gene expression data serving as stage and tissue markers. This collection references development stage information.', 'MIR:00000485', '2019-06-11 14:17:30.616000', 'Oryzabase Stage', false, '^\d+$', 'oryzabase.stage', '34', null, null, false, null, null, null),
        (1379, '2019-06-11 14:17:30.833000', false, null, 'Oryza Tag Line is a database that was developed to collect information generated from the characterization of rice (Oryza sativa L cv. Nipponbare) insertion lines resulting in potential gene disruptions. It collates morpho-physiological alterations observed during field evaluation, with each insertion line documented through a generic passport data including production records, seed stocks and FST information.', 'MIR:00000486', '2019-06-11 14:17:30.833000', 'Oryza Tag Line', false, '^A[A-Z]+\d+$', 'otl', 'AADB12', null, null, false, null, null, null),
        (1382, '2019-06-11 14:17:31.086000', false, null, 'The Gene Wiki is project which seeks to provide detailed information on human genes. Initial ''stub'' articles are created in an automated manner, with further information added by the community. Gene Wiki can be accessed in wikipedia using Gene identifiers from NCBI.', 'MIR:00000487', '2019-06-11 14:17:31.086000', 'Gene Wiki', false, '^\d+$', 'genewiki', '1017', null, null, false, null, null, null),
        (1384, '2019-06-11 14:17:31.315000', false, null, 'PaxDb is a resource dedicated to integrating information on absolute protein abundance levels across different organisms. Publicly available experimental data are mapped onto a common namespace and, in the case of tandem mass spectrometry data, re-processed using a standardized spectral counting pipeline. Data sets are scored and ranked to assess consistency against externally provided protein-network information. PaxDb provides whole-organism data as well as tissue-resolved data, for numerous proteins. This collection references protein abundance information by species.', 'MIR:00000488', '2019-06-11 14:17:31.315000', 'PaxDb Organism', false, '^\d+$', 'paxdb.organism', '9606', null, null, false, null, null, null),
        (1387, '2019-06-11 14:17:31.566000', false, null, 'PaxDb is a resource dedicated to integrating information on absolute protein abundance levels across different organisms. Publicly available experimental data are mapped onto a common namespace and, in the case of tandem mass spectrometry data, re-processed using a standardized spectral counting pipeline. Data sets are scored and ranked to assess consistency against externally provided protein-network information. PaxDb provides whole-organism data as well as tissue-resolved data, for numerous proteins. This collection references individual protein abundance levels.', 'MIR:00000489', '2019-06-11 14:17:31.566000', 'PaxDb Protein', false, '^\d+$', 'paxdb.protein', '977869', null, null, false, null, null, null),
        (1389, '2019-06-11 14:17:31.784000', false, null, 'The Protein Data Bank is the single worldwide archive of structural data of biological macromolecules. This collection references ligands.', 'MIR:00000490', '2019-06-11 14:17:31.784000', 'Protein Data Bank Ligand', false, '^[A-Za-z0-9]+$', 'pdb.ligand', 'TRQ', null, null, false, null, null, null),
        (1392, '2019-06-11 14:17:32.129000', false, null, 'The MEROPS database is an information resource for peptidases (also termed proteases, proteinases and proteolytic enzymes) and the proteins that inhibit them. This collections references inhibitors.', 'MIR:00000491', '2019-06-11 14:17:32.129000', 'MEROPS Inhibitor', false, '^I\d{2}\.\d{3}$', 'merops.inhibitor', 'I31.952', null, null, false, null, null, null),
        (1398, '2019-06-11 14:17:32.633000', false, null, 'The GPCR-LIgand DAtabase (GLIDA) is a GPCR-related chemical genomic database that is primarily focused on the correlation of information between GPCRs and their ligands. It provides correlation data between GPCRs and their ligands, along with chemical information on the ligands. This collection references G-protein coupled receptors.', 'MIR:00000493', '2019-06-11 14:17:32.633000', 'GLIDA GPCR', false, '^[A-Z-_0-9]+$', 'glida.gpcr', 'ACM1_HUMAN', null, null, false, null, null, null),
        (1401, '2019-06-11 14:17:32.872000', false, null, 'The GPCR-LIgand DAtabase (GLIDA) is a GPCR-related chemical genomic database that is primarily focused on the correlation of information between GPCRs and their ligands. It provides correlation data between GPCRs and their ligands, along with chemical information on the ligands. This collection references ligands.', 'MIR:00000494', '2019-06-11 14:17:32.872000', 'GLIDA Ligand', false, '^L\d+$', 'glida.ligand', 'L000001', null, null, false, null, null, null),
        (1453, '2019-06-11 14:17:38.030000', false, null, 'The PRIDE PRoteomics IDEntifications database is a centralized, standards compliant, public data repository that provides protein and peptide identifications together with supporting evidence. This collection references projects.', 'MIR:00000515', '2019-06-11 14:17:38.030000', 'PRIDE Project', false, '^P(X|R)D\d{6}$', 'pride.project', 'PXD000440', null, null, false, null, null, null),
        (1403, '2019-06-11 14:17:33.087000', false, null, 'GRSDB is a database of G-quadruplexes and contains information on composition and distribution of putative Quadruplex-forming G-Rich Sequences (QGRS) mapped in the eukaryotic pre-mRNA sequences, including those that are alternatively processed (alternatively spliced or alternatively polyadenylated). The data stored in the GRSDB is based on computational analysis of NCBI Entrez Gene entries and their corresponding annotated genomic nucleotide sequences of RefSeq/GenBank.', 'MIR:00000495', '2019-06-11 14:17:33.087000', 'GRSDB', false, '^\d+$', 'grsdb', '10142', null, null, false, null, null, null),
        (1447, '2019-06-11 14:17:37.549000', false, null, 'The ProteomeXchange provides a single point of submission of Mass Spectrometry (MS) proteomics data for the main existing proteomics repositories, and encourages the data exchange between them for optimal data dissemination.', 'MIR:00000513', '2019-06-11 14:17:37.549000', 'ProteomeXchange', false, '^(R)?PXD\d{6}$', 'px', 'PXD000500', null, null, false, null, null, null),
        (1450, '2019-06-11 14:17:37.784000', false, null, 'Vocabulary used in the RDF representation of SBML models.', 'MIR:00000514', '2019-06-11 14:17:37.784000', 'SBML RDF Vocabulary', false, '^[A-Za-z]+$', 'biomodels.vocabulary', 'rateRule', null, null, false, null, null, null),
        (1406, '2019-06-11 14:17:33.340000', false, null, 'The Functional Single Nucleotide Polymorphism (F-SNP) database integrates information obtained from databases about the functional effects of SNPs. These effects are predicted and indicated at the splicing, transcriptional, translational and post-translational level. In particular, users can retrieve SNPs that disrupt genomic regions known to be functional, including splice sites and transcriptional regulatory regions. Users can also identify non-synonymous SNPs that may have deleterious effects on protein structure or function, interfere with protein translation or impede post-translational modification.', 'MIR:00000496', '2019-06-11 14:17:33.340000', 'F-SNP', false, '^rs\d+$', 'fsnp', 'rs17852708', null, null, false, null, null, null),
        (1409, '2019-06-11 14:17:33.593000', false, null, 'The Homeodomain Resource is a curated collection of sequence, structure, interaction, genomic and functional information on the homeodomain family. It contains sets of curated homeodomain sequences from fully sequenced genomes, including experimentally derived homeodomain structures, homeodomain protein-protein interactions, homeodomain DNA-binding sites and homeodomain proteins implicated in human genetic disorders.', 'MIR:00000497', '2019-06-11 14:17:33.593000', 'Homeodomain Research', false, '^\d+$', 'hdr', '63', null, null, false, null, null, null),
        (1412, '2019-06-11 14:17:33.862000', false, null, 'Norine is a database dedicated to nonribosomal peptides (NRPs). In bacteria and fungi, in addition to the traditional ribosomal proteic biosynthesis, an alternative ribosome-independent pathway called NRP synthesis allows peptide production. The molecules synthesized by NRPS contain a high proportion of nonproteogenic amino acids whose primary structure is not always linear, often being more complex and containing cycles and branchings.', 'MIR:00000498', '2019-06-11 14:17:33.862000', 'NORINE', false, '^NOR\d+$', 'norine', 'NOR00681', null, null, false, null, null, null),
        (1415, '2019-06-11 14:17:34.104000', false, null, 'The Olfactory Receptor Database (ORDB) is a repository of genomics and proteomics information of olfactory receptors (ORs). It includes a broad range of chemosensory genes and proteins, that includes in addition to ORs the taste papilla receptors (TPRs), vomeronasal organ receptors (VNRs), insect olfactory receptors (IORs), Caenorhabditis elegans chemosensory receptors (CeCRs), fungal pheromone receptors (FPRs).', 'MIR:00000499', '2019-06-11 14:17:34.104000', 'Olfactory Receptor Database', false, '^\d+$', 'ordb', '8497', null, null, false, null, null, null),
        (1418, '2019-06-11 14:17:34.340000', false, null, 'OdorDB stores information related to odorous compounds, specifically identifying those that have been shown to interact with olfactory receptors', 'MIR:00000500', '2019-06-11 14:17:34.340000', 'Odor Molecules DataBase', false, '^\d+$', 'odor', '74', null, null, false, null, null, null),
        (1420, '2019-06-11 14:17:34.528000', false, null, 'Plant Protein Phosphorylation DataBase (P3DB) is a database that provides information on experimentally determined phosphorylation sites in the proteins of various plant species. This collection references plant proteins that contain phosphorylation sites.', 'MIR:00000501', '2019-06-11 14:17:34.528000', 'P3DB Protein', false, '^\d+$', 'p3db.protein', '70', null, null, false, null, null, null),
        (1423, '2019-06-11 14:17:34.763000', false, null, 'Plant Protein Phosphorylation DataBase (P3DB) is a database that provides information on experimentally determined phosphorylation sites in the proteins of various plant species. This collection references phosphorylation sites in proteins.', 'MIR:00000502', '2019-06-11 14:17:34.763000', 'P3DB Site', false, '^\d+$', 'p3db.site', '65', null, null, false, null, null, null),
        (1425, '2019-06-11 14:17:35.217000', false, null, 'The Topology Data Bank of Transmembrane Proteins (TOPDB) is a collection of transmembrane protein datasets containing experimentally derived topology information. It contains information gathered from the literature and from public databases availableon transmembrane proteins. Each record in TOPDB also contains information on the given protein sequence, name, organism and cross references to various other databases.', 'MIR:00000503', '2019-06-11 14:17:35.217000', 'TOPDB', false, '^[A-Z0-9]+$', 'topdb', 'AP00378', null, null, false, null, null, null),
        (1428, '2019-06-11 14:17:35.485000', false, null, 'The Animal Quantitative Trait Loci (QTL) database (Animal QTLdb) is designed to house publicly all available QTL and single-nucleotide polymorphism/gene association data on livestock animal species. This collection references cattle QTLs.', 'MIR:00000504', '2019-06-11 14:17:35.485000', 'Animal Genome Cattle QTL', false, '^\d+$', 'cattleqtldb', '4685', null, null, false, null, null, null),
        (1435, '2019-06-11 14:17:36.183000', false, null, 'The Animal Quantitative Trait Loci (QTL) database (Animal QTLdb) is designed to house publicly all available QTL and single-nucleotide polymorphism/gene association data on livestock animal species. This collection references sheep QTLs.', 'MIR:00000507', '2019-06-11 14:17:36.183000', 'Animal Genome Sheep QTL', false, '^\d+$', 'sheepqtldb', '19803', null, null, false, null, null, null),
        (1439, '2019-06-11 14:17:36.594000', false, null, 'The EBI Metagenomics service is an automated pipeline for the analysis and archiving of metagenomic data that aims to provide insights into the phylogenetic diversity as well as the functional and metabolic potential of a sample. Metagenomics is the study of all genomes present in any given environment without the need for prior individual identification or amplification. This collection references samples.', 'MIR:00000510', '2019-06-11 14:17:36.594000', 'MGnify Sample', false, '^[A-Z]+[0-9]+$', 'mgnify.samp', 'SRS086444', null, null, false, null, null, null),
        (1441, '2019-06-11 14:17:36.823000', false, null, 'The EGA is a service for permanent archiving and sharing of all types of personally identifiable genetic and phenotypic data resulting from biomedical research projects. The EGA contains exclusive data collected from individuals whose consent agreements authorize data release only for specific research use or to bona fide researchers. Strict protocols govern how information is managed, stored and distributed by the EGA project. This collection references ''Studies'' which are experimental investigations of a particular phenomenon, often drawn from different datasets.', 'MIR:00000511', '2019-06-11 14:17:36.823000', 'European Genome-phenome Archive Study', false, '^EGAS\d{11}$', 'ega.study', 'EGAS00000000001', null, null, false, null, null, null),
        (1444, '2019-06-11 14:17:37.233000', false, null, 'The EGA is a service for permanent archiving and sharing of all types of personally identifiable genetic and phenotypic data resulting from biomedical research projects. The EGA contains exclusive data collected from individuals whose consent agreements authorize data release only for specific research use or to bona fide researchers. Strict protocols govern how information is managed, stored and distributed by the EGA project. This collection references ''Datasets''.', 'MIR:00000512', '2019-06-11 14:17:37.233000', 'European Genome-phenome Archive Dataset', false, '^EGAD\d{11}$', 'ega.dataset', 'EGAD00000000001', null, null, false, null, null, null),
        (1456, '2019-06-11 14:17:38.379000', false, null, 'The Antibody Registry provides identifiers for antibodies used in publications. It lists commercial antibodies from numerous vendors, each assigned with a unique identifier. Unlisted antibodies can be submitted by providing the catalog number and vendor information.', 'MIR:00000516', '2019-06-11 14:17:38.379000', 'Antibody Registry', false, '^\d{6}$', 'antibodyregistry', '493771', null, null, false, null, null, null),
        (1459, '2019-06-11 14:17:38.625000', false, null, 'The Mathematical Modelling Ontology (MAMO) is a classification of the types of mathematical models used mostly in the life sciences, their variables, relationships and other relevant features.', 'MIR:00000517', '2019-06-11 14:17:38.625000', 'Mathematical Modelling Ontology', false, '^MAMO_\d{7}$', 'mamo', 'MAMO_0000026', null, null, false, null, null, null),
        (1462, '2019-06-11 14:17:38.985000', false, null, 'The Plant Environment Ontology is a set of standardized controlled vocabularies to describe various types of treatments given to an individual plant / a population or a cultured tissue and/or cell type sample to evaluate the response on its exposure. It also includes the study types, where the terms can be used to identify the growth study facility. Each growth facility such as field study, growth chamber, green house etc is a environment on its own it may also involve instances of biotic and abiotic environments as supplemental treatments used in these studies.', 'MIR:00000518', '2019-06-11 14:17:38.985000', 'Plant Environment Ontology', true, '^(P)?EO\:\d{7}$', 'eo', '0007404', null, null, false, null, null, null),
        (1466, '2019-06-11 14:17:39.487000', false, null, 'Identifiers.org Terms (idot) is an RDF vocabulary providing useful terms for describing datasets.', 'MIR:00000519', '2019-06-11 14:17:39.487000', 'Identifiers.org Terms', false, '^[A-Za-z]+$', 'idot', 'identifierPattern', null, null, false, null, null, null),
        (1470, '2019-06-11 14:17:39.906000', false, null, 'The YEast Intron Database (version 4.3) contains information on the spliceosomal introns of the yeast Saccharomyces cerevisiae. It includes expression data that relates to the efficiency of splicing relative to other processes in strains of yeast lacking nonessential splicing factors. The data are displayed on each intron page. This is an updated version of the previous dataset, which can be accessed through [MIR:00000460].', 'MIR:00000521', '2019-06-11 14:17:39.906000', 'Yeast Intron Database v4.3', false, '^[A-Z0-9]+$', 'yeastintron', 'SNR17A', null, null, false, null, null, null),
        (1472, '2019-06-11 14:17:40.104000', false, null, 'The Antibiotic Resistance Genes Database (ARDB) is a manually curated database which characterises genes involved in antibiotic resistance. Each gene and resistance type is annotated with information, including resistance profile, mechanism of action, ontology, COG and CDD annotations, as well as external links to sequence and protein databases. This collection references resistance genes.', 'MIR:00000522', '2019-06-11 14:17:40.104000', 'Antibiotic Resistance Genes Database', false, '^[A-Z_]{3}[0-9]{4,}$', 'ardb', 'CAE46076', null, null, false, null, null, null),
        (1475, '2019-06-11 14:17:40.344000', false, null, 'ProteomicsDB is an effort dedicated to expedite the identification of the human proteome and its use across the scientific community. This human proteome data is assembled primarily using information  from liquid chromatography tandem-mass-spectrometry (LC-MS/MS) experiments involving human tissues, cell lines and body fluids. Information is accessible for individual proteins, or on the basis of protein coverage on the encoding chromosome, and for peptide components of a protein. This collection provides access to individual proteins.', 'MIR:00000524', '2019-06-11 14:17:40.344000', 'ProteomicsDB Protein', false, '^\d+$', 'proteomicsdb.protein', '53504', null, null, false, null, null, null),
        (1478, '2019-06-11 14:17:40.583000', false, null, 'ProteomicsDB is an effort dedicated to expedite the identification of the human proteome and its use across the scientific community. This human proteome data is assembled primarily using information from liquid chromatography tandem-mass-spectrometry (LC-MS/MS) experiments involving human tissues, cell lines and body fluids. Information is accessible for individual proteins, or on the basis of protein coverage on the encoding chromosome, and for peptide components of a protein. This collection provides access to the peptides identified for a given protein.', 'MIR:00000525', '2019-06-11 14:17:40.583000', 'ProteomicsDB Peptide', false, '^\d+$', 'proteomicsdb.peptide', '53504', null, null, false, null, null, null),
        (1481, '2019-06-11 14:17:40.825000', false, null, 'The Human Proteome Map (HPM) portal integrates the peptide sequencing result from the draft map of the human proteome project. The project was based on LC-MS/MS by utilizing of high resolution and high accuracy Fourier transform mass spectrometry. The HPM contains direct evidence of translation of a number of protein products derived from human genes, based on peptide identifications of multiple organs/tissues and cell types from individuals with clinically defined healthy tissues. The HPM portal provides data on individual proteins, as well as on individual peptide spectra. This collection references proteins.', 'MIR:00000526', '2019-06-11 14:17:40.825000', 'Human Proteome Map Protein', false, '^\d+$', 'hpm.protein', '1968', null, null, false, null, null, null),
        (1596, '2019-06-11 14:17:51.916000', false, null, 'The HGNC (HUGO Gene Nomenclature Committee) provides an approved gene name and symbol (short-form abbreviation) for each known human gene. All approved symbols are stored in the HGNC database, and each symbol is unique. In addition, HGNC also provides a unique numerical ID to identify gene families, providing a display of curated hierarchical relationships between families.', 'MIR:00000573', '2019-06-11 14:17:51.916000', 'HGNC gene family', false, '^\d+$', 'hgnc.genefamily', '141', null, null, false, null, null, null),
        (1681, '2019-06-11 14:18:00.782000', false, null, 'The coding sequence or protein identifiers as maintained in INSDC.', 'MIR:00000606', '2019-06-11 14:18:00.782000', 'INSDC CDS', false, '^([A-Z]\d{5}|[A-Z]{2}\d{6}|[A-Z]{4}\d{8}|[A-J][A-Z]{2}\d{5})(\.\d+)?$', 'insdc.cds', 'AAA35559', null, null, false, null, null, null),
        (1483, '2019-06-11 14:17:41.032000', false, null, 'The Human Proteome Map (HPM) portal integrates the peptide sequencing result from the draft map of the human proteome project. The project was based on LC-MS/MS by utilizing of high resolution and high accuracy Fourier transform mass spectrometry. The HPM contains direct evidence of translation of a number of protein products derived from human genes, based on peptide identifications of multiple organs/tissues and cell types from individuals with clinically defined healthy tissues. The HPM portal provides data on individual proteins, as well as on individual peptide spectra. This collection references individual peptides through spectra.', 'MIR:00000527', '2019-06-11 14:17:41.032000', 'Human Proteome Map Peptide', false, '^\d+$', 'hpm.peptide', '9606117', null, null, false, null, null, null),
        (1485, '2019-06-11 14:17:41.273000', false, null, 'The DrugBank database is a bioinformatics and chemoinformatics resource that combines detailed drug (i.e. chemical, pharmacological and pharmaceutical) data with comprehensive drug target (i.e. sequence, structure, and pathway) information. This collection references target information from version 4 of the database.', 'MIR:00000528', '2019-06-11 14:17:41.273000', 'DrugBank Target v4', false, '^BE\d{7}$', 'drugbankv4.target', 'BE0000048', null, null, false, null, null, null),
        (1488, '2019-06-11 14:17:41.559000', false, null, 'ZINC is a free public resource for ligand discovery. The database contains over twenty million commercially available molecules in biologically relevant representations that may be downloaded in popular ready-to-dock formats and subsets. The Web site enables searches by structure, biological activity, physical property, vendor, catalog number, name, and CAS number.', 'MIR:00000529', '2019-06-11 14:17:41.559000', 'ZINC', false, '^(ZINC)?\d+$', 'zinc', 'ZINC1084', null, null, false, null, null, null),
        (1491, '2019-06-11 14:17:41.796000', false, null, 'FooDB is resource on food and its constituent compounds. It includes data on the compound’s nomenclature, its description, information on its structure, chemical class, its physico-chemical data, its food source(s), its color, its aroma, its taste, its physiological effect, presumptive health effects (from published studies), and concentrations in various foods. This collection references compounds.', 'MIR:00000530', '2019-06-11 14:17:41.796000', 'FooDB Compound', false, '^FDB\d+$', 'foodb.compound', 'FDB002100', null, null, false, null, null, null),
        (1763, '2019-06-11 14:18:07.777000', false, null, 'Neurovault is an online repository for statistical maps, parcellations and atlases of the brain. This collection references sets (collections) of images.', 'MIR:00000635', '2019-06-11 14:18:07.777000', 'NeuroVault Collection', false, '^[1-9][0-9]*$', 'neurovault.collection', '3304', null, null, false, null, null, null),
        (1493, '2019-06-11 14:17:41.988000', false, null, 'The purpose of the joint FDA/USP Substance Registration System (SRS) is to support health information technology initiatives by generating unique ingredient identifiers (UNIIs) for substances in drugs, biologics, foods, and devices. The UNII is a non- proprietary, free, unique, unambiguous, non semantic, alphanumeric identifier based on a substance’s molecular structure and/or descriptive information.', 'MIR:00000531', '2019-06-11 14:17:41.988000', 'UNII', false, '^[A-Z0-9]+$', 'unii', '3G6A5W338E', null, null, false, null, null, null),
        (1495, '2019-06-11 14:17:42.194000', false, null, 'The Orphanet Rare Disease ontology (ORDO) is a structured vocabulary for rare diseases, capturing relationships between diseases, genes and other relevant features which will form a useful resource for the computational analysis of rare diseases.
It integrates a nosology (classification of rare diseases), relationships (gene-disease relations, epiemological data) and connections with other terminologies (MeSH, UMLS, MedDRA), databases (OMIM, UniProtKB, HGNC, ensembl, Reactome, IUPHAR, Geantlas) and classifications (ICD10).', 'MIR:00000532', '2019-06-11 14:17:42.194000', 'Orphanet Rare Disease Ontology', false, '^Orphanet(_|:)C?\d+$', 'orphanet.ordo', 'Orphanet_C023', null, null, false, null, null, null),
        (1497, '2019-06-11 14:17:42.461000', false, null, 'Protein Affinity Reagents (PSI-PAR) provides a structured controlled vocabulary for the annotation of experiments concerned with interactions, and interactor production methods. PAR is developed by the HUPO Proteomics Standards Initiative and contains the majority of the terms from the PSI-MI controlled vocabular, as well as additional terms.', 'MIR:00000533', '2019-06-11 14:17:42.461000', 'Protein Affinity Reagents', false, '^PAR:\d+$', 'psipar', 'PAR:0116', null, null, false, null, null, null),
        (1499, '2019-06-11 14:17:42.685000', false, null, 'ClinVar archives reports of relationships among medically important variants and phenotypes. It records human variation, interpretations of the relationship specific variations to human health, and supporting evidence for each interpretation. Each ClinVar record (RCV identifier) represents an aggregated view of interpretations of  the same variation and condition from one or more submitters. Submissions for individual variation/phenotype combinations (SCV identifier) are also collected and made available separately. This collection references the Record Report, based on RCV accession.', 'MIR:00000534', '2019-06-11 14:17:42.685000', 'ClinVar Record', false, '^RCV\d+(\.\d+)?$', 'clinvar.record', 'RCV000033555.3', null, null, false, null, null, null),
        (1502, '2019-06-11 14:17:42.938000', false, null, 'MGnify is a resource for the analysis and archiving of microbiome data to help determine the taxonomic diversity and functional & metabolic potential of environmental samples. Users can submit their own data for analysis or freely browse all of the analysed public datasets held within the repository. In addition, users can request analysis of any appropriate dataset within the European Nucleotide Archive (ENA). User-submitted or ENA-derived datasets can also be assembled on request, prior to analysis.', 'MIR:00000535', '2019-06-11 14:17:42.938000', 'MGnify Project', false, '^[A-Z]+[0-9]+$', 'mgnify.proj', 'ERP004492', null, null, false, null, null, null),
        (1504, '2019-06-11 14:17:43.129000', false, null, 'The EU Clinical Trials Register contains information on clinical trials conducted in the European Union (EU), or the European Economic Area (EEA) which started after 1 May 2004.
It also includes trials conducted outside these areas if they form part of a paediatric investigation plan (PIP), or are sponsored by a marketing authorisation holder, and involve the use of a medicine in the paediatric population.', 'MIR:00000536', '2019-06-11 14:17:43.129000', 'EU Clinical Trials', false, '^\d{4}\-\d{6}\-\d{2}$', 'euclinicaltrials', '2008-005144-16', null, null, false, null, null, null),
        (1510, '2019-06-11 14:17:43.583000', false, null, 'The United States Patent and Trademark Office (USPTO) is the federal agency for granting U.S. patents and registering trademarks. As a mechanism that protects new ideas and investments in innovation and creativity, the USPTO is at the cutting edge of the nation''s technological progress and achievement.', 'MIR:00000538', '2019-06-11 14:17:43.583000', 'USPTO', false, '^(D|PP|R|T|H|X|AI)?\d+$', 'uspto', '4145692', null, null, false, null, null, null),
        (1513, '2019-06-11 14:17:43.853000', false, null, 'The Cooperative Patent Classification (CPC) is a patent classification system, developed jointly by the European Patent Office (EPO) and the United States Patent and Trademark Office (USPTO). It is based on the previous European classification system (ECLA), which itself was a version of the International Patent Classification (IPC) system. The CPC patent classification system has been used by EPO and USPTO since 1st January, 2013.', 'MIR:00000539', '2019-06-11 14:17:43.853000', 'Cooperative Patent Classification', false, '^([A-H,Y]|[A-H, Y]\d{2}|[A-H, Y]\d{2}[A-Z]|[A-H, Y]\d{2}[A-Z]\d{1,3}|[A-H, Y]\d{2}[A-Z]\d{1,3}(\/)?\d{2,})$', 'cpc', 'A01M1/026', null, null, false, null, null, null),
        (1553, '2019-06-11 14:17:47.621000', false, null, 'BiGG is a knowledgebase of Biochemically, Genetically and Genomically structured genome-scale metabolic network reconstructions. It more published genome-scale metabolic networks into a single database with a set of stardized identifiers called BiGG IDs. Genes in the BiGG models are mapped to NCBI genome annotations, and metabolites are linked to many external databases (KEGG, PubChem, and many more). This collection references model compartments.', 'MIR:00000555', '2019-06-11 14:17:47.621000', 'BiGG Compartment', false, '^[a-z_A-Z]+$', 'bigg.compartment', 'c', null, null, false, null, null, null),
        (1516, '2019-06-11 14:17:44.062000', false, null, 'GWAS Central (previously the Human Genome Variation database of Genotype-to-Phenotype information) is a database of summary level findings from genetic association studies, both large and small. It gathers datasets from public domain projects, and accepts direct data submission. It is based upon Marker information encompassing SNP and variant information from public databases, to which allele and genotype frequency data, and genetic association findings are additionally added. A Study (most generic level) contains one or more Experiments, one or more Sample Panels of test subjects, and one or more Phenotypes. This collection references a GWAS Central Study.', 'MIR:00000540', '2019-06-11 14:17:44.062000', 'GWAS Central Study', false, '^HGVST\d+$', 'gwascentral.study', 'HGVST1828', null, null, false, null, null, null),
        (1702, '2019-06-11 14:18:02.696000', false, null, 'MarRef is a manually curated marine microbial reference genome database that contains completely sequenced genomes.', 'MIR:00000613', '2019-06-11 14:18:02.696000', 'MarRef', false, '^MMP\d+.\d+$', 'mmp.ref', 'MMP3312982.2', null, null, false, null, null, null),
        (1518, '2019-06-11 14:17:44.275000', false, null, 'The Exome Aggregation Consortium (ExAC) is a coalition of investigators seeking to aggregate and harmonize exome sequencing data from a variety of large-scale sequencing projects, and to make summary data available for the wider scientific community. The data pertains to unrelated individuals sequenced as part of various disease-specific and population genetic studies and serves as a reference set of allele frequencies for severe disease studies. This collection references variant information.', 'MIR:00000541', '2019-06-11 14:17:44.275000', 'ExAC Variant', false, '^\d{1,2}\-\d+\-[GATC]\-[GATC]$', 'exac.variant', '22-46615880-T-C', null, null, false, null, null, null),
        (1521, '2019-06-11 14:17:44.511000', false, null, 'GWAS Central (previously the Human Genome Variation database of Genotype-to-Phenotype information) is a database of summary level findings from genetic association studies, both large and small. It gathers datasets from public domain projects, and accepts direct data submission. It is based upon Marker information encompassing SNP and variant information from public databases, to which allele and genotype frequency data, and genetic association findings are additionally added. A Study (most generic level) contains one or more Experiments, one or more Sample Panels of test subjects, and one or more Phenotypes. This collection references a GWAS Central Marker.', 'MIR:00000542', '2019-06-11 14:17:44.511000', 'GWAS Central Marker', false, '^HGVM\d+$', 'gwascentral.marker', 'HGVM15354', null, null, false, null, null, null),
        (1525, '2019-06-11 14:17:44.903000', false, null, 'The Library of Network-Based Cellular Signatures (LINCS) Program aims to  create a network-based understanding of biology by cataloging changes in gene expression and other cellular processes that occur when cells are exposed to a variety of perturbing agents. The LINCS cell model system can have the following cell categories: cell lines, primary cells, induced pluripotent stem cells, differentiated cells, and embryonic stem cells. The metadata contains information provided by each LINCS Data and Signature Generation Center (DSGC) and the association with a tissue or organ from which the cells were derived, in many cases are also associated to a disease.', 'MIR:00000544', '2019-06-11 14:17:44.903000', 'LINCS Cell', false, '(^LCL-\d+$)|(^LDC-\d+$)|(^ES-\d+$)|(^LSC-\d+$)|(^LPC-\d+$)', 'lincs.cell', 'LCL-2085', null, null, false, null, null, null),
        (1530, '2019-06-11 14:17:45.396000', false, null, 'The Library of Network-Based Cellular Signatures (LINCS) Program aims to create a network-based understanding of biology by cataloging changes in gene expression and other cellular processes that occur when cells are exposed to a variety of perturbing agents. The LINCS small molecule collection is used as perturbagens in LINCS experiments. The small molecule metadata includes substance-specific batch information provided by each LINCS Data and Signature Generation Center (DSGC).', 'MIR:00000546', '2019-06-11 14:17:45.396000', 'LINCS Small Molecule', false, '^LSM-\d+$', 'lincs.smallmolecule', 'LSM-6306', null, null, false, null, null, null),
        (1533, '2019-06-11 14:17:45.691000', false, null, 'The Exome Aggregation Consortium (ExAC) is a coalition of investigators seeking to aggregate and harmonize exome sequencing data from a variety of large-scale sequencing projects, and to make summary data available for the wider scientific community. The data pertains to unrelated individuals sequenced as part of various disease-specific and population genetic studies and serves as a reference set of allele frequencies for severe disease studies. This collection references transcript information.', 'MIR:00000547', '2019-06-11 14:17:45.691000', 'ExAC Transcript', false, '^ENST\d{11}$', 'exac.transcript', 'ENST00000407236', null, null, false, null, null, null),
        (1535, '2019-06-11 14:17:45.890000', false, null, 'The Exome Aggregation Consortium (ExAC) is a coalition of investigators seeking to aggregate and harmonize exome sequencing data from a variety of large-scale sequencing projects, and to make summary data available for the wider scientific community. The data pertains to unrelated individuals sequenced as part of various disease-specific and population genetic studies and serves as a reference set of allele frequencies for severe disease studies. This collection references gene information.', 'MIR:00000548', '2019-06-11 14:17:45.890000', 'ExAC Gene', false, '^ENSG\d{11}$', 'exac.gene', 'ENSG00000169174', null, null, false, null, null, null),
        (1542, '2019-06-11 14:17:46.612000', false, null, 'UniPathway is a manually curated resource of enzyme-catalyzed and spontaneous chemical reactions. It provides a hierarchical representation of metabolic pathways and a controlled vocabulary for pathway annotation in UniProtKB. UniPathway data are cross-linked to existing metabolic resources such as ChEBI/Rhea, KEGG and MetaCyc. This collection references compounds.', 'MIR:00000551', '2019-06-11 14:17:46.612000', 'UniPathway Compound', false, '^UPC\d{5}$', 'unipathway.compound', 'UPC04349', null, null, false, null, null, null),
        (1545, '2019-06-11 14:17:46.875000', false, null, 'This cooperative effort, which includes Fellowship for Interpretation of Genomes (FIG), Argonne National Laboratory, and the University of Chicago, focuses on the development of the comparative genomics environment called the SEED. It is a framework to support comparative analysis and annotation of genomes, and the development of curated genomic data (annotation). Curation is performed at the level of subsystems by an expert annotator, across many genomes, and not on a gene by gene basis. This collection references subsystems.', 'MIR:00000552', '2019-06-11 14:17:46.875000', 'SEED Subsystem', false, '^\w+$', 'seed', 'Biotin_biosynthesis', null, null, false, null, null, null),
        (1548, '2019-06-11 14:17:47.133000', false, null, 'This cooperative effort, which includes Fellowship for Interpretation of Genomes (FIG), Argonne National Laboratory, and the University of Chicago, focuses on the development of the comparative genomics environment called the SEED. It is a framework to support comparative analysis and annotation of genomes, and the development of curated genomic data (annotation). Curation is performed at the level of subsystems by an expert annotator, across many genomes, and not on a gene by gene basis. This collection references subsystems.', 'MIR:00000553', '2019-06-11 14:17:47.133000', 'SEED Compound', false, '^cpd\d+$', 'seed.compound', 'cpd15380', null, null, false, null, null, null),
        (1550, '2019-06-11 14:17:47.362000', false, null, 'BiGG is a knowledgebase of Biochemically, Genetically and Genomically structured genome-scale metabolic network reconstructions. It more published genome-scale metabolic networks into a single database with a set of stardized identifiers called BiGG IDs. Genes in the BiGG models are mapped to NCBI genome annotations, and metabolites are linked to many external databases (KEGG, PubChem, and many more). This collection references individual models.', 'MIR:00000554', '2019-06-11 14:17:47.362000', 'BiGG Model', false, '^[a-z_A-Z0-9]+$', 'bigg.model', 'iECABU_c1320', null, null, false, null, null, null),
        (1676, '2019-06-11 14:18:00.311000', false, null, 'The GDC Data Portal is a robust data-driven platform that allows cancer researchers and bioinformaticians to search and download cancer data for analysis.', 'MIR:00000604', '2019-06-11 14:18:00.311000', 'Genomic Data Commons Data Portal', false, '^[a-z0-9]{8}-[a-z0-9]{4}-[a-z0-9]{4}-[a-z0-9]{4}-[a-z0-9]{12}$', 'gdc', 'ae8c77fe-e6c8-44d5-8265-4a38c637bbef', null, null, false, null, null, null),
        (1537, '2019-06-11 14:17:46.087000', false, null, 'Wikidata is a collaboratively edited knowledge base operated by the Wikimedia Foundation. It is intended to provide a common source of certain types of data which can be used by Wikimedia projects such as Wikipedia. Wikidata functions as a document-oriented database, centred on individual items. Items represent topics, for which basic information is stored that identifies each topic.', 'MIR:00000549', '2020-11-30 14:15:44.647000', 'Wikidata', false, '^(Q|P)\d+$', 'wikidata', 'Q2207226', null, null, false, null, null, null),
        (1705, '2019-06-11 14:18:02.934000', false, null, 'MarDB includes all sequenced marine microbial genomes regardless of level of completeness.', 'MIR:00000614', '2019-06-11 14:18:02.934000', 'MarDB', false, '^MMP\d+.\d+$', 'mmp.db', 'MMP02954345.1', null, null, false, null, null, null),
        (1557, '2019-06-11 14:17:48.059000', false, null, 'BiGG is a knowledgebase of Biochemically, Genetically and Genomically structured genome-scale metabolic network reconstructions. It more published genome-scale metabolic networks into a single database with a set of stardized identifiers called BiGG IDs. Genes in the BiGG models are mapped to NCBI genome annotations, and metabolites are linked to many external databases (KEGG, PubChem, and many more). This collection references reactions.', 'MIR:00000557', '2019-06-11 14:17:48.059000', 'BiGG Reaction', false, '^[a-z_A-Z0-9]+$', 'bigg.reaction', '13GS', null, null, false, null, null, null),
        (1561, '2019-06-11 14:17:48.502000', false, null, 'The Unified Medical Language System is a repository of biomedical vocabularies. Vocabularies integrated in the UMLS Metathesaurus include the NCBI taxonomy, Gene Ontology, the Medical Subject Headings (MeSH), OMIM and the Digital Anatomist Symbolic Knowledge Base. UMLS concepts are not only inter-related, but may also be linked to external resources such as GenBank.', 'MIR:00000559', '2019-06-11 14:17:48.502000', 'UMLS', false, '^C\d+$', 'umls', 'C0021390', null, null, false, null, null, null),
        (1567, '2019-06-11 14:17:49.171000', false, null, 'miRTarBase is a database of miRNA-target interactions (MTIs), collected manually from relevant literature, following Natural Language Processing of the text to identify research articles related to functional studies of miRNAs. Generally, the collected MTIs are validated experimentally by reporter assay, western blot, microarray and next-generation sequencing experiments.', 'MIR:00000562', '2019-06-11 14:17:49.171000', 'miRTarBase', false, '^MIRT\d{6}$', 'mirtarbase', 'MIRT000002', null, null, false, null, null, null),
        (1570, '2019-06-11 14:17:49.428000', false, null, 'The Medical Dictionary for Regulatory Activities (MedDRA) was developed by the International Council for Harmonisation of Technical Requirements for Registration of Pharmaceuticals for Human Use (ICH)to provide a standardised medical terminology to facilitate sharing of regulatory information internationally for medical products used by humans. It is used within regulatory processes, safety monitoring, as well as for marketing activities. Products covered by the scope of MedDRA include pharmaceuticals, biologics, vaccines and drug-device combination products. The MedDRA dictionary is organized by System Organ Class (SOC), divided into High-Level Group Terms (HLGT), High-Level Terms (HLT), Preferred Terms (PT) and finally into Lowest Level Terms (LLT).', 'MIR:00000563', '2019-06-11 14:17:49.428000', 'MedDRA', false, '^\d+$', 'meddra', '10015919', null, null, false, null, null, null),
        (1572, '2019-06-11 14:17:49.634000', false, null, 'DASHR reports the annotation, expression and evidence for specific RNA processing (cleavage specificity scores/entropy) of human sncRNA genes, precursor and mature sncRNA products across different human tissues and cell types. DASHR integrates information from multiple existing annotation resources for small non-coding RNAs, including microRNAs (miRNAs), Piwi-interacting (piRNAs), small nuclear (snRNAs), nucleolar (snoRNAs), cytoplasmic (scRNAs), transfer (tRNAs), tRNA fragments (tRFs), and ribosomal RNAs (rRNAs). These datasets were obtained from non-diseased human tissues and cell types and were generated for studying or profiling small non-coding RNAs. This collection references RNA records.', 'MIR:00000564', '2019-06-11 14:17:49.634000', 'DASHR', false, '^(hsa-(let|mir)-\w+(-\w+)?)|(piR-\d+)|(chr\w+.tRNA\d+-\w+)|(chr\w+.tRNA\d+-\w+-tRF\d)|((SNORD|SNORA|ACA|HBII|HBI|U)(-)?\w+)|(HY\d\+(-L\d+)?)|((LSU|SSU|5S)(-rRNA_Hsa)?(-L\d+)?)$', 'dashr', 'hsa-mir-200a', null, null, false, null, null, null),
        (1575, '2019-06-11 14:17:49.866000', false, null, 'DASHR reports the annotation, expression and evidence for specific RNA processing (cleavage specificity scores/entropy) of human sncRNA genes, precursor and mature sncRNA products across different human tissues and cell types. DASHR integrates information from multiple existing annotation resources for small non-coding RNAs, including microRNAs (miRNAs), Piwi-interacting (piRNAs), small nuclear (snRNAs), nucleolar (snoRNAs), cytoplasmic (scRNAs), transfer (tRNAs), tRNA fragments (tRFs), and ribosomal RNAs (rRNAs). These datasets were obtained from non-diseased human tissues and cell types and were generated for studying or profiling small non-coding RNAs. This collection references RNA expression.', 'MIR:00000565', '2019-06-11 14:17:49.866000', 'DASHR expression', false, '^(hsa-(let|mir)-\w+(-\w+)?)|(piR-\d+)|(chr\w+.tRNA\d+-\w+)|(chr\w+.tRNA\d+-\w+-tRF\d)|((SNORD|SNORA|ACA|HBII|HBI|U)(-)?\w+)|(HY\d\+(-L\d+)?)|((LSU|SSU|5S)(-rRNA_Hsa)?(-L\d+)?)$', 'dashr.expression', 'hsa-mir-200a', null, null, false, null, null, null),
        (1577, '2019-06-11 14:17:50.083000', false, null, 'The spectra hash code (SPLASH) is a unique and non-proprietary identifier for spectra, and is independent of how the spectra were acquired or processed. It can be easily calculated for a wide range of spectra, including Mass spectroscopy,  infrared spectroscopy, ultraviolet and nuclear magnetic resonance.', 'MIR:00000566', '2019-06-11 14:17:50.083000', 'SPLASH', false, '^splash\d[A-Z-a-z0-9]-[A-Za-z0-9]+-[A-Za-z0-9]+$', 'splash', 'splash10-0zq2000000-77302b0326a418630a84', null, null, false, null, null, null),
        (1563, '2019-06-11 14:17:48.752000', false, null, 'MeSH (Medical Subject Headings) is the National Library of Medicine''s controlled vocabulary thesaurus. It consists of sets of terms naming descriptors in a hierarchical structure that permits searching at various levels of specificity. This thesaurus is used by NLM for indexing articles from biomedical journals, cataloguing of books, documents, etc.', 'MIR:00000560', '2020-04-21 17:40:51.334000', 'MeSH', false, '^(C|D)\d{6,9}$', 'mesh', 'C000100', null, null, false, null, null, null),
        (1580, '2019-06-11 14:17:50.332000', false, null, 'MetaNetX/MNXref integrates various information from genome-scale metabolic network reconstructions such as information on reactions, metabolites and compartments. This information undergoes a reconciliation process to minimise for discrepancies between different data sources, and makes the data accessible under a common namespace. This collection references chemical or metabolic components.', 'MIR:00000567', '2021-02-26 09:36:59.253000', 'MetaNetX chemical', false, '^(MNXM\d+|BIOMASS|WATER)$', 'metanetx.chemical', 'MNXM1723', null, null, false, null, null, null),
        (1583, '2019-06-11 14:17:50.605000', false, null, 'MetaNetX/MNXref integrates various information from genome-scale metabolic network reconstructions such as information on reactions, metabolites and compartments. This information undergoes a reconciliation process to minimise for discrepancies between different data sources, and makes the data accessible under a common namespace. This collection references reactions.', 'MIR:00000568', '2021-02-26 09:43:13.847000', 'MetaNetX reaction', false, '^(MNXR\d+|EMPTY)$', 'metanetx.reaction', 'MNXR101574', null, null, false, null, null, null),
        (1565, '2019-06-11 14:17:48.947000', false, null, 'The Electron Microscopy Data Bank (EMDB) is a public repository for electron microscopy density maps of macromolecular complexes and subcellular structures. It covers a variety of techniques, including single-particle analysis, electron tomography, and electron (2D) crystallography. The EMDB map distribution format follows the CCP4 definition, which is widely recognized by software packages used by the structural biology community.', 'MIR:00000561', '2023-02-20 08:55:04.411000', 'Electron Microscopy Data Bank', false, '^EMD-\d{4,5}$', 'emdb', 'EMD-1001', null, null, false, null, null, null),
        (1688, '2019-06-11 14:18:01.543000', false, null, 'GlyTouCan is the single worldwide registry of glycan (carbohydrate sugar chain) data.', 'MIR:00000608', '2019-06-11 14:18:01.543000', 'GlyTouCan', false, '^G[0-9]{5}[A-Z]{2}$', 'glytoucan', 'G00054MO', null, null, false, null, null, null),
        (1587, '2019-06-11 14:17:51.017000', false, null, 'UniPathway is a manually curated resource of enzyme-catalyzed and spontaneous chemical reactions. It provides a hierarchical representation of metabolic pathways and a controlled vocabulary for pathway annotation in UniProtKB. UniPathway data are cross-linked to existing metabolic resources such as ChEBI/Rhea, KEGG and MetaCyc. This collection references individual reactions.', 'MIR:00000570', '2019-06-11 14:17:51.017000', 'UniPathway Reaction', false, '^UCR\d{5}$', 'unipathway.reaction', 'UCR00226', null, null, false, null, null, null),
        (1589, '2019-06-11 14:17:51.237000', false, null, 'The Human Phenotype Ontology (HPO) aims to provide a standardized vocabulary of phenotypic abnormalities encountered in human disease. Each term in the HPO describes a phenotypic abnormality, such as atrial septal defect. The HPO is currently being developed using the medical literature, Orphanet, DECIPHER, and OMIM.', 'MIR:00000571', '2019-06-11 14:17:51.237000', 'Human Phenotype Ontology', true, '^HP:\d{7}$', 'hp', '0000118', null, null, false, null, null, null),
        (1598, '2019-06-11 14:17:52.138000', false, null, 'The MDM (Medical Data Models) Portal is a meta-data registry for creating, analysing, sharing and reusing medical forms. Electronic forms are central in numerous processes involving data, including the collection of data through electronic health records (EHRs), Electronic Data Capture (EDC), and as case report forms (CRFs) for clinical trials. The MDM Portal provides medical forms in numerous export formats, facilitating the sharing and reuse of medical data models and exchange between information systems.', 'MIR:00000574', '2019-06-11 14:17:52.138000', 'MDM', false, '^\d+$', 'mdm', '4776', null, null, false, null, null, null),
        (1601, '2019-06-11 14:17:52.483000', false, null, 'ProbOnto, is an ontology-based knowledge base of probability distributions, featuring uni- and multivariate distributions with their defining functions, characteristics, relationships and reparameterisation formulae.  It can be used for annotation of models, facilitating the encoding of distribution-based models, related functions and quantities.', 'MIR:00000575', '2019-06-11 14:17:52.483000', 'ProbOnto', false, '^PROB_c\d+$', 'probonto', 'PROB_c0000005', null, null, false, null, null, null),
        (1603, '2019-06-11 14:17:52.731000', false, null, 'APID (Agile Protein Interactomes DataServer) provides information on the protein interactomes of numerous  organisms, based on the integration of known experimentally validated protein-protein physical interactions (PPIs). Interactome data includes a report on  quality levels and coverage over the proteomes for each organism included. APID integrates PPIs from primary databases of molecular interactions (BIND, BioGRID, DIP, HPRD, IntAct, MINT) and also from experimentally resolved 3D structures (PDB) where more than two distinct proteins have been identified. This collection references protein interactors, through a UniProt identifier.', 'MIR:00000576', '2019-06-11 14:17:52.731000', 'APID Interactomes', false, '^([A-N,R-Z][0-9]([A-Z][A-Z, 0-9][A-Z, 0-9][0-9]){1,2})|([O,P,Q][0-9][A-Z, 0-9][A-Z, 0-9][A-Z, 0-9][0-9])(\.\d+)?$', 'apid.interactions', 'P01116', null, null, false, null, null, null),
        (1765, '2019-06-11 14:18:07.981000', false, null, 'The Virtual Metabolic Human (VMH) is a resource that combines human and gut microbiota metabolism with nutrition and disease.', 'MIR:00000636', '2019-06-11 14:18:07.981000', 'VMH metabolite', false, '[a-zA-Z0-9_\(\_\)\[\]]+', 'vmhmetabolite', 'h2o', null, null, false, null, null, null),
        (1606, '2019-06-11 14:17:53.021000', false, null, 'STOREDB database is a repository for data used by the international radiobiology community, archiving and sharing primary data outputs from research on low dose radiation. It also provides a directory of bioresources and databases for radiobiology projects containing information and materials that investigators are willing to share. STORE supports the creation of a low dose radiation research commons.', 'MIR:00000577', '2019-06-11 14:17:53.021000', 'STOREDB', false, '^STOREDB:(STUDY|FILE|DATASET)\d+$', 'storedb', 'STOREDB:STUDY1040', null, null, false, null, null, null),
        (1609, '2019-06-11 14:17:53.298000', false, null, 'Kyoto Encyclopedia of Genes and Genomes (KEGG) is a database resource for understanding high-level functions and utilities of the biological system, such as the cell, the organism and the ecosystem, from molecular-level information, especially large-scale molecular datasets generated by genome sequencing and other high-throughput experimental technologies.', 'MIR:00000578', '2019-06-11 14:17:53.298000', 'Kyoto Encyclopedia of Genes and Genomes', false, '^([CHDEGTMKR]\d+)|(\w+:[\w\d\.-]*)|([a-z]{3,5})|(\w{2,4}\d{5})$', 'kegg', 'hsa00190', null, null, false, null, null, null),
        (1611, '2019-06-11 14:17:53.641000', false, null, 'The Plant TF database (PlantTFDB) systematically identifies transcription factors for plant species. It includes annotation for identified TFs, including information on expression, regulation, interaction, conserved elements, phenotype information. It also provides curated descriptions and cross-references to other life science databases, as well as identifying evolutionary relationship among identified factors.', 'MIR:00000579', '2019-06-11 14:17:53.641000', 'Plant Transcription Factor Database', false, '^[A-Z][a-z]{2}_([A-Za-z]{3}[0-9]{6})|([A-Za-z0-9\._\-#]*)$', 'planttfdb', 'Ath_AT1G01030.1', null, null, false, null, null, null),
        (1614, '2019-06-11 14:17:53.926000', false, null, 'The Mammalian Phenotype Ontology (MP) classifies and organises phenotypic information related to the mouse and other mammalian species. This ontology has been applied to mouse phenotype descriptions in various databases allowing comparisons of data from diverse mammalian sources. It can facilitate in the identification of appropriate experimental disease models, and aid in the discovery of candidate disease genes and molecular signaling pathways.', 'MIR:00000580', '2019-06-11 14:17:53.926000', 'Mammalian Phenotype Ontology', true, '^MP:\d{7}$', 'mp', '0005452', null, null, false, null, null, null),
        (1618, '2019-06-11 14:17:54.476000', false, null, 'The World Register of Marine Species (WoRMS) provides an authoritative and comprehensive list of names of marine organisms. It includes synonyms for valid taxonomic names allowing a more complete interpretation of taxonomic literature. The content of WoRMS is administered by taxonomic experts.', 'MIR:00000581', '2019-06-11 14:17:54.476000', 'World Register of Marine Species', false, '^\d+$', 'worms', '146421', null, null, false, null, null, null),
        (1621, '2019-06-11 14:17:54.753000', false, null, 'MultiCellDS is data standard for multicellular simulation, experimental, and clinical data. A collection groups one or more individual uniquely identified cell lines, snapshots, or collections. Primary uses are times series (collections of snapshots), patient cohorts (collections of cell lines), and studies (collections of time series collections).', 'MIR:00000582', '2019-06-11 14:17:54.753000', 'MultiCellDS collection', false, '^MCDS_C_[a-zA-Z0-9]{1,10}$', 'multicellds.collection', 'MCDS_C_0000000001', null, null, false, null, null, null),
        (1624, '2019-06-11 14:17:55.012000', false, null, 'MultiCellDS is data standard for multicellular simulation, experimental, and clinical data. A digital snapshot is a single-time output of the microenvironment (including basement membranes and the vascular network), any cells contained within, and essential metadata. Cells may include phenotypic data.', 'MIR:00000583', '2019-06-11 14:17:55.012000', 'MultiCellDS Digital snapshot', false, '^MCDS_S_[a-zA-Z0-9]{1,10}$', 'multicellds.snapshot', 'MCDS_S_0000000001', null, null, false, null, null, null),
        (1626, '2019-06-11 14:17:55.320000', false, null, 'MultiCellDS is data standard for multicellular simulation, experimental, and clinical data. A digital cell line is a hierarchical organization of quantitative phenotype data for a single biological cell line, including the microenvironmental context of the measurements and essential metadata.', 'MIR:00000584', '2019-06-11 14:17:55.320000', 'MultiCellDS Digital Cell Line', false, '^MCDS_L_[a-zA-Z0-9]{1,10}$', 'multicellds.cell_line', 'MCDS_L_0000000001', null, null, false, null, null, null),
        (1679, '2019-06-11 14:18:00.566000', false, null, 'The purpose of the OMIT ontology is to establish data exchange standards and common data elements in the microRNA (miR) domain. Biologists (cell biologists in particular) and bioinformaticians can make use of OMIT to leverage emerging semantic technologies in knowledge acquisition and discovery for more effective identification of important roles performed by miRs in humans'' various diseases and biological processes (usually through miRs'' respective target genes).', 'MIR:00000605', '2019-06-11 14:18:00.566000', 'OMIT', false, '^\d{7}$', 'omit', '0005506', null, null, false, null, null, null),
        (1628, '2019-06-11 14:17:55.541000', false, null, 'E-cyanobacterium.org is a web-based platform for public sharing, annotation, analysis, and visualisation of dynamical models and wet-lab experiments related to cyanobacteria. It allows models to be represented at different levels of abstraction — as biochemical reaction networks or ordinary differential equations.It provides concise mappings of mathematical models to a formalised consortium-agreed biochemical description, with the aim of connecting the world of biological knowledge with benefits of mathematical description of dynamic processes. This collection references entities.', 'MIR:00000585', '2019-06-11 14:17:55.541000', 'E-cyanobacterium entity', false, '^\d+$', 'ecyano.entity', '23', null, null, false, null, null, null),
        (1631, '2019-06-11 14:17:55.864000', false, null, 'E-cyanobacterium.org is a web-based platform for public sharing, annotation, analysis, and visualisation of dynamical models and wet-lab experiments related to cyanobacteria. It allows models to be represented at different levels of abstraction — as biochemical reaction networks or ordinary differential equations.It provides concise mappings of mathematical models to a formalised consortium-agreed biochemical description, with the aim of connecting the world of biological knowledge with benefits of mathematical description of dynamic processes. This collection references models.', 'MIR:00000586', '2019-06-11 14:17:55.864000', 'E-cyanobacterium model', false, '^\d+$', 'ecyano.model', '26', null, null, false, null, null, null),
        (1707, '2019-06-11 14:18:03.141000', false, null, 'MarCat is a gene (protein) catalogue of uncultivable and cultivable marine genes and proteins derived from metagenomics samples.', 'MIR:00000615', '2019-06-11 14:18:03.141000', 'MarCat', false, '^MMP\d+.\d+$', 'mmp.cat', 'MMP743597.11', null, null, false, null, null, null),
        (1633, '2019-06-11 14:17:56.089000', false, null, 'E-cyanobacterium.org is a web-based platform for public sharing, annotation, analysis, and visualisation of dynamical models and wet-lab experiments related to cyanobacteria. It allows models to be represented at different levels of abstraction — as biochemical reaction networks or ordinary differential equations.It provides concise mappings of mathematical models to a formalised consortium-agreed biochemical description, with the aim of connecting the world of biological knowledge with benefits of mathematical description of dynamic processes. This collection references rules.', 'MIR:00000587', '2019-06-11 14:17:56.089000', 'E-cyanobacterium rule', false, '^\d+$', 'ecyano.rule', '56', null, null, false, null, null, null),
        (1635, '2019-06-11 14:17:56.343000', false, null, 'The Library of Network-Based Cellular Signatures (LINCS) Program aims to create a network-based understanding of biology by cataloguing changes in gene expression and other cellular processes that occur when cells are exposed to perturbing agents. The data is organized and available as datasets, each including experimental data, metadata and a description of the dataset and assay. The dataset group comprises datasets for the same experiment but with different data level results (data processed to a different level).', 'MIR:00000588', '2019-06-11 14:17:56.343000', 'LINCS Data', false, '^[EL]D[SG]-\d+$', 'lincs.data', 'LDS-1110', null, null, false, null, null, null),
        (1638, '2019-06-11 14:17:56.660000', false, null, 'AGRICOLA (AGRICultural OnLine Access) serves as the catalog and index to the collections of the National Agricultural Library, as well as a primary public source for world-wide access to agricultural information. The database covers materials in all formats and periods, including printed works from as far back as the 15th century.', 'MIR:00000589', '2019-06-11 14:17:56.660000', 'AGRICOLA', false, '^\d+$', 'agricola', '50018', null, null, false, null, null, null),
        (1641, '2019-06-11 14:17:56.919000', false, null, 'The PSI-Mass Spectrometry (MS) CV contains all the terms used in the PSI MS-related data standards. The CV contains a logical hierarchical structure to ensure ease of maintenance and the development of software that makes use of complex semantics. The CV contains terms required for a complete description of an MS analysis pipeline used in proteomics, including sample labeling, digestion enzymes, instrumentation parts and parameters, software used for identification and quantification of peptides/proteins and the parameters and scores used to determine their significance.', 'MIR:00000590', '2019-06-11 14:17:56.919000', 'Mass Spectrometry Controlled Vocabulary', true, '^MS:\d{7}$', 'ms', '1000001', null, null, false, null, null, null),
        (1650, '2019-06-11 14:17:57.806000', false, null, 'International coverage of the world''s leading research organisations, indexing 92% of funding allocated globally.', 'MIR:00000593', '2019-06-11 14:17:57.806000', 'GRID', false, '^grid\.[0-9]+\.[a-f0-9]{1,2}$', 'grid', 'grid.225360.0', null, null, false, null, null, null),
        (1653, '2019-06-11 14:17:58.068000', false, null, 'MedGen is a portal for information about conditions and phenotypes related to Medical Genetics. Terms from multiple sources are aggregated into concepts, each of which is assigned a unique identifier and a preferred name and symbol. The core content of the record may include names, identifiers used by other databases, mode of inheritance, clinical features, and map location of the loci affecting the disorder.', 'MIR:00000594', '2019-06-11 14:17:58.068000', 'MedGen', false, '^[CN]*\d{4,7}$', 'medgen', '760050', null, null, false, null, null, null),
        (1655, '2019-06-11 14:17:58.273000', false, null, 'ClinVar archives reports of relationships among medically important variants and phenotypes. It records human variation, interpretations of the relationship specific variations to human health, and supporting evidence for each interpretation. Each ClinVar record (RCV identifier) represents an aggregated view of interpretations of the same variation and condition from one or more submitters. Submissions for individual variation/phenotype combinations (SCV identifier) are also collected and made available separately. This collection references submissions, and is based on SCV accession.', 'MIR:00000595', '2019-06-11 14:17:58.273000', 'ClinVar Submission', false, '^SCV\d+(\.\d+)?$', 'clinvar.submission', 'SCV000151292', null, null, false, null, null, null),
        (1657, '2019-06-11 14:17:58.490000', false, null, 'ClinVar archives reports of relationships among medically important variants and phenotypes. It records human variation, interpretations of the relationship specific variations to human health, and supporting evidence for each interpretation. Each ClinVar record (RCV identifier) represents an aggregated view of interpretations of the same variation and condition from one or more submitters. Submissions for individual variation/phenotype combinations (SCV identifier) are also collected and made available separately. This collection references the Variant identifier.', 'MIR:00000596', '2019-06-11 14:17:58.490000', 'ClinVar Variant', false, '^\d+$', 'clinvar', '12345', null, null, false, null, null, null),
        (1664, '2019-06-11 14:17:59.221000', false, null, 'The Identifiers.org registry contains registered namespace and provider prefixes with associated access URIs for a large number of high quality data collections. These prefixes are used in web resolution of compact identifiers of the form “PREFIX:ACCESSION” or "PROVIDER/PREFIX:ACCESSION” commonly used to specify bioinformatics and other data resources.', 'MIR:00000599', '2019-06-11 14:17:59.221000', 'Identifiers.org Registry', true, '^MIR:\d{8}$', 'mir', '00100037', null, null, false, null, null, null),
        (1669, '2019-06-11 14:17:59.699000', false, null, 'COSMIC is a comprehensive global resource for information on somatic mutations in human cancer, combining curation of the scientific literature with tumor resequencing data from the Cancer Genome Project at the Sanger Institute, U.K. This collection references genes.', 'MIR:00000601', '2019-06-11 14:17:59.699000', 'COSMIC Gene', false, '^[A-Z0-9]+$', 'cosmic', 'BRAF', null, null, false, null, null, null),
        (1671, '2019-06-11 14:17:59.890000', false, null, 'The database of Genotypes and Phenotypes (dbGaP) archives and distributes the results of studies that have investigated the interaction of genotype and phenotype.', 'MIR:00000602', '2019-06-11 14:17:59.890000', 'dbGaP', false, '^phs[0-9]{6}(.v\d+.p\d+)?$', 'dbgap', 'phs000768.v2.p1', null, null, false, null, null, null),
        (1673, '2019-06-11 14:18:00.081000', false, null, 'An ontology of information entities, originally driven by work by the Ontology of Biomedical Investigation (OBI) digital entity and realizable information entity branch.', 'MIR:00000603', '2019-06-11 14:18:00.081000', 'Information Artifact Ontology', false, '^\d{7}$', 'iao', '0000030', null, null, false, null, null, null),
        (1696, '2019-06-11 14:18:02.239000', false, null, 'DataONE provides infrastructure facilitating long-term access to scientific research data of relevance to the earth sciences.', 'MIR:00000611', '2019-06-11 14:18:02.239000', 'DataONE', false, '\S+', 'd1id', '00030692-0FE1-4A1B-955E-A2E55D659267', null, null, false, null, null, null),
        (1715, '2019-06-11 14:18:03.826000', false, null, 'NASA''s GeneLab gathers spaceflight genomic data, RNA and protein expression, and metabolic profiles, interfaces with existing databases for expanded research, will offer tools to conduct data analysis, and is in the process of creating a place online where scientists, researchers, teachers and students can connect with their peers, share their results, and communicate with NASA.', 'MIR:00000618', '2019-06-11 14:18:03.826000', 'NASA GeneLab', false, '^GLDS-\d+$', 'ngl', 'GLDS-141', null, null, false, null, null, null),
        (1699, '2019-06-11 14:18:02.470000', false, null, 'CATH is a classification of protein structural domains. We group protein domains into superfamilies when there is sufficient evidence they have diverged from a common ancestor. CATH can be used to predict structural and functional information directly from protein sequence.', 'MIR:00000612', '2021-02-01 16:12:25.234000', 'CATH Protein Structural Domain Superfamily', false, '^[1-6]\.[0-9]+\.[0-9]+\.[0-9]+$', 'cath', '1.10.8.10', null, null, false, null, null, null),
        (1691, '2019-06-11 14:18:01.783000', false, null, 'MetaCyc is a curated database of experimentally elucidated metabolic pathways from all domains of life. MetaCyc contains 2526 pathways from 2844 different organisms. MetaCyc contains pathways involved in both primary and secondary metabolism, as well as associated metabolites, reactions, enzymes, and genes. The goal of MetaCyc is to catalog the universe of metabolism by storing a representative sample of each experimentally elucidated pathway.', 'MIR:00000609', '2021-04-17 19:53:03.023000', 'MetaCyc Compound', false, '^[A-Za-z0-9+_.%-:]+$', 'metacyc.compound', 'CPD-10330', null, null, false, null, null, null),
        (1773, '2019-06-11 14:18:08.710000', false, null, 'nmrCV is a controlled vocabulary to deliver standardized descriptors for the open mark-up language for NMR raw and spectrum data, sanctioned by the metabolomics standards initiative msi.', 'MIR:00000639', '2019-06-11 14:18:08.710000', 'Nuclear Magnetic Resonance Controlled Vocabulary', true, '^NMR:\d+$', 'nmr', '1000003', null, null, false, null, null, null),
        (1694, '2019-06-11 14:18:02.043000', false, null, 'MetaCyc is a curated database of experimentally elucidated metabolic pathways from all domains of life. MetaCyc contains 2526 pathways from 2844 different organisms. MetaCyc contains pathways involved in both primary and secondary metabolism, as well as associated metabolites, reactions, enzymes, and genes. The goal of MetaCyc is to catalog the universe of metabolism by storing a representative sample of each experimentally elucidated pathway.', 'MIR:00000610', '2021-04-17 19:55:01.284000', 'MetaCyc Reaction', false, '^[A-Za-z0-9+_.%-:]+$', 'metacyc.reaction', 'RXN-14904', null, null, false, null, null, null),
        (1709, '2019-06-11 14:18:03.353000', false, null, 'Tool and data services registry.', 'MIR:00000616', '2023-01-05 19:09:45.468000', 'BioTools', false, '^[-A-Za-z0-9\_]*$', 'biotools', 'uniprotkb', null, null, false, null, null, null),
        (1662, '2019-06-11 14:17:59.000000', false, null, 'The Cellosaurus is a knowledge resource on cell lines. It attempts to describe all cell lines used in biomedical research. Its scope includes: Immortalized cell lines; naturally immortal cell lines (example: stem cell lines); finite life cell lines when those are distributed and used widely; vertebrate cell line with an emphasis on human, mouse and rat cell lines; and invertebrate (insects and ticks) cell lines. Its scope does not include primary cell lines (with the exception of the finite life cell lines described above) and plant cell lines.', 'MIR:00000598', '2023-01-09 15:31:03.506000', 'Cellosaurus', false, '^CVCL_[A-Z0-9]{4}(\.txt)?$', 'cellosaurus', 'CVCL_0030', null, null, false, null, null, null),
        (1718, '2019-06-11 14:18:04.072000', false, null, 'Endogenous retroviruses (ERVs) are common in vertebrate genomes; a typical mammalian genome contains tens to hundreds of thousands of ERV elements. Most ERVs are evolutionarily old and have accumulated multiple mutations, playing important roles in physiology and disease processes. The Human Endogenous Retrovirus Database (hERV) is compiled from the human genome nucleotide sequences obtained from Human Genome Projects, and screens those sequences for hERVs, whilst continuously improving classification and characterization of retroviral families. It provides access to individual reconstructed HERV elements, their sequence, structure and features.', 'MIR:00000619', '2019-06-11 14:18:04.072000', 'Human Endogenous Retrovirus Database', false, '^[A-Za-z0-9\-\_]+$', 'erv', 'THE1B', null, null, false, null, null, null),
        (1721, '2019-06-11 14:18:04.316000', false, null, 'The Natural Product-Drug Interaction Research Data Repository, a publicly accessible database where researchers can access scientific results, raw data, and recommended approaches to optimally assess the clinical significance of pharmacokinetic natural product-drug interactions (PK-NPDIs).', 'MIR:00000620', '2019-06-11 14:18:04.316000', 'Natural Product-Drug Interaction Research Data Repository', false, '^[0-9]+$', 'napdi', '28', null, null, false, null, null, null),
        (1724, '2019-06-11 14:18:04.557000', false, null, 'arrayMap is a collection of pre-processed oncogenomic array data sets and CNA (somatic copy number aberrations) profiles. CNA are a type of mutation commonly found in cancer genomes. arrayMap data is assembled from public repositories and supplemented with additional sources, using custom curation pipelines. This information has been mapped to multiple editions of the reference human genome.', 'MIR:00000621', '2019-06-11 14:18:04.557000', 'ArrayMap', false, '^[\w\-:,]{3,64}$', 'arraymap', 'icdom:8500_3', null, null, false, null, null, null),
        (1726, '2019-06-11 14:18:04.748000', false, null, 'The Benchmark Energy & Geometry Database (BEGDB) collects results of highly accurate quantum mechanics (QM) calculations of molecular structures, energies and properties. These data can serve as benchmarks for testing and parameterization of other computational methods.', 'MIR:00000622', '2019-06-11 14:18:04.748000', 'Benchmark Energy & Geometry Database', false, '^[0-9]+$', 'begdb', '4214', null, null, false, null, null, null),
        (1732, '2019-06-11 14:18:05.215000', false, null, 'The Sequencing Initiative Suomi (SISu) project is an international collaboration to harmonize and aggregate whole genome and exome sequence data from Finnish samples, providing data for researchers and clinicians. The SISu project allows for the search of variants to determine their attributes and occurrence in Finnish cohorts, and provides summary data on single nucleotide variants and indels from exomes, sequenced in disease-specific and population genetic studies.', 'MIR:00000624', '2019-06-11 14:18:05.215000', 'SISu', false, '^[0-9]+:[0-9]+$', 'sisu', '17:41223048', null, null, false, null, null, null),
        (1735, '2019-06-11 14:18:05.468000', false, null, 'The Universal Spectrum Identifier (USI) is a compound identifier that provides an abstract path to refer to a single spectrum generated by a mass spectrometer, and potentially the ion that is thought to have produced it.', 'MIR:00000625', '2019-06-11 14:18:05.468000', 'Universal Spectrum Identifier', true, '^mzspec:.+$', 'mzspec', 'PXD002255::ES_XP_Ubi_97H_HCD_349:scan:9617:LAEIYVNSSFYK/2', null, null, false, null, null, null),
        (1738, '2019-06-11 14:18:05.694000', false, null, 'Repeated CRISPR ("clustered regularly interspaced short palindromic repeats") elements found in archaebacteria and eubacteria are believed to defend against viral infection, potentially targeting invading DNA for degradation. CRISPRdb is a database that stores information on CRISPRs that are automatically extracted from newly released genome sequence data.', 'MIR:00000626', '2019-06-11 14:18:05.694000', 'CRISPRdb', false, '^[0-9]+$', 'crisprdb', '551115', null, null, false, null, null, null),
        (1741, '2019-06-11 14:18:05.948000', false, null, 'GnpIS is an integrative information system focused on plants and fungal pests. It provides both genetic (e.g. genetic maps, quantitative trait loci, markers, single nucleotide polymorphisms, germplasms and genotypes) and genomic data (e.g. genomic sequences, physical maps, genome annotation and expression data) for species of agronomical interest.', 'MIR:00000627', '2019-06-11 14:18:05.948000', 'GnpIS', false, '^[A-Za-z0-9]+$', 'gnpis', 'AY109603', null, null, false, null, null, null),
        (1997, '2019-09-10 10:50:49.547000', false, null, 'MarFun is manually curated database for marine fungi which is a part of the MAR databases.', 'MIR:00000729', '2019-09-10 10:50:49.547000', 'MarFun', false, '^MMP\d+.\d+$', 'mmp.fun', 'MMP3888430', null, null, false, null, null, null),
        (1744, '2019-06-11 14:18:06.185000', false, null, 'Sea lice (Lepeophtheirus salmonis and Caligus species) are the major pathogens of salmon,  significantly impacting upon the global salmon farming industry. Lice control is primarily accomplished through chemotherapeutants, though emerging resistance necessitates the development of new treatment methods (biological agents, prophylactics and new drugs). LiceBase is a database for sea lice genomics, providing genome annotation of the Atlantic salmon louse Lepeophtheirus salmonis, a genome browser, and access to related high-thoughput genomics data. LiceBase also mines and stores data from related genome sequencing and functional genomics projects.', 'MIR:00000628', '2019-06-11 14:18:06.185000', 'LiceBase', false, '^[A-Za-z0-9\-\/]+$', 'licebase', 'EMLSAT00000003403', null, null, false, null, null, null),
        (1747, '2019-06-11 14:18:06.412000', false, null, 'The SugarBind Database captures knowledge of glycan binding of human pathogen lectins and adhesins, where each glycan-protein binding pair is associated with at least one published reference. It provides information on the pathogen agent, the lectin/adhesin involved, and the human glycan ligand. This collection provides information on ligands.', 'MIR:00000629', '2019-06-11 14:18:06.412000', 'SugarBind', false, '^[A-Za-z]+\/[0-9]+$', 'sugarbind', 'lectins/172', null, null, false, null, null, null),
        (1750, '2019-06-11 14:18:06.653000', false, null, 'RNAcentral is a public resource that offers integrated access to a comprehensive and up-to-date set of non-coding RNA sequences provided by a collaborating group of Expert Databases.', 'MIR:00000630', '2019-06-11 14:18:06.653000', 'RNAcentral', false, '^URS[0-9A-F]{10}(\_\d+)?$', 'rnacentral', 'URS0000759CF4', null, null, false, null, null, null),
        (1755, '2019-06-11 14:18:07.113000', false, null, 'A database of genome-wide annotations of regulatory sites. It contains annotations for 17 prokaryotes and 3 eukaryotes. The database frontend offers an intuitive interface showing genomic information in a graphical form.', 'MIR:00000632', '2019-06-11 14:18:07.113000', 'SwissRegulon', false, '^[A-Za-z0-9]+$', 'swissregulon', 'AHR', null, null, false, null, null, null),
        (1757, '2019-06-11 14:18:07.321000', false, null, 'Database of validation results for ligands and non-standard residues in the Protein Data Bank.', 'MIR:00000633', '2019-06-11 14:18:07.321000', 'ValidatorDB', false, '^[A-Za-z0-9\/]+$', 'validatordb', 'ByStructure/2h6o', null, null, false, null, null, null),
        (1760, '2019-06-11 14:18:07.548000', false, null, 'Database of the dielectric properties of biological tissues.', 'MIR:00000634', '2019-06-11 14:18:07.548000', 'Bio-MINDER Tissue Database', false, '^[a-z0-9\-]+$', 'biominder', 'aef4c195-9cf9-46db-a12a-7cfd1ff3eec3', null, null, false, null, null, null),
        (1777, '2019-06-11 14:18:09.136000', false, null, 'The Astrophysics Source Code Library (ASCL) is a free online registry for software that have been used in research that has appeared in, or been submitted to, peer-reviewed publications. The ASCL is indexed by the SAO/NASA Astrophysics Data System (ADS) and Web of Science''s Data Citation Index (WoS DCI), and is citable by using the unique ascl ID assigned to each code. The ascl ID can be used to link to the code entry by prefacing the number with ascl.net (i.e., ascl.net/1201.001).', 'MIR:00000641', '2019-06-11 14:18:09.136000', 'Astrophysics Source Code Library', false, '^[0-9\.]+$', 'ascl', '1801.012', null, null, false, null, null, null),
        (1780, '2019-06-11 14:18:09.365000', false, null, 'FaceBase is a collaborative NIDCR-funded consortium to generate data in support of advancing research into craniofacial development and malformation. It serves as a community resource by generating large datasets of a variety of types and making them available to the wider research community via this website. Practices emphasize a comprehensive and multidisciplinary approach to understanding the developmental processes that create the face. The data offered spotlights high-throughput genetic, molecular, biological, imaging and computational techniques. One of the missions of this consortium is to facilitate cooperation and collaboration between projects.', 'MIR:00000642', '2019-06-11 14:18:09.365000', 'FaceBase Data Repository', false, '^FB\d{8}$', 'facebase', 'FB00000917', null, null, false, null, null, null),
        (1783, '2019-06-11 14:18:09.598000', false, null, 'The GenitoUrinary Development Molecular Anatomy Project (GUDMAP) is a consortium of laboratories working to provide the scientific and medical community with tools to facilitate research on the GenitoUrinary (GU) tract.', 'MIR:00000643', '2019-06-11 14:18:09.598000', 'GUDMAP', false, '^[-0-9a-zA-Z]+(@[-0-9a-zA-Z]+)?$', 'gudmap', 'Q-2958', null, null, false, null, null, null),
        (1786, '2019-06-11 14:18:09.859000', false, null, 'The JRC Data Catalogue gives access to the multidisciplinary data produced and maintained by the Joint Research Centre, the European Commission''s in-house science service providing independent scientific advice and support to policies of the European Union.', 'MIR:00000644', '2019-06-11 14:18:09.859000', 'JRC Data Catalogue', false, '^[a-z0-9\-_]+$', 'eu89h', 'jrc-eurl-ecvam-chemagora', null, null, false, null, null, null),
        (1792, '2019-06-11 14:18:10.316000', false, null, 'Metabolomics Workbench stores metabolomics data for small and large studies on cells, tissues and organisms for the Metabolomics Consortium Data Repository and Coordinating Center (DRCC).', 'MIR:00000646', '2019-06-11 14:18:10.316000', 'Metabolomics Workbench Study', false, '^ST[0-9]{6}$', 'mw.study', 'ST000900', null, null, false, null, null, null),
        (1796, '2019-06-11 14:18:10.677000', false, null, 'Metabolomics Workbench stores metabolomics data for small and large studies on cells, tissues and organisms for the Metabolomics Consortium Data Repository and Coordinating Center (DRCC).', 'MIR:00000647', '2019-06-11 14:18:10.677000', 'Metabolomics Workbench Project', false, '^PR[0-9]{6}$', 'mw.project', 'PR000001', null, null, false, null, null, null),
