        (1834, '2019-06-11 14:18:14.340000', false, null, 'FoodOn is a comprehensive and easily accessible global farm-to-fork ontology about food that accurately and consistently describes foods commonly known in cultures from around the world. It is a consortium-driven project built to interoperate with the The Open Biological and Biomedical Ontology Foundry library of ontologies.', 'MIR:00000661', '2019-06-11 14:18:14.340000', 'FoodOn Food Ontology', true, '^FOODON:[0-9]{8}$', 'foodon', '03307879', null, null, false, null, null, null),
