        (1853, '2019-06-11 14:18:16.344000', false, null, 'The global library cooperative OCLC maintains WorldCat. WorldCat is the world''s largest network of library content and services. WorldCat libraries are dedicated to providing access to their resources on the Web, where most people start their search for information.', 'MIR:00000669', '2019-06-11 14:18:16.344000', 'Online Computer Library Center (OCLC) WorldCat', false, '^[0-9]+$', 'oclc', '634515043', null, null, false, null, null, null),
