        (1861, '2019-06-11 14:18:17.129000', false, null, 'FlowRepository is a database of flow cytometry experiments where you can query and download data collected and annotated according to the MIFlowCyt standard. It is primarily used as a data deposition place for experimental findings published in peer-reviewed journals in the flow cytometry field.', 'MIR:00000672', '2019-06-11 14:18:17.129000', 'FlowRepository', false, '^FR\-FCM\-\w{4}$', 'flowrepository', 'FR-FCM-ZYGW', null, null, false, null, null, null),
