        (3009, '2022-01-09 19:35:12.259000', false, null, 'Bitbucket is a Git-based source code repository hosting service owned by Atlassian.', 'MIR:00000899', '2022-01-09 19:35:12.259000', 'Bitbucket', false, '^[0-9A-Za-z-_\.]+/[0-9A-Za-z-_\.]+$', 'bitbucket', 'andreadega/systems-biology-compiler', null, null, false, null, null, null),
        (3020, '2022-01-10 18:54:31.118000', false, null, 'Blue Brain Project''s published data as knowledge graphs and Web Studios.', 'MIR:00000903', '2022-01-10 18:54:31.118000', 'Blue Brain Project Knowledge Graph', false, '^[-\w]+(?:\/[-\w]+)(?:\/\b[0-9a-f]{8}\b-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-\b[0-9a-f]{12}\b)$', 'bbkg', 'topological-sampling/studios/f0ba2f3e-aa6f-4264-8d18-8ee65cf6f61a', null, null, false, null, null, null),
        (3146, '2022-02-27 20:31:14.555000', false, null, 'The GenoMEL data commons supports the management, analysis and sharing of next generation sequencing data for the GenoMEL research community and aims to accelerate opportunities for discovery of susceptibility genes for melanoma. The data commons supports cross-project analyses by harmonizing data from different projects through the development of a data dictionary and utilization of common workflows, providing an API for data queries, and providing a cloud-based analysis workspace with rich tools and resources.', 'MIR:00000919', '2022-02-27 20:31:14.555000', 'GenoMEL Data Commons', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.80b6', '000e5d06-1326-4b6f-8d8a-95c63374c7c1', null, null, false, null, null, null),
        (3135, '2022-02-27 20:29:04.474000', false, null, 'The Veterans Data Commons supports the management, analysis and sharing of veteran oncologic data for the research community and aims to accelerate the discovery and development of therapies, diagnostic tests, and other technologies for precision oncology.', 'MIR:00000916', '2023-04-28 10:52:16.460000', 'Veterans Precision Oncology Data Commons', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.f738', '000bf826-73ba-4685-aa6c-3e0971a2f260', null, null, false, null, null, null),
        (3036, '2022-01-29 10:45:35.629000', false, null, 'Concept used by ModelDB, an accessible location for storing and efficiently retrieving computational neuroscience models.', 'MIR:00000905', '2022-01-29 10:45:35.629000', 'ModelDB concept', false, '\d+', 'modeldb.concept', '3639', null, null, false, null, null, null),
        (3039, '2022-01-29 10:47:57.098000', false, null, 'A CIViC Gene Summary is created to provide a high-level overview of clinical relevance of cancer variants for the gene. Gene Summaries in CIViC focus on emphasizing the clinical relevance from a molecular perspective rather than describing the biological function of the gene unless necessary to contextualize its clinical relevance in cancer. Gene Summaries include relevant cancer subtypes, specific treatments for the gene’s associated variants, pathway interactions, functional alterations caused by the variants in the gene, and normal/abnormal functions of the gene with associated roles in oncogenesis', 'MIR:00000907', '2022-01-29 10:47:57.098000', 'CIViC Gene', false, '^[0-9]+$', 'civic.gid', '272', null, null, false, null, null, null),
        (3042, '2022-01-29 10:48:56.640000', false, null, 'CIViC variants are usually genomic alterations, including single nucleotide variants (SNVs), insertion/deletion events (indels), copy number alterations (CNV’s such as amplification or deletion), structural variants (SVs such as translocations and inversions), and other events that differ from the “normal” genome. In some cases a CIViC variant may represent events of the transcriptome or proteome. For example, ‘expression’ or ‘over-expression’ is a valid variant. Regardless of the variant, it must have a Predictive, Prognostic, Predisposing, Diagnostic, Oncogenic, or Functional relevance that is clinical in nature to be entered in CIViC. i.e. There must be some rationale for why curation of this variant could ultimately aid clinical decision making.', 'MIR:00000909', '2022-01-29 10:48:56.640000', 'CIViC Variant', false, '^[0-9]+$', 'civic.vid', '12', null, null, false, null, null, null),
        (3013, '2022-01-09 19:35:24.140000', false, null, 'GitLab is The DevOps platform that empowers organizations to maximize the overall return on software development by delivering software faster and efficiently, while strengthening security and compliance. With GitLab, every team in your organization can collaboratively plan, build, secure, and deploy software to drive business outcomes faster with complete transparency, consistency and traceability.', 'MIR:00000901', '2022-01-29 17:48:48.838000', 'GitLab', false, '^[0-9A-Za-z_][0-9A-Za-z-_()\. ]*/[0-9A-Za-z_][0-9A-Za-z-_\. ]*$', 'gitlab', 'morpheus.lab/morpheus', null, null, false, null, null, null),
        (3047, '2022-01-29 10:51:36.384000', false, null, 'RISM Online is a new service that will publish the bibliographic and authority data from the catalogue of the Répertoire International des Sources Musicales project.', 'MIR:00000911', '2022-01-31 08:57:14.676000', 'RISM Online', false, '^[a-z]+/[0-9]+$', 'rism', 'people/11035', null, null, false, null, null, null),
        (3067, '2022-02-01 17:20:51.953000', false, null, 'CropMRespository is a database of soil and crop biophysical process models.', 'MIR:00001015', '2022-02-01 17:20:51.953000', 'CropMRepository', false, '^[0-9]{9}$', 'crop2ml', '000000001', null, null, false, null, null, null),
        (3139, '2022-02-27 20:30:23.278000', false, null, 'AccessClinicalData@NIAID is a NIAID cloud-based, secure data platform that enables sharing of and access to reports and data sets from NIAID COVID-19 and other sponsored clinical trials for the basic and clinical research community.', 'MIR:00000917', '2022-02-27 20:30:23.278000', 'https://accessclinicaldata.niaid.nih.gov/', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.nacd', '2096a0d6-1846-4b98-9ba3-e4065d82111d', null, null, false, null, null, null),
        (3142, '2022-02-27 20:30:53.595000', false, null, 'This website provides a centralized, cloud-based discovery portal for African American pharmacogenomics data and aims to accelerate discovery of novel genetic variants in African Americans related to clinically actionable cardiovascular phenotypes.', 'MIR:00001019', '2022-02-27 20:30:53.595000', 'ACCOuNT Data Commons', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.4825', '003a12b5-1002-4791-bf7f-0d6f71ebd67b', null, null, false, null, null, null),
        (3149, '2022-02-27 20:31:33.330000', false, null, 'The Inflammatory Bowel Disease Genetics Consortium Data Commons supports the management, analysis, and sharing of genetic data to support the vision and mission of the IBD genetics consortium.', 'MIR:00001021', '2022-02-27 20:31:33.330000', 'NIDDK IBD Genetics Consortium Portal', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.ea80', '00083977-d4d7-4593-a216-2b9c931b8b03', null, null, false, null, null, null),
        (3152, '2022-02-27 20:31:54.933000', false, null, 'NHLBI BioData Catalyst supports the management, analysis and sharing of human disease data for the research community and aims to advance basic understanding of the genetic basis of complex traits and accelerate discovery and development of therapies, diagnostic tests, and other technologies for diseases like cancer. The data commons supports cross-project analyses by harmonizing data from different projects through the collaborative development of a data dictionary, providing an API for data queries and download, and providing a cloud-based analysis workspace with rich tools and resources.', 'MIR:00001020', '2022-02-27 20:31:54.933000', 'BioData Catalyst', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', '4503', '3dab719c-1fa0-461b-a543-5f0e564a9be4', null, null, false, null, null, null),
        (3171, '2022-02-27 20:33:39.208000', false, null, 'The Medical Imaging & Data Resource Center (MIDRC) Data Commons supports the management, analysis and sharing of medical imaging data for the improvement of patient outcomes.', 'MIR:00000932', '2022-02-27 20:33:39.208000', 'MIDRC Data Commons', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.md1r', '000007c3-356a-4d59-a6c0-0ee920b60305', null, null, false, null, null, null),
        (3196, '2022-02-27 20:41:50.311000', false, null, 'Workspace (Git repository) for modeling projects managed by the Physiome Model Repository', 'MIR:00000948', '2022-02-27 20:41:50.311000', 'Physiome Model Repository workspace', false, '^[a-zA-Z0-9_\-]+(/.*?)?$', 'pmr.workspace', 'modularmassactionprimer', null, null, false, null, null, null),
        (361, '2019-06-11 14:16:03.054000', false, null, 'The Chemical Component Dictionary is as an external reference file describing all residue and small molecule components found in Protein Data Bank entries. It contains detailed chemical descriptions for standard and modified amino acids/nucleotides, small molecule ligands, and solvent molecules. Each chemical definition includes descriptions of chemical properties such as stereochemical assignments, aromatic bond assignments, idealized coordinates, chemical descriptors (SMILES & InChI), and systematic chemical names.', 'MIR:00000113', '2022-05-18 15:48:21.884000', 'Chemical Component Dictionary', false, '^\w{1,3}$', 'pdb-ccd', 'AB0', null, null, false, null, null, null),
        (3155, '2022-02-27 20:32:23.416000', false, null, 'The AnVIL supports the management, analysis and sharing of human disease data for the research community and aims to advance basic understanding of the genetic basis of complex traits and accelerate discovery and development of therapies, diagnostic tests, and other technologies for diseases like cancer. The data commons supports cross-project analyses by harmonizing data from different projects through the collaborative development of a data dictionary, providing an API for data queries and download, and providing a cloud-based analysis workspace with rich tools and resources.', 'MIR:00000922', '2022-02-27 20:32:23.416000', 'The AnVIL', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.373f', '6f2f1d6c-c5b5-4171-8b5f-9b1ac8c8a8ca', null, null, false, null, null, null),
        (3158, '2022-02-27 20:32:37.384000', false, null, 'This website provides a centralized, cloud-based portal for the open redistribution and analysis of environmental datasets and satellite imagery from OCC stakeholders like NASA and NOAA and aims to support the earth science research community as well as human assisted disaster relief.', 'MIR:00000925', '2022-02-27 20:32:37.384000', 'Environmental Data Commons', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.7c5b', '00000014-990c-48f2-b0a8-fbb533860512', null, null, false, null, null, null),
        (3161, '2022-02-27 20:32:53.923000', false, null, 'The Kids First Data Catalog supports the Kids First Data Resource Center by providing a digital object services that allow interoperability between data commons, including authentication and authorization for controlled access data.', 'MIR:00000926', '2022-02-27 20:32:53.923000', 'Kids First Data Catalog', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'f82a1a', '0000324e-e2d9-4ccd-b25b-2d16c8a87b28', null, null, false, null, null, null),
