        (3168, '2022-02-27 20:33:18.862000', false, null, 'Chicago Pandemic Response Commons known as CCC is the first regional data commons launched under the Pandemic Response Commons Consortium. Born out of a consortium of Chicago-area civic and healthcare organizations with support from several technology partners, the PRC represents a persistent data resource for the research community engaging with COVID-19.', 'MIR:00001026', '2022-02-27 20:33:18.862000', 'Chicago Pandemic Response Commons', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.63d5', '00002b0f-0adf-4015-b2b7-b38f9337044a', null, null, false, null, null, null),
        (3174, '2022-02-27 20:34:03.581000', false, null, 'The Helping to End Addiction Long-termSM Initiative, or NIH HEAL InitiativeSM, will support the Justice Community Opioid Innovation Network (JCOIN) to study approaches to increase high-quality care for people with opioid misuse and OUD in justice settings. JCOIN will test strategies to expand effective treatment and care in partnership with local and state justice systems and community-based treatment providers.', 'MIR:00000934', '2022-02-27 20:34:03.581000', 'JCOIN Portal', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', '6vts', '005bf193-fa93-44c0-9b2b-9b039f94d692', null, null, false, null, null, null),
        (3177, '2022-02-27 20:37:35.848000', false, null, 'The vision of DCFS is to make it easier to develop, operate, and interoperate data commons, data clouds, knowledge bases, and other resources for managing, analyzing, and sharing research data that can be part of a large data commons ecosystem.', 'MIR:00000936', '2022-02-27 20:37:35.848000', 'NCI Data Commons Framework Services', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.nci35', '81944ba1-81d0-436e-8552-33d77a27834b', null, null, false, null, null, null),
        (3183, '2022-02-27 20:38:48.115000', false, null, 'This website analyzes and shares genomic architecture of modern dog breeds and runs analysis for canine cancer to create clean, easy to navigate visualizations for data-driven discovery for canine cancer.', 'MIR:00000940', '2022-02-27 20:38:48.115000', 'Canine Data Commons', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.c78ne', '0002346e-5ee7-45fb-8c92-8333f8e13854', null, null, false, null, null, null),
        (3186, '2022-02-27 20:39:04.388000', false, null, 'The HEAL Platform is a cloud-based and multifunctional web interface that provides a secure environment for discovery and analysis of NIH HEAL results and data. It is designed to serve users with a variety of objectives, backgrounds, and specialties.

The HEAL Platform represents a dynamic Data Ecosystem that aggregates and hosts data from multiple resources to make data discovery and access easy for users.

The platform provides a way to search and query over study metadata and diverse data types, generated by different projects and organizations and stored across multiple secure repositories.

The HEAL platform also offers a secure and cost-effective cloud-computing environment for data analysis, empowering collaborative research and development of new analytical tools. New workflows and results of analyses can be shared with the HEAL community to enable collaborative, high-impact publications that address the opioid crisis.', 'MIR:00000942', '2022-02-27 20:39:04.388000', 'The HEAL platform', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.h34l', '022911d6-af91-4b02-8f96-9107c77c98b8', null, null, false, null, null, null),
        (3189, '2022-02-27 20:40:41.328000', false, null, 'This website supports the management, analysis and sharing of data for the research community and aims to accelerate discovery and development of therapies, diagnostic tests, and other technologies.', 'MIR:00000944', '2022-02-27 20:40:41.328000', 'HEAL Data Platform', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.h35l', '007e4996-c902-49a0-8fe8-b363f1d3fb23', null, null, false, null, null, null),
        (3193, '2022-02-27 20:40:56.446000', false, null, 'The UMCCR AGHA Data Commons supports the management, analysis and sharing of data for the research community.', 'MIR:00000946', '2022-02-27 20:40:56.446000', 'UMCCR AGHA Data Commons', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.um33r90', '0aa770b4-66b3-4009-9f02-852236b0544f', null, null, false, null, null, null),
        (3203, '2022-03-15 08:27:12.699000', false, null, 'Pennsieve is a publicly accessible Scientific Data Management and publication platform. The platform supports data curation, sharing and publishing complex scientific datasets with a focus on integration between graph-based metadata and file-archival. The platform provides a "peer"-reviewed publication mechanism and public datasets are available through its Discover Web Application and APIs. ', 'MIR:00000951', '2022-03-15 08:27:12.699000', 'Pennsieve', false, 'N:package:[a-z0-9]{8}-[a-z0-9]{4}-[a-z0-9]{4}-[a-z0-9]{4}-[a-z0-9]{12}', 'ps', 'N:package:e3243db3-7986-488e-9a10-c7a0bfdcfe8a', null, null, false, null, null, null),
        (2638, '2021-05-10 19:40:34.200000', false, null, 'The Integrated Canine Data Commons is one of several repositories within the NCI Cancer Research Data Commons (CRDC), a cloud-based data science infrastructure that provides secure access to a large, comprehensive, and expanding collection of cancer research data. The ICDC was established to further research on human cancers by enabling comparative analysis with canine cancer.', 'MIR:00000812', '2022-03-31 16:55:06.915000', 'Integrated Canine Data Commons', false, '^\d{6}$', 'icdc', '000009', null, null, false, null, null, null),
        (3252, '2022-08-08 18:32:17.171000', false, null, 'In CIViC, each Evidence Item must be associated with a Source Type and Source ID, which link the Evidence Item to the original source of information supporting clinical claims. Currently, CIViC accepts publications indexed on PubMed OR abstracts published through the American Society of Clinical Oncology (ASCO). Each such source entered into CIViC is assigned a unique identifier and expert curators can curate guidance that assists future curators in the interpretation of information from this source.', 'MIR:00000953', '2022-08-08 18:32:17.171000', 'CIViC Source', false, '^[0-9]+$', 'civic.sid', '62', null, null, false, null, null, null),
        (3255, '2022-08-08 18:33:25.710000', false, null, 'Therapies (often drugs) in CIViC are associated with Predictive Evidence Types, which describe sensitivity, resistance or adverse response to therapies when a given variant is present. The Therapy field may also be used to describe more general treatment types and regimes, such as FOLFOX or Radiation, as long as the literature derived Evidence Item makes a scientific association between the Therapy (treatment type) and the presence of the variant.', 'MIR:00000955', '2022-08-08 18:33:25.710000', 'CIViC Therapy', false, '^[0-9]+$', 'civic.tid', '14', null, null, false, null, null, null),
        (3258, '2022-08-08 18:34:15.882000', false, null, 'Within the CIViC database, the disease should be the cancer or cancer subtype that is a result of the described variant. The disease selected should be as specific as possible should reflect the disease type used in the source that supports the evidence statement.', 'MIR:00000957', '2022-08-08 18:34:15.882000', 'CIViC Disease', false, '^[0-9]+$', 'civic.did', '46', null, null, false, null, null, null),
        (3263, '2022-08-08 18:36:40.981000', false, null, 'Metabolic Atlas facilitates metabolic modelling by presenting open source genome-scale metabolic models for easy browsing and analysis.', 'MIR:00000959', '2022-08-08 18:36:40.981000', 'Metabolic Atlas', false, '^MA[MR]\d{5}[a-z]?$', 'metatlas', 'MAR01234', null, null, false, null, null, null),
        (2168, '2020-03-24 05:11:19.658000', false, null, 'DANDI works with BICCN and other BRAIN Initiative awardees to curate data using community data standards such as NWB and BIDS, and to make data and software for cellular neurophysiology FAIR (Findable, Accessible, Interoperable, and Reusable).
DANDI references electrical and optical cellular neurophysiology recordings and associated MRI and/or optical imaging data.
These data will help scientists uncover and understand cellular level mechanisms of brain function. Scientists will study the formation of neural networks, how cells and networks enable functions such as learning and memory, and how these functions are disrupted in neurological disorders.', 'MIR:00000786', '2021-10-18 12:32:14.264000', 'DANDI: Distributed Archives for Neurophysiology Data Integration', false, '^\d{6}(\/\d+\.\d+\.\d+)?$', 'dandi', '000017', null, null, false, null, null, null),
        (3271, '2022-08-15 19:28:35.707000', false, null, 'ROR (Research Organization Registry) is a global, community-led registry
of open persistent identifiers for research organizations. ROR is jointly
operated by California Digital Library, Crossref, and Datacite.', 'MIR:00000961', '2022-08-18 13:14:34.725000', 'ROR', false, '^0[a-hj-km-np-tv-z|0-9]{6}[0-9]{2}$', 'ror', '03yrm5c26', null, null, false, null, null, null),
        (1097, '2019-06-11 14:17:06.748000', false, null, 'The National Bibliography Number (NBN), is a URN-based publication identifier system employed by a variety of national libraries such as those of Germany, the Netherlands and Switzerland.  They are used to identify documents archived in national libraries, in their native format or language, and are typically used for documents which do not have a publisher-assigned identifier.', 'MIR:00000381', '2023-06-19 09:28:27.741000', 'National Bibliography Number', false, '^(urn|URN):(nbn|NBN)(:[A-Za-z_0-9]+)*.+$', 'nbn', 'urn:nbn:fi:tkk-004781', null, null, false, null, null, null),
        (1208, '2019-06-11 14:17:16.067000', false, null, 'Bgee is a database to retrieve and compare gene expression patterns in multiple species, produced from multiple data types (bulk RNA-Seq, scRNA-Seq, Affymetrix, in situ hybridization, and EST data). This collection references genes in Bgee.', 'MIR:00000418', '2023-06-21 08:14:55.477000', 'Bgee gene', false, '^[A-Za-z0-9]+$', 'bgee.gene', 'FBgn0000015', null, null, false, null, null, null),
        (3298, '2022-11-04 09:54:32.976000', false, null, 'DrugCentral (http://drugcentral.org) is an open-access online drug compendium. DrugCentral integrates structure, bioactivity, regulatory, pharmacologic actions and indications for active pharmaceutical ingredients approved by FDA and other regulatory agencies. Monitoring of regulatory agencies for new drugs approvals ensures the resource is up-to-date. DrugCentral integrates content for active ingredients with pharmaceutical formulations, indexing drugs and drug label annotations, complementing similar resources available online. Its complementarity with other online resources is facilitated by cross referencing to external resources. At the molecular level, DrugCentral bridges drug-target interactions with pharmacological action and indications. The integration with FDA drug labels enables text mining applications for drug adverse events and clinical trial information. Chemical structure overlap between DrugCentral and five online drug resources, and the overlap between DrugCentral FDA-approved drugs and their presence in four different chemical collections, are discussed. DrugCentral can be accessed via the web application or downloaded in relational database format.', 'MIR:00000966', '2022-11-04 09:54:32.976000', 'DrugCentral', false, '^[0-9]+$', 'drugcentral', '257', null, null, false, null, null, null),
        (3307, '2022-11-04 12:17:30.200000', false, null, 'Stress Knowledge Map (SKM, available at https://skm.nib.si) is a knowledge graph resulting from the integration of dispersed published information on plant molecular responses to biotic and abiotic stressors. ', 'MIR:00000968', '2022-11-04 12:17:30.200000', 'Stress Knowledge Map', false, '^rx[0-9]{5}$', 'skm', 'rx00408', null, null, false, null, null, null),
        (3311, '2022-11-04 13:50:22.141000', false, null, 'Identifier of a taxon or synonym in the Catalogue of Life', 'MIR:00000969', '2022-11-04 13:50:22.141000', 'Catalogue of Life', false, '^[23456789BCDFGHJKLMNPQRSTVWXYZ]{1,6}$', 'col', '4QHKG', null, null, false, null, null, null),
        (765, '2019-06-11 14:16:39.210000', false, null, 'The ''COmputational Modeling in BIology'' NEtwork (COMBINE) is an initiative to coordinate the development of the various community standards and formats for computational models, initially in Systems Biology and related fields. This collection pertains to specifications of the standard formats developed by the Computational Modeling in Biology Network.', 'MIR:00000258', '2023-01-04 15:31:16.641000', 'COMBINE specifications', false, '^\w+(\-|\.|\w)*$', 'combine.specifications', 'sed-ml.level-1.version-1', null, null, false, null, null, null),
        (1217, '2019-06-11 14:17:16.858000', false, null, 'The PANTHER (Protein ANalysis THrough Evolutionary Relationships) Classification System is a resource that classifies genes by their functions, using published scientific experimental evidence and evolutionary relationships to predict function even in the absence of direct experimental evidence. The PANTHER Pathway Component collection references specific classes of molecules that play the same mechanistic role within a pathway, across species. Pathway
components may be proteins, genes/DNA, RNA, or simple molecules. Where the identified component is a protein, DNA, or transcribed RNA, it is associated with protein sequences in the PANTHER protein family trees through manual curation.', 'MIR:00000422', '2023-01-04 16:32:41.267000', 'PANTHER Pathway Component', false, '^[GPUCS]\d{5}$', 'panther.pthcmp', 'P00266', null, null, false, null, null, null),
        (2484, '2020-12-14 12:57:54.560000', false, null, 'Hierarchical orthologous groups predicted by OMA (Orthologous MAtrix) database. Hierarchical orthologous groups are sets of genes that have started diverging from a single common ancestor gene at a certain taxonomic level of reference. ', 'MIR:00000785', '2023-01-10 16:04:39.504000', 'OMA HOGs', true, '^HOG:[0-9]{7}(\.[0-9a-z.]+)?(_[0-9]+)?$', 'oma.hog', '0459895', null, null, false, null, null, null),
        (1437, '2019-06-11 14:17:36.384000', false, null, 'Gramene is a comparative genome mapping database for grasses and crop plants. It combines a semi-automatically generated database of cereal genomic and expressed sequence tag sequences, genetic maps, map relations, quantitative trait loci (QTL), and publications, with a curated database of mutants (genes and alleles), molecular markers, and proteins. This collection refers to growth stage ontology information in Gramene.', 'MIR:00000508', '2023-01-10 16:08:16.467000', 'Gramene Growth Stage Ontology', true, '^GRO:\d+$', 'gro', '0007133', null, null, false, null, null, null),
        (3369, '2023-01-12 10:08:07.976000', false, null, 'The Arabidopsis Information Resource (TAIR) maintains a database of genetic and molecular biology data for the model higher plant Arabidopsis thaliana. The name of a Locus is unique and used by TAIR, TIGR, and MIPS.', 'MIR:00000976', '2023-01-12 10:08:07.976000', 'TAIR gene name', false, '^AT.G[0-9]{5}$', 'tair.name', 'AT5G05330', null, null, false, null, null, null),
        (3380, '2023-01-23 09:52:20.012000', false, null, 'Variant Groups in CIViC provide user-defined grouping of Variants within and between genes based on unifying characteristics. CIViC curators are required to define a cohesive rationale for grouping these variants together, summarize their relevance to cancer diagnosis, prognosis or treatment and highlight any treatments or cancers of particular relevance', 'MIR:00000979', '2023-01-23 09:52:20.012000', 'CIViC Variant Group', false, '^[0-9]+$', 'civic.vgid', '16', null, null, false, null, null, null),
        (3383, '2023-01-23 09:53:23.139000', false, null, 'CIViC Molecular Profiles are combinations of one or more CIViC variants. Most Molecular Profiles are “Simple” Molecular Profiles comprised of a single variant. In most cases, these can be considered equivalent to the CIViC concept of a Variant. However, increasingly clinical significance must be considered in the context of multiple variants simultaneously. Complex Molecular Profiles in CIViC allow for curation of such variant combinations. Regardless of the nature of the Molecular Profile (Simple or Complex), it must have a Predictive, Prognostic, Predisposing, Diagnostic, Oncogenic, or Functional clinical relevance to be entered in CIViC.', 'MIR:00000981', '2023-01-23 09:53:23.139000', 'CIViC Molecular Profile', false, '^[0-9]+$', 'civic.mpid', '559', null, null, false, null, null, null),
        (3391, '2023-01-23 10:14:16.128000', false, null, 'The Cell Line Ontology is a community-based ontology of cell lines. The CLO is developed to unify publicly available cell line entry data from multiple sources to a standardized logically defined format based on consensus design patterns.', 'MIR:00000983', '2023-01-23 10:14:16.128000', 'Cell Line Ontology', false, '^\d{7}$', 'clo', '0000091', null, null, false, null, null, null),
        (3404, '2023-01-25 11:52:06.260000', false, null, 'EMPIAR, the Electron Microscopy Public Image Archive, is a public resource for raw images underpinning 3D cryo-EM maps and tomograms (themselves archived in EMDB). EMPIAR also accommodates 3D datasets obtained with volume EM techniques and soft and hard X-ray tomography.', 'MIR:00000986', '2023-01-25 11:52:06.260000', 'EMPIAR', false, 'EMPIAR-\d{5,}', 'empiar', 'EMPIAR-10002', null, null, false, null, null, null),
        (1555, '2019-06-11 14:17:47.850000', false, null, 'BiGG is a knowledgebase of Biochemically, Genetically and Genomically structured genome-scale metabolic network reconstructions. It published genome-scale metabolic networks into a single database with a set of standardized identifiers called BiGG IDs. Genes in the BiGG models are mapped to NCBI genome annotations, and metabolites are linked to many external databases (KEGG, PubChem, and many more). This collection references individual metabolites.', 'MIR:00000556', '2023-06-21 08:19:14.475000', 'BiGG Metabolite', false, '^[a-z_A-Z0-9]+$', 'bigg.metabolite', '12dgr161', null, null, false, null, null, null),
        (1647, '2019-06-11 14:17:57.583000', false, null, 'Archival Resource Keys (ARKs) serve as persistent identifiers, or stable, trusted references for information objects. Among other things, they aim to be web addresses (URLs) that don’t return 404 Page Not Found errors. The ARK Alliance is an open global community supporting the ARK infrastructure on behalf of research and scholarship. End users, especially researchers, rely on ARKs for long term access to the global scientific and cultural record. Since 2001 some 8.2 billion ARKs have been created by over 1000 organizations — libraries, data centers, archives, museums, publishers, government agencies, and vendors. They identify anything digital, physical, or abstract. ARKs are open, mainstream, non-paywalled, decentralized persistent identifiers that can be created by an organization as soon as it is registered with a NAAN (Name Assigning Authority Number). Once registered, an ARK organization can create unlimited numbers of ARKs and publicize them via the n2t.net global resolver or via their own local resolver.', 'MIR:00000592', '2023-01-31 08:16:22.071000', 'Archival Resource Key (ARK)', true, '^(ark\:)/*[0-9A-Za-z]+(?:/[\w/.=*+@\$-]*)?(?:\?.*)?$', 'ark', '/53355/cl010066723', null, null, false, null, null, null),
        (3467, '2023-02-23 11:08:58.437000', false, null, 'A curated database of 5'' and 3'' untranslated sequences of eukaryotic mRNAs. In the current update, the UTR entries are organized in a gene-centric structure to better visualize and retrieve 5'' and 3''UTR variants generated by alternative initiation and termination of transcription and alternative splicing. Experimentally validated miRNA targets and conserved sequence elements are also annotated. The integration of UTRdb with genomic data has allowed the implementation of an efficient annotation system and a powerful retrieval resource for the selection and extraction of specific UTR subsets. ', 'MIR:00000993', '2023-02-23 11:21:10.786000', 'UTRdb', false, '([3-5][A-Z])\w+[^A-Z][0-9]', 'utrdb', '5UTR_107_ENST00000517291.2', null, null, false, null, null, null),
        (3472, '2023-03-01 11:40:49.456000', false, null, 'BioKC (Biological Knowledge Curation), is a web-based collaborative platform for the curation and annotation of biomedical knowledge following the standard data model from Systems Biology Markup Language (SBML).', 'MIR:00000995', '2023-03-01 11:40:49.456000', 'BioKC', false, 'bkc[0-9]*', 'biokc', 'bkc640', null, null, false, null, null, null),
        (3486, '2023-04-04 09:37:11.265000', false, null, 'CSTR is an identifier for Common Science and Technology Resources, to provide persistent identification services for the positioning, traceability, citation, statistics and evaluation of science and technology resources. ', 'MIR:00000998', '2023-04-04 09:37:11.265000', 'CSTR', false, '^\w{5}\.\d{2}\..*$', 'cstr', '31253.11.sciencedb.j00001.00123', null, null, false, null, null, null),
        (3494, '2023-04-11 08:16:21.531000', false, null, 'The Austrian Library Network (OBV) is the largest network of scientific and administrative libraries in Austria with 70 participants, representing more than 90 individual institutions - including the Austrian National Library, university libraries, the colleges of education, individual ministries, numerous technical colleges and other important collections.', 'MIR:00001000', '2023-04-11 08:16:21.531000', 'Austrian Library Network', false, 'AC[0-9]{8}', 'obv', 'AC00963334', null, null, false, null, null, null),
        (3501, '2023-04-14 08:41:21.064000', false, null, 'The Gemeinsame Normdatei (Integrated Authority File) or GND is an international authority file for person names, subject headings and corporate bodies. It is used mainly for documentation in libraries and increasingly also by archives and museums. The GND is managed by the German National Library in cooperation with various regional library networks in German-speaking Europe and other partners.', 'MIR:00001002', '2023-04-14 08:41:21.064000', 'Gemeinsame Normdatei', false, '[0-9X\-]+', 'gnd', '117145750', null, null, false, null, null, null),
        (3510, '2023-04-28 08:49:50.354000', false, null, 'Every entity in OpenCitations Meta (https://opencitations.net/meta) is assigned persistent internal identifier called OpenCitations Meta Identifier (OMID). The OMID has structure [[entity_type_abbreviation]]/[[supplier_prefix]][[sequential_number]]. For example, the first journal article ever processed has OMID br/0601 (the full URI is https://w3id.org/oc/meta/br/0601), where br is the abbreviation of bibliographic resource, and 060 corresponds to the supplier prefix, helpful in recognising at a glance the index it belongs to (i.e., OpenCitations Meta). Finally, 1 indicates that this is the index''s first bibliographic resource ever minted.', 'MIR:00001004', '2023-04-28 08:49:50.354000', 'OpenCitations Meta Identifier', false, '^[a-z][a-z]/06[1-9]*0[1-9][0-9]*$', 'omid', 'br/0601', null, null, false, null, null, null),
        (3180, '2022-02-27 20:37:55.926000', true, '2023-04-28 10:42:52.292000', 'The Veterans Data Commons supports the management, analysis and sharing of veteran oncologic data for the research community and aims to accelerate discovery and development of therapies, diagnostic tests, and other technologies for precision oncology.', 'MIR:00000938', '2023-04-28 10:42:52.298000', 'Veterans Precision Oncology Data Commons', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.vp07', '000bf826-73ba-4685-aa6c-3e0971a2f260', null, null, false, null, null, null),
        (3527, '2023-05-02 09:41:15.113000', false, null, 'TogoVar (A comprehensive Japanese genetic variation database) is a database that has collected and organized genome sequence differences between individuals (variants) in the Japanese population and disease information associated with them.', 'MIR:00001006', '2023-05-02 09:41:15.113000', 'TogoVar', false, '^tgv[0-9]+$', 'togovar', 'tgv139393198', null, null, false, null, null, null),
        (3533, '2023-05-02 09:56:24.768000', false, null, 'The VA Data Commons supports the research and analysis of US military Veteran medical and genomic data and aims to accelerate scientific discovery and development of therapies, diagnostic tests, and other technologies for improving the lives of Veterans and beyond.
', 'MIR:00001104', '2023-05-02 09:56:24.768000', 'VA Data Commons', false, '[0-9a-fA-F]{8}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{4}\-[0-9a-fA-F]{12}', 'dg.va03', '00990747-f66a-4b1e-a6d2-3f08c5c1461f', null, null, false, null, null, null),
        (3536, '2023-05-09 12:26:02.992000', false, null, 'Nanbyo Disease Ontology (NANDO) is the ontology creating a comprehensive hierarchical controlled vocabulary for intractable and rare disease (i.e., nanbyo) representation in Japan.', 'MIR:00001010', '2023-05-09 13:07:17.390000', 'Nanbyo Disease Ontology', true, '^NANDO:[0-9]+$', 'nando', '1200031', null, null, false, null, null, null),
        (1831, '2019-06-11 14:18:13.968000', false, null, 'Each OCI (Open Citation Identifier) has a simple structure: oci:<identifier>-<identifier>, where “oci:” is the identifier prefix, and is used to identify a citation as a first-class data entity - see https://doi.org/10.6084/m9.figshare.7127816.v2 for additional information. In each OCI, the first <identifier> is the identifier for the citing bibliographic resource, while the second <identifier> is the identifier for the cited bibliographic resource.', 'MIR:00000660', '2023-05-12 15:05:01.546000', 'OCI', false, '^0[1-9]+0[0-9]+-0[1-9]+0[0-9]+$', 'oci', '01027931310-01022252312', null, null, false, null, null, null),
        (3571, '2023-06-01 09:26:38.236000', false, null, 'This namespace is used for GA4GH Data Repository Service (DRS) access to the USA National Institutes of Health (NIH), National Human Genome Research Institute (NHGRI), Genomic Analysis, Visualization and Informatics Lab-space (AnVIL) program data. AnVIL is a cloud-based genomic data sharing and analysis platform which facilitates integration and computing on and across large datasets generated by NHGRI programs, as well as initiatives funded by the National Institutes of Health (NIH) or by other agencies that support human genomics research.   ', 'MIR:00001014', '2023-06-01 09:26:38.236000', 'AnVIL DRS', false, '^v2_[0-9a-fA-F]{8}-[0-9a-fA-F]{4}-[0-9a-fA-F]{4}-[0-9a-fA-F]{4}-[0-9a-fA-F]{12}$', 'drs.anv0', 'v2_1b0f158a-86e2-3887-b990-89e3cf2d9082', null, null, false, null, null, null),
        (3609, '2023-07-19 09:43:16.685000', false, null, 'Database of Clusters of Orthologous Genes (COGs). This database defines all orthologs of protein sequences coded by known genomes. The species name, protein name, and phylogenetic tree of orthologous clusters can be viewed through this site. Each cluster is comprised of individual proteins and its paralogs, matched to evolutionarily conserved molecular domains.', 'MIR:00000930', '2023-07-19 09:43:16.685000', 'COG', false, '^COG[0-9]+$', 'cog', 'COG1806', null, null, false, null, null, null);